INSERT INTO `wd_course` (`id`, `institute`, `when_date`, `title`, `desc`, `lecturer`, `section`, `group`, `award`, `award_url`, `url`) VALUES
(1, 'Pluralsight', '2014-06-01', 'AWS Developer Fundamentals', '<p>\n	This course covers the <strong>Amazon Web Services</strong> offerings for compute, storage, databases, messaging and administration. Each module includes a series of demonstrations that show how to interact with <strong>AWS</strong> services through the Management Console, native API and .NET SDK. The course covers classic AWS services like <strong>EC2</strong> as well as brand new services like <strong>DynamoDB</strong>.</p>\n', 'Richard Seroter', 'Software Development', NULL, NULL, NULL, NULL),
(2, 'Pluralsight', '2014-03-01', 'The Elements of Distributed Architecture', '<p>\n	The Elements of Distributed Architecture is about the foundational elements of distributed architecture and about the physics that affect distributed software designs. The goal of this course, which is designed to be independent of specific languages, technologies, and products, is to provide software teams with a shared baseline of concepts and terminologies in the areas of information management, communication, presentation, processing, failure management, security, and safety.</p>\n', 'Clemens Vasters', 'Software Development', NULL, NULL, NULL, NULL),
(3, 'Pluralsight', '2014-02-01', 'Big Data: The Big Picture', '<p>\n	In this course, ZDNet&#39;s Big Data correspondent Andrew Brust teaches you all about <strong>Big Data</strong>. This course will get you up and running with the definitions and technologies you need to know, and the vendors you need to know about. By the end of the course, you&#39;ll know what Big Data is, how it can integrate with conventional database and Business Intelligence (BI) technologies, and how to devise a strategy for adopting Big Data in your organization. No Big Data or <strong>NoSQL</strong> knowledge is required, but a lot will be imparted. This course is aimed at executives and business decision makers, and is actionable for technologists as well.</p>\n', 'Andrew Brust', 'Software Development', 'Databases', NULL, NULL, NULL),
(4, 'Pluralsight', '2014-07-01', 'Career Management 2.0', '<p>\n	In this course you will learn how to take care of your career in a way that will help you have more financial security. Instead of depending on things like your background and past experience, or the help you have expected from companies, HR or bosses, learn how what you can do to empower yourself and be more prepared to weather inevitable changes in your career.</p>\n', 'Jason Alba', 'Personal', NULL, NULL, NULL, NULL),
(5, 'Pluralsight', '2014-07-01', 'Preparing For a Job Interview', '<p>\n	Job interviews can be very difficult and intimidating. When you need a job, it is important to have good job interviewing skills and know what to expect. The only problem is, it is very difficult to get experience with job interviews, because we don&#39;t do them that often. This course is designed to make you feel much more prepared for a developer job interview by going over the process and talking about many of the types of questions you are likely to encounter. In this course we&#39;ll go over the basics of a job interview and talk about specifically what employers are looking for and how you can improve your resume. I&#39;ll teach you some tricks that increase the chances of you getting an interview greatly. We&#39;ll also go over one of the most difficult and scary parts of a developer job interview, solving a coding question on the spot. I&#39;ll walk you through my own personal technique for solving these types of problem and take you step by step through an example, so that you can gain the skills and experience that will help you feel comfortable to tackle these kinds of problems on your own. Our journey will then takes us through some typical interview questions to help you understand what types of thing you should know and prepare for and the best way to answer these types of questions. Then we&#39;ll go through a blazing fast boot camp for computer science questions about data structures, algorithms, bit manipulation, and concurrency... All the fun stuff you forgot about from college. And finally we&#39;ll wrap up by talking about how you can get experience if you don&#39;t have any, and what kind of experience is valuable. If you are looking for a job currently or just want to brush up on your skills to be prepared, this course might be just for you.</p>\n', 'John Sonmez', 'Personal', NULL, NULL, NULL, NULL),
(6, 'Pluralsight', '2013-12-01', 'Developer to Architect', '<p>\n	Are you a developer transitioning into the role of software architect? Are you a developer who has aspirations of becoming software architect? Are you already a software architect but eager to learn more about your craft? In this course you will learn what the role of a software architect entails and why it is so crucial to your organization&#39;s success. You will learn about the skills and knowledge needed to be an effective software architect and about the duties performed during each phase of the project life cycle. Lastly you will learn one of the most important aspect of being a software architect: how to design and communicate a solution to both technical and non-technical stakeholders. This course is your roadmap to becoming a capable and successful software architect.</p>\n', 'Chris Simmons', 'Software Development', NULL, NULL, NULL, NULL),
(7, 'Pluralsight', '2014-07-01', 'Effective Email Communication', '<p>\n	In this course you will learn how to set up your email messages to increase the chances of being opened and responded to, and have the maximum impact on the reader. As you go through this course you will learn how to set up things in your email client, and construct appropriate and impactful messages. You&#39;ll learn how to interact with others as well as reply to complex emails.</p>\n', 'Jason Alba', 'Project Management', NULL, NULL, NULL, NULL),
(8, 'Pluralsight', '2014-07-01', 'Informational Interviews', '<p>\n	Use informational interviews as a powerful tactic to ramp up your networking. Informational interviews are powerful, if done right. In this course we will explore the preparation before the interview, what you do when you are there, and what to do after you have finished the interview.</p>\n', 'Jason Alba', 'Personal', NULL, NULL, NULL, NULL),
(9, 'Pluralsight', '2014-01-01', 'Introduction to Leadership and Management for Developers', '<p>\n	Your ability to have an impact on projects and organizations depends on more than just your coding skill, or your official title. It also depends on your ability to influence people - your team members, your managers, your employees, your clients, and your peers. This course teaches the leadership and management skills that every developer, manager or not, needs in order to succeed.</p>\n', 'Dan Appleman', 'Project Management', 'Management', NULL, NULL, NULL),
(10, 'Pluralsight', '2014-02-01', 'Debugging the Web with FireBug, WebDeveloper, and Fiddler', '<p>\n	As a web developer, you are tasked with developing the server and client-side of your web projects. For the client-side of development, there are a lot of great tools to debug your web pages. In this course we will show you how to use the tools to debug the layout, <strong>JavaScript</strong>, <strong>CSS</strong> and networking in your web projects.</p>\n', 'Shawn Wildermuth', 'Web Development', NULL, NULL, NULL, NULL),
(11, 'Pluralsight', '2014-07-01', 'Web Debugging by Example', '<p>\n	Learn how to debug Web applications using automated memory dumps, and how to detect and fix web server CPU spikes.</p>\n', 'Mike Woodring and Dan Sullivan', 'Web Development', NULL, NULL, NULL, NULL),
(12, 'Pluralsight', '2014-02-01', 'Google Analytics Fundamentals', '<p>\n	Quickly master <strong>Google Analytics</strong> with this hands on, scenario driven course and start measuring the performance of your websites today. This course begins with the basics on how Google Analytics works to collect your website visitor&#39;s activity and when this activity data will be visible in reports to you, as well as, provides you step by step instructions to get the default tracking setup on your site. From there, we add on the types of activity you can track and how you enable tracking for common scenarios, including: tracking page views and events (e.g., link clicks and file downloads), e-commerce transactions, social love (e.g., Likes), and marketing campaigns. We then look at some approaches you can use to protect yourself from noise and information overload, and conclude showing how to use Google Analytics Core Reporting and Management API&#39;s from your own applications and considerations for using Google Analytics in mobile device applications.</p>\n', 'Zoiner Tejada', 'Web Development', NULL, NULL, NULL, NULL),
(13, 'Pluralsight', '2014-03-01', 'SEO Fundamentals', '<p>\n	Do you want to understand what it takes for the search engines to like your website? <strong>Search Engine Optimization</strong> or <strong>SEO</strong> is a powerful way to drive targeted traffic to your website and hopefully increase your bottom line. Yet, with the search engines continually changing their rules SEO may seem confusing and overwhelming. In this course you will learn the basics of SEO and be taught some SEO strategies that will help your site weather the continual search storm. No prior experience with SEO is required for this course.</p>\n', 'Paul Wilson', 'Web Development', NULL, NULL, NULL, NULL),
(14, 'Pluralsight', '2014-04-01', 'ITIL Foundations', '<p>\n	This course is designed to help individuals prepare for the <strong>ITIL</strong> Foundations Certification examination. IT Infrastructure Library is a framework for IT Service Management best practices and can apply to any organization, large or small. Instruction will detail foundation level material surrounding concepts and terminology used in the ITIL Service Lifecycle. Prerequisites: While there are no mandatory prerequisites, ITIL does recommend certification candidates attend formal training. <em>ITIL is a Registered Trade Mark of the Cabinet Office</em>.</p>\n', 'Lowell Amos', 'Project Management', NULL, NULL, NULL, NULL),
(15, 'Pluralsight', '2014-01-01', 'Bootstrap 3', '<p>\n	Building great looking websites that work well with different sized devices can be a challenge. By utilizing <strong>Twitter&#39;s Bootstrap 3</strong> framework, you can meet that challenge head on. Bootstrap 3 is a mobile first responsive design framework for structuring your website&#39;s HTML. It includes a great grid system, responsive design, <strong>CSS</strong> typography and components to solve many of the most common design challenges that face web developers today.</p>\n', 'Shawn Wildermuth', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(16, 'Pluralsight', '2014-05-01', 'Website Performance', '<p>\n	With the rise of mobile networks and devices, website performance is now absolutely critical to building good websites and web applications. Kyle dives deep into everything web performance from resource loading, to thread, animations, <strong>JSON</strong>, minification, image optimization and more!</p>\n', 'Kyle Simpson', 'Web Development', NULL, NULL, NULL, NULL),
(17, 'Pluralsight', '2014-04-01', 'NoSQL: The Big Picture', '<p>\n	An executive briefing on <strong>NoSQL</strong> databases, with discussion of why they&#39;re popular, where they work well, and where they don&#39;t. Includes extensive guidance in applying the right economic, technological and business criteria to evaluation of NoSQL adoption in your organization.</p>\n', 'Andrew Brust', 'Software Development', 'Databases', NULL, NULL, NULL),
(18, 'Pluralsight', '2014-05-01', 'Productivity Tips for the Busy Tech Professional', '<p>\n	Everyone is busy, but some seem to get more done than others. In this course we look at 17 tips -- compiled from the experiences of Pluralsight authors -- for getting more meaningful work done. The tips cover some core principles to follow, as well as day to day activities that can help you take control of your schedule and leave behind the overwhelming feeling that many people experience.</p>\n', 'Richard Seroter', 'Project Management', 'Leadership', NULL, NULL, NULL),
(19, 'Pluralsight', '2014-04-01', 'Web Security and the OWASP Top 10: The Big Picture', '<p>\n	Security on the web is becoming an increasingly important topic for organisations to grasp. Recent years have seen the emergence of the hacktivist movement, the increasing sophistication of online career criminals and now the very real threat posed by nation states compromising personal and corporate security. The <strong>Open Web Application Security Project </strong>gives us the <strong>OWASP</strong> Top 10 to help guide the secure development of online applications and defend against these threats. This course takes you through a very well structured, evidence based prioritisation of risks and most importantly, how organisations building software for the web can protect against them.</p>\n', 'Troy Hunt', 'Web Development', NULL, NULL, NULL, NULL),
(20, 'Pluralsight', '2014-07-01', 'LinkedIn Fundamentals', '<p>\n	<strong>LinkedIn</strong> is the professional network where you find contacts and they can find you. This course helps you create your own strategies and implement tactics to grow your network, improve individual relationships and share your brand appropriately. Whether you want to tap into the hidden job market, find new freelance opportunities, or get funding for your project, LinkedIn can be a powerful tool for you.</p>\n', 'Jason Alba', 'Personal', NULL, NULL, NULL, NULL),
(21, 'Pluralsight', '2014-02-01', 'Agile Estimation', '<p>\n	We&#39;re agile, so we don&#39;t have to estimate and have no deadlines, right? Wrong! This course will dive into the problem with estimation in projects today and then a complete overview of the concept of agile estimation and the notion of re-estimation. We&#39;ll learn about user stories, story points, planning poker , product backlog, team velocity, how to apply them all to estimation and iterative re-estimation. We will then take an alternative approach and look at using real metrics to limit the guesswork in estimating and still run a team that produces predictably and reliably. The course will round out with a discussion on how to &#39;sell&#39; the concept of <strong>Agile Estimation</strong> in various environments such as consulting or fixed cost projects. Upon completion of this course you will be able to perform Agile Estimation in your organization.</p>\n', 'Stephen Forte', 'Project Management', 'Agile', NULL, NULL, NULL),
(22, 'Pluralsight', '2014-01-01', 'Agile Release Management', '<p>\n	In this course you will learn how to establish a product life cycle using agile release management. You will be taken through all the necessary steps including transition from a less than agile world, enterprise and release planning, mapping of roles and stakeholder management. This course is targeted towards agile practitioners in managing roles.</p>\n', 'Jan-Erik Sandberg', 'Project Management', 'Agile', NULL, NULL, NULL),
(23, 'Pluralsight', '2014-01-01', 'Agile Team Practices with Scrum', '<p>\n	This course is much different than most of the other courses in the <strong><em>Pluralsight</em></strong> On Demand! library. As a course focused purely on software methodology and team processes, it doesn&#39;t contain any coding demos or samples for download. In classroom environments, this material is complimented with a lot of discussion, what-if scenarios, and group exercises. This course is a great way to introduce <strong>Agile Software Development</strong> practices to your team or organization. In addition to learning Scrum, students learn effective techniques for managing Agile teams and projects. Students and teams come away with a solid foundation to begin executing their first <strong>Scrum Sprint</strong>. This online material is offered here primarily as reference material for customers who have already taken the instructor-led version of this course. To dramatically improve your team&#39;s Agility, consider booking an instructor-led course that provides the ideal experience to help you deliver software iteratively and incrementally.</p>\n', 'David Starr', 'Project Management', 'Agile', NULL, NULL, NULL),
(24, 'Pluralsight', '2014-03-01', 'Customizing Your Team Workflow with the Best of Kanban and Scrum', '<p>\n	If you have doubts choosing which methodology to use, this course will give you a comparison of <strong>Kanban</strong> and <strong>Scrum</strong>, making your choice easier. By watching this course you will learn how to take the best of both, Scrum and Kanban, and how to make a winning combination for your team and project.</p>\n', 'Milena Pajic', 'Project Management', 'Agile', NULL, NULL, NULL),
(25, 'Pluralsight', '2014-02-01', 'JIRA Fundamentals', '<p>\n	<strong>JIRA</strong> is a world leading tracker used by large and small teams for planning, building and releasing great software. In this course you will learn how to setup and maintain a JIRA installation, as well as configuring it for the needs of your organization by using proven best practices.</p>\n', 'Jan-Erik Sandberg', 'Project Management', NULL, NULL, NULL, NULL),
(26, 'Pluralsight', '2014-04-01', 'Kanban Fundamentals', '<p>\n	<strong>Kanban</strong> is a set of principles that can be applied to processes to improve their flow and reduce waste. In this course, Steve demonstrates the basic principles and concepts of kanban and applies them at the individual and team level.</p>\n', 'Steve Smith', 'Project Management', 'Agile', NULL, NULL, NULL),
(27, 'Pluralsight', '2014-06-01', 'Automated Web Testing with Selenium', '<p>\n	Creating automated tests for a web application can be challenging. Two of the biggest barriers to getting started are picking an automation tool and developing a framework for writing the tests. This course explores how to use the popular browser automation framework, Selenium, to create automated tests for web applications. We will examine using Selenium to directly record from within a <strong>Firefox</strong> browser, as well as using <strong>C#</strong> to automate the web browser using <strong>Selenium&#39;s</strong> API. We will also explore how to distribute tests over multiple machines using Selenium Server&#39;s grid capabilities. The course concludes with the implementation of a simple, maintainable framework for testing a web application using Selenium.</p>\n', 'John Sonmez', 'Web Development', NULL, NULL, NULL, NULL),
(28, 'Pluralsight', '2014-05-01', 'Troubleshooting Skills', '<p>\n	No matter what language or framework you use, or how many APIs you memorize, there&#39;s one skill you&#39;ll use daily: troubleshooting. This concise course walks through seven proven troubleshooting strategies. You&#39;ll hear a summary of each strategy and a real-world story where it helped us find and fix a specific problem.</p>\n', 'Geoffrey Grosenbach', 'Software Development', NULL, NULL, NULL, NULL),
(29, 'Pluralsight', '2014-05-01', 'Understanding and Eliminating Technical Debt', '<p>\n	If you are working on a large and successful commercial project, technical debt can gradually accumulate as you take the decision to do things the quick way rather than the right way. If care isn&#39;t taken, technical debt can threaten the long term success of your project. In this course we take a broad look at the wide variety of forms that technical debt can appear in, and look at how you can identify it and quantify it with metrics. We also look at the challenges associated with repaying it, including getting the rest of the development team and your managers to view it as a priority. We conclude the course with advice about techniques and action plans for repaying the debt.</p>\n', 'Mark Heath', 'Project Management', NULL, NULL, NULL, NULL),
(30, 'Pluralsight', '2014-06-01', 'Clean Code: Writing Code for Humans', '<p>\n	Are you a technical debt generator? Do your co-workers cringe at the thought of having to work with your code? Clean code is the art of writing code humans can understand. Elevate your professionalism and increase your code quality by writing with the reader in mind! We&#39;ll walk through three core clean coding practices: 1) Select the right tool for the job. 2) Optimize the signal to noise ratio. 3) Create self documenting logic. These practices are the foundation for a professional development career and provide developers a clear vocabulary for evaluating code quality.</p>\n', 'Cory House', 'Software Development', NULL, NULL, NULL, NULL),
(31, 'Pluralsight', '2013-12-01', 'Git Fundamentals', '<p>\n	<strong>Git</strong> is a popular distributed version control system (<strong>DVCS</strong>). In this course, learn how to create a local repository, commit files, push changes to a remote repository, fix errors in your commits, and many of Git&#39;s other features. Understand the difference between the working copy, staging area, and repository itself. Come learn the power of Git.</p>\n', 'James Kovacs', 'Software Development', NULL, NULL, NULL, NULL),
(32, 'Pluralsight', '2014-07-01', 'Developing a Killer Personal Brand', '<p>\n	In this course you will learn about personal branding and how it applies to you. We will go over personal branding basics and foundations. We will learn about different tools and platforms to create, enhance and share your personal brand. We will talk about how to empower others to talk about you the right way so you can enjoy the power of word of mouth marketing. We will dive into examples of how people have used some of these tools and tactics for their own personal brands. This course is designed to give you empowerment as an employee, business owner and leader and be in a position to give more to your network and your job.</p>\n', 'Jason Alba', 'Personal', NULL, NULL, NULL, NULL),
(33, 'Coursera', '2014-02-01', 'Internet History, Technology, and Security', '<p>\n	What is the Internet? How was it created? How does it work? How do we secure communications on the Internet?</p>\n', 'Charles Severance', 'Web Development', NULL, NULL, NULL, NULL),
(34, 'Coursera', '2013-11-01', 'Principles of Reactive Programming', '<p>\n	Learn how to write composable software that is event driven, scalable under load, resilient and responsive in the presence of failures. Model systems after human organizations or inter-human communication.</p>\n', 'Martin Odersky, Erik Meijer and Roland Kuhn', 'Software Development', NULL, NULL, NULL, NULL),
(35, 'Coursera', '2013-09-01', 'Functional Programming Principles in Scala', '<p>\n	Learn about functional programming, and how it can be effectively combined with object-oriented programming. Gain practice in writing clean functional code, using the <strong>Scala</strong> programming language.</p>\n', 'Martin Odersky', 'Software Development', NULL, NULL, NULL, NULL),
(36, 'Coursera', '2014-09-01', 'Web Application Architectures', '<p>\n	Learn how to build and deploy modern web application architectures and applications that run over the Internet, in the cloud using a browser as the user interface.</p>\n', 'Greg Heileman', 'Web Development', NULL, NULL, NULL, NULL),
(37, 'YellowHouse', '2013-12-01', 'Agile Scrum Master Training', '<p>\n	The two day course prepares you for the <strong>PSM</strong> (<strong>Professional Scrum Master</strong>) exam.</p>\n', 'Chris Fortuin', 'Project Management', 'Agile', NULL, NULL, NULL),
(38, 'Lynda', '2014-11-14', 'Debugging PHP: Advanced Techniques', '<p>\n	Debug your <strong>PHP</strong> code efficiently with a variety of client and server-side tools. In this concise course for experienced PHP developers, author Jon Peck demonstrates how to leverage PHP&#39;s built-in tools, as well as the <strong>Xdebug</strong> and <strong>Firebug</strong> extensions, and <strong>FirePHP</strong> libraries to improve the quality of your code and reduce troubleshooting overhead. This course covers installation of <strong>Xdebug</strong> on <strong>Apache</strong> as well as working with the <strong>NetBeans IDE</strong> (integrated development environment). Jon then introduces native web browser developer tools for <strong>Firefox</strong> and <strong>Chrome</strong>, and demonstrates browser independent web debugging tools. Best practices for debugging and profiling web application failures and performance issues are also covered.</p>\n', 'Jon Peck', 'Web Development', 'Programming Languages', NULL, NULL, NULL),
(39, 'Pluralsight', '2014-07-17', 'Scrum Development with Jira & JIRA Agile', '<p>\n	Having a great idea is just the start, implementation and execution are key. Improve your chances of success by using <strong>Agile development methodology</strong> and support your efforts with the right tools: <strong>Jira</strong> and <strong>Jira Agile</strong> (formerly <strong>GreenHopper</strong>).</p>\n', 'Xavier Morera', 'Project Management', 'Agile', NULL, NULL, NULL),
(40, 'Pluralsight', '2014-07-17', 'phpMyAdmin Fundamentals', '<p>\n	<strong>phpMyAdmin</strong> is a free and open source tool written in <strong>PHP</strong> for the administration of <strong>MySQL</strong> via a web browser. It can perform various tasks such as creating, modifying or deleting databases, tables, fields, and rows as well as executing <strong>SQL</strong> statements or managing users and permissions. This course will guide you through maximizing the power of phpMyAdmin to get productive quickly with MySQL.</p>\n', 'Pinal Dave', 'Software Development', 'Databases', NULL, NULL, NULL),
(41, 'Pluralsight', '2014-07-18', 'Introduction to Git', '<p>\n	<strong>Git</strong> was built for the modern developer&#39;s workflow. Easy branching, full capability even when offline, and fast operation make other source code management systems feel underpowered compared with git! This course will teach you how to install and use Git. You&#39;ll learn how to create a repository, use branches, and work with remote repositories.</p>\n', 'Geoffrey Grosenbach', 'Software Development', NULL, NULL, NULL, NULL),
(42, 'Pluralsight', '2014-07-18', 'Advanced Git', '<p>\n	We learn a lot by watching other developers work, and one of the people who have made the biggest change in the way we use <strong>Git</strong> is developer Ben Hoskings. In this screencast you&#39;ll learn just what you need to know in order to understand Git&#39;s inner workings. You&#39;ll see how Ben has enhanced Git with his own scripts (you&#39;ll get a copy). You&#39;ll learn how to get out of trouble, how to plan merges and branches, how to search your repository, and what the reflog is. We&#39;ve added a bonus section at the end that shows a few more crucial commands. There&#39;s a lot to know about Git, but there are only a few commands you really need to know and use daily. This 60 minute course will get you there.</p>\n', 'Ben Hoskings', 'Software Development', NULL, NULL, NULL, NULL),
(43, 'Pluralsight', '2014-07-18', 'Social Media: The Big Picture', '<p>\n	If you know social media is important to your business, but you don&#39;t know where to start, this course is built just for you. Using real life examples of how companies have succeeded and failed in the digital world, we will share knowledge and skills necessary to achieve your social media goals. Plus, we will provide insights into social media trends and resources that are reshaping the future of digital marketing.</p>\n', 'Amber Mac', 'Web Development', NULL, NULL, NULL, NULL),
(44, 'Pluralsight', '2014-07-18', 'GitHub for Windows Developers', '<p>\n	<strong>GitHub</strong> and the source control system <strong>Git</strong> are growing in popularity. This course shows developers how to effectively use GitHub, Git, and GitHub for Windows. The course starts with an introduction to Git. From there, we show the GitHub site and how to work with its repositories. As you begin to learn about GitHub for Windows, we will start with some basics, move on to team oriented information, and then cover the social coding aspects of GitHub.</p>\n', 'Brendan Enrick', 'Software Development', NULL, NULL, NULL, NULL),
(45, 'Pluralsight', '2014-07-19', 'Effective Phone Skills', '<p>\n	In this course, you will learn how to prepare better for different types of phone calls. You will understand the power of your body language and how you use your voice during calls. You will learn about the power of follow up, and how to respond to uncomfortable situations.</p>\n', 'Jason Alba', 'Project Management', 'Management', NULL, NULL, NULL),
(46, 'Pluralsight', '2014-07-19', 'Generating HTML5 Layouts Using Photoshop', '<p>\n	A short introduction that takes the viewer from a graphic asset created using <strong>Photoshop</strong>, and shows them how to slice it up and produce an <strong>HTML5</strong> ready, reusable asset that can be included in any web project.</p>\n', 'Peter Shaw', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(47, 'Pluralsight', '2014-07-19', 'Web vs Apps: The Big Picture', '<p>\n	As software engineers, we live in an age of decadence. Not only has the mobile revolution brought us amazing power, but also a consumer grade computing environment for all. As we go to build such solutions, we have found people quickly come to the big question: Web, or native app? In this course we will try to tear apart that question and get to the nuance that lies within.We will use computing history to learn from past mistakes and triumphs. We will then look into the advantages and flaws of the technology behind the Web and native platforms. We quickly bisect the fact that there are two sides to the question: Using the Web as a delivery platform? Or, as an experience platform? At Walmart Labs we have gone through these challenges, so we use our own example to add to other case studies to give an overview of the problem and how you can hope to use the Web and native together more as peanut butter and jelly.</p>\n', 'Ben Galbraith and Dion Almaer', 'Web Development', NULL, NULL, NULL, NULL),
(48, 'Pluralsight', '2014-07-19', 'How to Have a Better Career in Software', '<p>\n	During my 20+ years in the software community, I&#39;ve picked up on a common set of patterns that surround developers who always seemed to excel in their careers. Developers who had the best careers seemed to do a specific set of things that other developers did not. This course lays out the principles, and how to apply them to your software career. No single checklist guarantees success, but following these principles will improve your chances of finding success. There are probably some additional items we could add, and you could argue that some of these are more important than others. But from my experience, these are the core set of things you need to do to have a better career in software.</p>\n', 'Doug Turnure', 'Software Development', NULL, NULL, NULL, NULL),
(49, 'Pluralsight', '2014-07-19', 'CompTIA Project+: Part 1', '<p>\n	Part 1 of 2 in the <strong>CompTIA Project+</strong> series, covering the fundamentals of IT project management. You will learn pre-project setup; project planning; project execution and delivery; change, control, and communication; as well as project closure. This course is intended for those who have little to no experience that want to pursue a career in project management, and those who wish to learn the fundamentals of good project management.</p>\n', 'Bill Kulterman', 'Project Management', NULL, NULL, NULL, NULL),
(50, 'Pluralsight', '2014-07-20', 'CompTIA Project+: Part 2', '<p>\n	Part 2 of 2 in the <strong>CompTIA Project+ </strong>series, covering the fundamentals of IT project management. You will learn pre-project setup; project planning; project execution and delivery; change, control, and communication; as well as project closure. This course is intended for those who have little to no experience that want to pursue a career in project management, and those who wish to learn the fundamentals of good project management.</p>\n', 'Bill Kulterman', 'Project Management', NULL, NULL, NULL, NULL),
(51, 'Pluralsight', '2014-07-21', 'Mobile First Responsive Web Design', '<p>\n	<strong>Responsive web design</strong> is a recent strategy for building web sites that can respond and adapt to multiple devices and their respective resolutions. Mobile first is the concept of creating the design for your mobile web site first, and then building out that design for larger resolutions. This course covers the concepts that developers need to know to be able to work in this new way of designing web sites.</p>\n', 'Jon Flanders', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(53, 'Pluralsight', '2014-07-22', 'Meet CoffeeScript', '<p>\n	<strong>CoffeeScript</strong> has exploded in popularity since April 2011. It was talked about in every other presentation at <strong>JSConf</strong>. It&#39;s made enough waves that some language features popularized by CoffeeScript are planned for inclusion in future versions of JavaScript itself. In this course, you&#39;ll learn not only how to use CoffeeScript, but also how to write code in clean CoffeeScript style. You&#39;ll build a cash register application in test-first fashion. Thanks to technical editing from CoffeeScript author Jeremy Ashkenas and committer Michael Ficarra, you&#39;ll get authoritative insights into the best ways to write and use CoffeeScript.</p>\n', 'Geoffrey Grosenbach', 'Web Development', NULL, NULL, NULL, NULL),
(54, 'Pluralsight', '2014-07-22', 'Best Practices for Requirements Gathering', '<p>\n	This course begins with the fundamentals of the requirements process, including project definition template, the uncertainty of requirements, nailing down stakeholders, and the skills needed to be a requirements analyst. Next we explore how requirements gathering in an Agile environment works. And lastly, we review practical tools to guide the student from user cases/stories, work flows, mockups, business rules, and data model to produce a solid specification that meets a customer&#39;s expectations.</p>\n', 'Michael Krasowski', 'Project Management', NULL, NULL, NULL, NULL),
(55, 'Pluralsight', '2014-07-22', 'Meet PostgreSQL', '<p>\n	For many years, serious database aficionados have preferred the <strong>Postgres</strong> database system. It&#39;s industrial strength - many installations store terabytes of data. It&#39;s fully open source (not controlled by a predatory corporation). It&#39;s fast and easy to use. Full text search is built-in. It&#39;s the default database for all applications deployed to Heroku. In this course, respected database expert (and world-traveling teacher of The Database is Your Friend workshops) Xavier Shay teaches the most useful and powerful features of Postgres. You&#39;ll learn to use the built-in full-text search and optimize it. You&#39;ll work with triggers and indexes. You&#39;ll save yourself hours of frustration with tips for using Postgres smoothly with Rails 3.</p>\n', 'Xavier Shay', 'Software Development', 'Databases', NULL, NULL, NULL),
(56, 'Pluralsight', '2014-07-23', 'Java Web Fundamentals', '<p>\n	Many <strong>Java</strong> web frameworks, such as <strong>Struts</strong>, are built on top of the <strong>Servlet</strong> and <strong>JavaServer Page</strong> specifications and base libraries. To fully understand how these frameworks operate, and to be able to take full advantage of the facilities they offer, you should understand the foundations such frameworks are built on. This course takes you through building a web application using the base Servlet and JavaServer Page libraries. The course discusses the <strong>Model-View-Controller</strong> pattern using Servlets as the Controller and JavaServer Pages as the View. You will also learn how to hide complex UI interaction inside tag libraries. The course will show you how it is possible to build a web application using these fundamental technologies, and how other frameworks are built.</p>\n', 'Kevin Jones', 'Web Development', 'Programming Languages', NULL, NULL, NULL),
(57, 'Pluralsight', '2014-07-24', 'Onboard Yourself: What to Do After You Land Your Dream Job', '<p>\n	This course helps you take ownership of the onboarding process beyond what HR and your boss will do. This course will help you assimilate into the company culture, understand the political landscape, and gain insight into your company&#39;s products and services. Employees who own their personal onboarding process should be more productive and valuable to the company and industry.</p>\n', 'Jason Alba', 'Personal', NULL, NULL, NULL, NULL),
(58, 'Pluralsight', '2014-07-25', 'Architecting Highly Available Systems on AWS', '<p>\n	This course describes the techniques and best practices for composing highly available distributed systems on the <strong>AWS</strong> platform. Throughout the course, we build up a web application that takes advantage of AWS storage, databases, compute, messaging, DNS, and more.</p>\n', 'Richard Seroter', 'Software Development', NULL, NULL, NULL, NULL),
(59, 'Pluralsight', '2014-07-31', 'Project Management Professional (PMP) Project Initiation', '<p>\n	This course will review preparing for the Project Management Professional exam and Project Initiation Processes. Initiation of a project covers two distinct areas; development of the project charter and identification of stakeholders involved in the project. You will learn about both processes and have a good understanding of Project Initiation and how it relates to the PMP exam.</p>\n', 'Ashley Hunt', 'Project Management', 'PMP', NULL, NULL, NULL),
(60, 'Pluralsight', '2014-07-31', 'DevOps: The Big Picture', '<p>\n	What is <strong>DevOps</strong>, really? In this course, we look the problems faced by today&#39;s IT departments and how a DevOps transformation can help focus on value and streamlined delivery. We&#39;ll explore the key cultural changes necessary, where organizational change is required, and how to confront the inevitable objections. Automation and technology play huge roles in DevOps success; in this course we&#39;ll analyze the major capability areas and which technologies can get your team on its way.</p>\n', 'Richard Seroter', 'Web Development', NULL, NULL, NULL, NULL),
(61, 'Pluralsight', '2014-08-01', 'Turning the Corporate Ladder into an Escalator', '<p>\n	Learn how to use the Escalator Principle to get everyone in the company involved in your next promotion. This course will teach you techniques to employ and techniques to avoid when it comes to moving up the corporate ladder. These ideas are simple to understand and easy to implement.</p>\n', 'Jay Mcfarland', 'Personal', NULL, NULL, NULL, NULL),
(62, 'Pluralsight', '2014-08-01', 'Productivity for Programmers', '<p>\n	Programming is hard work that requires creativity, problem solving, and even physical stamina. In this course, Calvin will teach you how to set achievable, measurable goals, prepare for the work of thinking, achieve focus, find shortcuts, and maximize your natural rhythm and energy. Part 2 dives into controlling email, where Calvin presents a system that he has developed and taught to many people over several years. It combines ideas from GTD and Inbox Zero and adds other concrete strategies for facing up to your email and attacking it with a consistent plan.</p>\n', 'Calvin Correli', 'Project Management', 'Management', NULL, NULL, NULL),
(63, 'Pluralsight', '2014-08-01', 'Communications: How to Talk, Write, Present, and Get Ahead!', '<p>\n	Communicating effectively is one of the most essential aspects of your job, and is the key to progressing in your career. But how do you do it? Most companies do not provide training on how to communicate so this course fills that gap for you. Firstly you&#39;ll learn the foundational skills necessary for any form of communication. Then you&#39;ll learn the art of running a successful meeting, along with how to handle some specific meeting scenarios like code reviews and 1-1s. You&#39;ll learn how to write effectively, whether emails, articles, or reports, and how to start and maintain a popular blog. Then you&#39;ll move on to planning and writing a presentation, including how to pick a topic, formulate an effective slide-deck template, and write the presentation content, all depending on what type of presentation it is. Finally, you&#39;ll learn how deliver a top-notch presentation, including preparation, managing nerves, and a whole raft of tips and tricks on what to do and what not to do. In today&#39;s busy work environment you can&#39;t afford to have sub-standard communication skills or you&#39;ll be left behind - but if you watch this course and practice what you learn in it, you&#39;ll boost your skills and start to get ahead! This course is perfect for anyone working in the I.T. industry, with any amount of technical experience and communication skills.</p>\n', 'Paul Randal', 'Project Management', 'Management', NULL, NULL, NULL),
(64, 'Pluralsight', '2014-08-03', 'Getting Started With Jenkins Continuous Integration', '<p>\n	<strong>Jenkins</strong> is one of the most popular tools for doing continuous integration on ANY platform or technology! One of the things that makes Jenkins so popular is how flexible it is to handle just about any kind of build or continuous integration process you can think of through the hundreds of plugins that are available. In this course you will learn everything you need to know to get started using Jenkins and setup your first continuous integration server. We&#39;ll cover installing Jenkins, configuring Jenkins and getting a basic job running. Once we are confident in the basic functionality of Jenkins we&#39;ll move on and talk about all the plugins that are available and how you might use them. Finally, we&#39;ll take a look at the big picture and show you what you can really do with Jenkins. Along the way I&#39;ll give you some great tips that will help you pick the best plugins for Jenkins and give you some good strategies for successfully bringing you build system into Jenkins with little headache. By the end of this course you should feel confident installing Jenkins and setting up basic jobs. You should also have a clear picture of what you can do with Jenkins and how to expand its capabilities. If you&#39;ve been wanting to learn about Jenkins, but didn&#39;t know where to start, this course might be just what you need.</p>\n', 'John Sonmez', 'Software Development', NULL, NULL, NULL, NULL),
(65, 'Pluralsight', '2014-08-04', 'MySQL Query Optimization and Performance Tuning', '<p>\n	Performance is one of the most essential aspects of any application. Everyone wants their server to perform optimally and at the best efficiency. In this course we will understand the basics of query optimization and look at practical tips and tricks for performance tuning.</p>\n', 'Pinal Dave', 'Software Development', 'Databases', NULL, NULL, NULL),
(66, 'Pluralsight', '2014-08-04', 'What''s New in the OWASP Top 10 for 2013', '<p>\n	The Top 10 Web application security risks produced by <strong>OWASP</strong> is an evolving resource that helps organizations focus on the most prominent risks in web security today. Every few years we see a revision; the types of attacks we&#39;re witnessing change, the defenses change, and the risk and associated priority changes. OWASP adapts to this changing environment and recently made available the 2013 edition of the Top 10. This course is designed to help those who already have an awareness of the Top 10 understand what&#39;s new in the latest edition and how the landscape has changed in three short years. It also introduces the concept of &#39;Risk Assessments&#39; and provides further resources to help go beyond just the Top 10 risks.</p>\n', 'Troy Hunt', 'Web Development', NULL, NULL, NULL, NULL),
(68, 'Pluralsight', '2014-08-06', 'Creating Effective User Stories', '<p>\n	Do you love the idea of capturing customer requirements with lightweight user stories rather than formal requirements documents? Of course you do, but many teams find that while the idea of user stories sounds great, they struggle to create effective user stories that are truly useful for communicating between themselves and their customer. In this course, we&#39;ll learn concrete strategies for creating lightweight user stories that truly capture our customer&#39;s needs, as well as tips for avoiding the most common pitfalls that many teams fall into when they first begin working with user stories.</p>\n', 'Jeremy Jarrell', 'Project Management', 'Agile', NULL, NULL, NULL),
(69, 'Pluralsight', '2014-08-08', 'Introduction to HTML5 and CSS3', '<p>\n	Christopher Schmitt, the author of <strong><em>HTML5 Cookbook</em></strong>, explains semantics and <strong>HTML5</strong> features such as audio, video and geolocation. He dives into <strong>CSS3</strong> and then dazzles us with his <strong>CSS</strong> flag using many of CSS3&#39;s features.</p>\n', 'Christopher Schmitt', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(70, 'Pluralsight', '2014-08-10', 'Relational Database Design', '<p>\n	In this course, you will learn all the skills required to design good databases. This starts with information gathering: how to find all required information, and how to ask questions without miscommunications. You will learn how to abstract the information gathered into a data model, how to normalize the data model so that your database will be free of anomalies, and how to transform the final, normalized data model into a relational database design - ready to be implemented.</p>\n', 'Hugo Kornelis', 'Software Development', 'Databases', NULL, NULL, NULL),
(71, 'Pluralsight', '2014-09-03', 'The Art of Public Speaking and Effective Presentations', '<p>\n	Tell a story, engage the audience, leave them inspired. This course provides a road-map for delivering effective presentations and motivating an audience through forming your message, designing visuals and demos, preparing for the unexpected, and effective delivery strategies. By the end of this course, you will learn many techniques on how to become a more effective presenter.</p>\n', 'John Papa', 'Project Management', 'Leadership', NULL, NULL, NULL),
(72, 'Pluralsight', '2014-09-04', 'Play by Play: Lea Verou', '<p>\n	Watch a live coding session in which Lea Verou implements the classic Conway&#39;s <strong>Game of Life</strong> in the browser using <strong>HTML</strong>, <strong>CSS</strong>, and <strong>JavaScript</strong>. Play by Play is a series where you get a rare view into the workflows and thought processes of top admins, developers, and designers. This is not a planned or rehearsed presentation, but a live, unrehearsed problem solving and troubleshooting session where you see an expert think through issues and design solutions, as they do in the real world every day.</p>\n', 'Lea Verou, Geoffrey Grosenbach', 'Web Development', NULL, NULL, NULL, NULL),
(73, 'Lynda', '2014-09-05', 'PHP 5.5 First Look', '<p>\n	Join author Jon Peck as he demonstrates new functionality in <strong>PHP 5.5</strong>, including generators, the try-catch-finally execution model, and a brand-new password hashing API. A number of existing behaviors, such as the foreach() and empty() functions, have also been updated, and Jon explores what changed and how it can be used. Throughout this course, you&#39;ll learn to add new functionality to a simple deck of cards class using these new and updated features, and how to use them for the basis of your own project.</p>\n', 'Jon Peck', 'Web Development', 'Programming Languages', NULL, NULL, NULL),
(74, 'Lynda', '2014-09-05', 'PHP 5.4 New Features', '<p>\n	In this course, author Drew Falkman shows how to install the latest version of <strong>PHP</strong>, the popular web application server, and reviews the performance enhancements and language improvements in the <strong>5.4</strong> release, including short array syntax, function arrays, and support for the $this reference to current objects in closures. The course also introduces traits, the mechanism for code reuse in single inheritance languages such as PHP.</p>\n', 'Drew Falkman', 'Web Development', 'Programming Languages', NULL, NULL, NULL),
(75, 'Lynda', '2014-09-05', 'Object-Oriented Programming with PHP', '<p>\n	Whether you&#39;re enhancing or optimizing existing code or just starting from scratch, there&#39;s never a better time to start integrating object-oriented design techniques. This course shows how to integrate the principles of object-oriented programming into the build of a <strong>PHP</strong> driven web page or application. After an overview of what objects and classes are and why they should be used, author Jon Peck dives into creating and instantiating objects, then defining the class relationships and interactions that will form the basis of your coding arsenal. The course also shows how to leverage PHP objects and implement design patterns, and looks at steps you can take to continue adding to your programming tool belt.</p>\n', 'Jon Peck', 'Web Development', 'Programming Languages', NULL, NULL, NULL);
INSERT INTO `wd_course` (`id`, `institute`, `when_date`, `title`, `desc`, `lecturer`, `section`, `group`, `award`, `award_url`, `url`) VALUES
(76, 'Pluralsight', '2014-09-15', 'Gathering Good Requirements for Developers', '<p>\n	Getting good requirements from the business users is a difficult task, and one for which most developers have never been adequately trained. In this course, you&#39;ll learn the key skills, techniques, and tools used to capture requirements. You&#39;ll learn to validate that the requirements are correct, how to trace them through design and testing, and how to ensure that the users understand what they&#39;re asking for. Along the way you&#39;ll see some role playing situations where requirements are gathered out of difficult business users and how to handle any objections.</p>\n', 'Robert Bogue', 'Project Management', NULL, NULL, NULL, NULL),
(77, 'Pluralsight', '2014-09-16', 'Get Started With HTML5 Boilerplate', '<p>\n	When you start a new project, it&#39;s unlikely you start with a blank <strong>HTML</strong> file. You probably have some kind of starting template, or your IDE builds a rough file with some elements preloaded. That&#39;s what <strong>HTML5 Boilerplate</strong> is: a starter template to use on all your projects. HTML5 Boilerplate is built and used by some of the most respected names in the industry, and is packed full of standards-compliant and browser-friendly code to make sure that all of your projects get off on the right foot.</p>\n', 'Chris Reynolds', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(78, 'Pluralsight', '2014-09-16', 'MySQL Backup and Recovery Fundamentals', '<p>\n	Data is very important to any application and business. It is very important that every business plan for data safety. Database backup strategies are often discussed after the disaster has already happened. In this introductory course we will explore a few of the basic backup strategies every business should implement for data safely. We will explore how we can recover our server quickly after any unfriendly incident to our <strong>MySQL</strong> database.</p>\n', 'Pinal Dave', 'Software Development', 'Databases', NULL, NULL, NULL),
(79, 'Pluralsight', '2014-09-17', 'Google Maps API: Get Started', '<p>\n	This course introduces beginning to intermediate <strong>JavaScript</strong> developers to the <strong>Google Maps API</strong>, a powerful library that enables developers to harness the power of the Google Maps platform and build web mapping applications. The course shows how Google Maps works, how to embed a dynamic map within a web page, set its extent, add and symbolize geometry to display data, and take advantage of web services to add extra functionality to your applications.</p>\n', 'Mark Lewin', 'Web Development', NULL, NULL, NULL, NULL),
(80, 'Lynda', '2014-09-17', 'Agile Project Management', '<p>\n	<strong>Agile project management</strong> allows you to produce smaller deliverables more frequently and efficiently, making it an excellent choice for teams that work in product development, programming, business analysis, and other collaborative areas. But it&#39;s a fragile process that requires the right scope, goals, and management. In this course, author and Project Management Professional Bob McGannon shows you the tools and techniques you need to successfully manage a project through the agile life cycle. Learn how to use agile for the right projects and then walk through the four major phases in the cycle, from scoping the work and designing your sprint structure to collecting requirements, managing the project without interfering in the rapid build process, adapting to feedback, and closing the project. In the bonus chapter, Bob discusses real-life challenges he has encountered running agile projects, giving you real-world perspective into the project life cycle.</p>\n', 'Bob McGannon', 'Project Management', 'Agile', NULL, NULL, NULL),
(81, 'Lynda', '2014-09-18', 'Leadership Fundamentals', '<p>\n	Do you want to cultivate leadership traits that will help you inspire your team, successfully manage change and conflict, and better serve the needs of your organization? In this course, leadership consultant and <em><strong>lynda.com</strong></em> Director of Learning and Development Britt Andreatta explains what real leadership is, how to assess your strengths, and ways to cultivate the traits the best leaders employ to make their organizations strong and innovative. The course includes information on developing and mentoring your team, creating an engaging workplace, developing political savvy, analyzing your industry, and honing your emotional intelligence.</p>\n', 'Britt Andreatta', 'Project Management', 'Leadership', NULL, NULL, NULL),
(82, 'Lynda', '2014-09-19', 'Stepping Up to Leadership', '<p>\n	Learn the seasoned leadership tips of Scott Blanchard, son of Ken Blanchard, the coauthor of The One Minute Manager, who is continuing his father&#39;s legacy as a global business-training leader. Scott explains how to build a strong leadership foundation by first knowing yourself-your strengths, your weaknesses, and your temperament. Then he discusses the best ways to build relationships, integrity, and trust; get results by building commitment and motivating employees; and chart a path to leadership success.</p>\n', 'Scott Blanchard', 'Project Management', 'Leadership', NULL, NULL, NULL),
(83, 'Lynda', '2014-09-19', 'Rescuing Troubled Projects', '<p>\n	Is your project falling apart and you&#39;re not sure how to rescue it? In this course, author and PMP Bob McGannon demonstrates time-tested strategies to rescue a failing project before it&#39;s too late, including a look at common indicators that trouble is ahead, a methodology for finding the root cause, and proactive strategies to realign your stakeholders, team, vision, and schedule.</p>\n', 'Bob McGannon', 'Project Management', NULL, NULL, NULL, NULL),
(84, 'Lynda', '2014-09-19', 'Becoming a Triple-Threat Project Manager', '<p>\n	Meet the modern project manager: a triple threat who&#39;s savvy in project management, business analysis, and change management. In this short course, author and PMP Bob McGannon teaches you how these three fields are coming together and reinventing project management to produce better business outcomes. Discover how they intertwine and help project managers deliver projects with clearer scope, tighter budget, and better results.</p>\n', 'Bob McGannon', 'Project Management', NULL, NULL, NULL, NULL),
(85, 'Lynda', '2014-09-19', 'Managing Teams', '<p>\n	Group dynamics impact productivity and employee satisfaction, so it&#39;s important for managers to cultivate positive relationships among coworkers. Join Todd Dewett as he explains how to effectively manage teams. This course covers motivating your team, managing team performance, establishing your identity and authority within a group, addressing conflict, and making work fun. Full of practical tips and useful strategies, this course is a great reference for first-time managers and for more experienced managers who may need to address a specific issue with their team.</p>\n', 'Todd Dewett', 'Project Management', 'Management', NULL, NULL, NULL),
(86, 'Lynda', '2014-09-19', 'Getting Things Done', '<p>\n	Join author and world-renowned productivity and time management expert David Allen as he walks you through his five step process for Getting Things Done. He&#39;ll show you how to stay on top of your work and avoid feeling buried by it, while carving out space in your life to do more meaningful things. Learn how to capture, clarify, organize, reflect, and engage with tasks that are demanding your attention, and come away with a clear head and a clear focus.</p>\n', 'David Allen', 'Project Management', 'Management', NULL, NULL, NULL),
(87, 'Lynda', '2014-09-23', 'Thinking Like a Leader', '<p>\n	Join author and business coach Dave Crenshaw as he shows you the company, market, and customer focus that strategic leaders employ to make business decisions and anticipate new trends. This course shows you how to make crucial and insightful connections between your company&#39;s needs and future and those of the market you operate in and the customers you serve. Discover how you can identify trends, gather and address customer feedback, and proactively deliver what your company needs for competitive advantage. This course is one of a series of five Dave Crenshaw courses based on his Invaluable teaching methodology for professional development.</p>\n', 'Dave Crenshaw', 'Project Management', 'Leadership', NULL, NULL, NULL),
(88, 'Lynda', '2014-09-25', 'Managing Project Change', '<p>\n	If you want to work on fast-moving projects, it&#39;s critical to know how to manage change requests. A change request can be an opportunity or a ticket to chaos. In this course, author Doug Rose walks you through the elements of change in a project using a sample software project. Discover how to set the stage for change, weigh the change impact, understand the cascade effect, and implement the change. Along the way, learn how to effectively manage your project for change requests and deal with common obstacles. Also see how to find the balance between too much and too little change-either can be threat to your project.</p>\n', 'Doug Rose', 'Project Management', NULL, NULL, NULL, NULL),
(89, 'Lynda', '2014-09-25', 'Preventing Scope Creep', '<p>\n	Do you find your projects creeping out of your control, with little additions here and there? Are stakeholders changing expectations after the project plan has been agreed upon? In this course, author and PMP Terri Wagner will demonstrate strategies to keep your project scope intact through proactive project management.</p>\n', 'Terri Wagner', 'Project Management', NULL, NULL, NULL, NULL),
(90, 'Lynda', '2014-09-25', 'Managing Project Risk', '<p>\n	Without risk, there can be no reward. But if not managed properly, risk reduces your ability to achieve your project&#39;s goals, if not derailing it altogether. In this course, author and PMP Bob McGannon shows you how to anticipate, assess, and manage project risk-whether your project is large or small. Discover how to gauge your stakeholders&#39; tolerance for risk, assemble a risk plan, build a risk register, and maintain project continuity as risks crop up.</p>\n', 'Bob McGannon', 'Project Management', NULL, NULL, NULL, NULL),
(91, 'Lynda', '2014-09-27', 'Calculating Earned Value', '<p>\n	<strong>BAC, CV, ETC, TCPI</strong>. Don&#39;t let the alphabet of earned value acronyms deter you. Follow along with Aileen Ellis, PMP, PgMP, as she walks you through earned value calculation. Relevant for those considering the PMP exam or interested in better managing your project performance, this course shows you the calculations that make <strong>earned value management </strong>(<strong>EVM</strong>) one of the most critical project metrics. Aileen walks through two concrete examples, a construction project and a system upgrade, and shows how earned value metrics can help you calculate current performance and forecast future performance. Since it&#39;s not all a numbers game, interpret the results of these calculations and forecasts to make better project decisions.</p>\n', 'Aileen Ellis', 'Project Management', NULL, NULL, NULL, NULL),
(92, 'Lynda', '2014-09-29', 'Enhancing Your Productivity', '<p>\n	Join author and business coach Dave Crenshaw as he shows you the key to enhancing your productivity-focusing on your most valuable activities and minimizing the distractions that waste your time. This course shows you how to determine where you make the most valuable contributions to your company while minimizing and offloading distractions. Create a plan to mind your time and effort and help coworkers and employees discover their most valuable activities, which can result in an office-wide productivity boost.</p>\n', 'Dave Crenshaw', 'Project Management', 'Management', NULL, NULL, NULL),
(93, 'Lynda', '2014-09-29', 'Managing Your Time', '<p>\n	In this short course, author Todd Dewett, PhD, shares four time-management tips that help everyone from busy executives to new employees get more out of their work day. Learn how to think differently about time management, embrace the 80% rule, find your <em>Einstein</em> window,&nbsp;protect that window, and broadcast your availability to ensure others know when you&#39;ll be available.</p>\n', 'Todd Dewett', 'Project Management', 'Management', ' ', NULL, NULL),
(94, 'Lynda', '2014-09-29', 'Achieving Your Goals', '<p>\n	Setting achievable goals is one of the first steps toward a successful career and meaningful personal development. In this business skills course for lynda.com, author Dave Crenshaw shows smart ways to create a vision, develop a quantifiable goal, turn that goal into actions, and share that commitment publicly to establish accountability.</p>\n', 'Dave Crenshaw', 'Project Management', 'Management', NULL, NULL, NULL),
(95, 'Lynda', '2014-09-30', 'Leading Productive One-on-One Meetings', '<p>\n	Regular one-on-one meetings provide managers with an opportunity to head off problems and efficiently answer the many small, quick questions that arise during the workweek. In this course, Dave Crenshaw shows you how to establish a one-on-one meeting schedule and agenda, assign and review actions items, and assess the results of the meeting and follow up on promises. The course also explains how to effectively listen to employees&#39; needs and when to offer training and development.</p>\n', 'Dave Crenshaw', 'Project Management', NULL, NULL, NULL, NULL),
(96, 'Lynda', '2014-09-30', 'New Manager Fundamentals', '<p>\n	In this course, management and leadership expert Todd Dewett provides practical advice to help you establish your identity as a leader, connect with your team, and become a successful first-time manager. Learn how to survive your first 30 days, build trust, facilitate efficient meetings, and develop authority. This course is designed to prepare you to confidently tackle your responsibilities at work and increase your value to the organization while improving operational effectiveness.</p>\n', 'Todd Dewett', 'Project Management', 'Management', NULL, NULL, NULL),
(97, 'Lynda', '2014-10-01', 'Insights from a Project Manager', '<p>\n	In this Insights interview, Bob McGannon, PMP, will share the secrets he&#39;s cultivated in years of international project management for companies such as IBM and Boeing. Discover key skills for project managers, the ins and outs of certification options, and best ways to build and manage successful projects.</p>\n', 'Bob McGannon', 'Project Management', NULL, NULL, NULL, NULL),
(98, 'Pluralsight', '2014-10-03', 'Understanding the Shellshock Bash Bug', '<p>\n	In late September 2014, the most significant security bug ever to hit the Internet emerged in the form of the <strong>Shellshock Bash bug</strong>. Risks of this nature are inevitably accompanied by uncertainty and speculation. This course methodically explains the background of the risk, shows how it&#39;s exploited in a vulnerable system, and most importantly, walks through how to defend against it by applying multiple defenses. This is a must-watch course for anyone worried about the impact of this serious security risk on their environment.</p>\n', 'Troy Hunt and Jim Manico', 'Web Development', NULL, NULL, NULL, NULL),
(99, 'Lynda', '2014-10-03', 'Hiring Your Team', '<p>\n	In this course, veteran talent director and author Cindy Mayer shows how to prepare for and conduct employee interviews in person, over the phone, and with video-conferencing tools. Understand what your ideal candidate would bring to the table and use that information to structure a job description and effectively scan resumes. Next, build an interviewing plan, and develop questions that elicit thoughtful, helpful responses. Finally, learn how to conduct an interview, probe for more depth with follow-up questions, navigate pitfalls, and take next steps after the interview. Cindy includes a sample interview that illustrates these techniques in action.</p>\n', 'Cindy Mayer', 'Project Management', NULL, NULL, NULL, NULL),
(100, 'Lynda', '2014-10-03', 'Managing Multiple Generations', '<p>\n	Discover how to successfully manage multiple generations in the workplace with Christina Schlachter, PhD. Learn about each generation present in today&#39;s workforce, from Baby Boomers to Millennials, and figure out what each group wants and needs, and how they like to be managed, developed, and promoted.</p>\n', 'Christina Schlachter', 'Project Management', 'Management', NULL, NULL, NULL),
(101, 'Lynda', '2014-10-03', 'Becoming a Thought Leader', '<p>\n	Join author and business coach Dave Crenshaw as he shows you the keys to becoming a respected thought leader and authority in your field. Whether you&#39;re already a visible professional or hoping to improve your presence, decision-making ability, and influence, this course can prepare you to take a meaningful step forward. Being recognized as a thought leader and authority inside and outside your company builds career capital and paves the way for new opportunities. This course demonstrates a step-by-step process to help you identify your thought leadership focus, find a mentor, develop expertise within your company, build a meaningful network externally, and develop personal publicity.</p>\n', 'Dave Crenshaw', 'Project Management', 'Management', NULL, NULL, NULL),
(102, 'Lynda', '2014-10-03', 'Managing Project Teams', '<p>\n	In this course, author and PMP Bob McGannon teaches you how to understand team members, build a strong team from your talent pool, shape their work, and maximize success. Along the way, discover how to negotiate for key resources, appreciate and maximize individual working styles, use emotional intelligence to add a personal approach to your management style, and resolve conflict.</p>\n', 'Bob McGannon', 'Project Management', 'Management', NULL, NULL, NULL),
(103, 'Lynda', '2014-10-06', 'Coaching and Developing Employees', '<p>\n	In this course, business coach Lisa Gates teaches managers to harness the power of coaching in the workplace. Learn the benefits of developing your team and helping employees build their skills in ways that transform and empower them to do more productive and engaging work. Then discover how to build your own leadership and coaching skills and equip yourself with tools that encourage insight and growth. The course wraps with a look at how you can maintain the coaching momentum in the workplace and address common challenges.</p>\n', 'Lisa Gates', 'Project Management', 'Management', NULL, NULL, NULL),
(104, 'Lynda', '2014-10-11', 'Project Management Fundamentals', '<p>\n	Discover how to more efficiently manage your business projects. Author Bonnie Biafore lays out a set of principles and examines the concepts behind project management, from defining the problem, establishing project objectives, and building a project plan to meeting deadlines, managing team resources, and closing the project. The course also provides tips for reporting on project performance, keeping a project on track, and gaining customer acceptance.</p>\n', 'Bonnie Biafore', 'Project Management', NULL, NULL, NULL, NULL),
(105, 'Lynda', '2014-10-15', 'Managing Project Budgets', '<p>\n	In this course, designed for project management professionals and other leads who need to get a handle on their costs, author and PMP Bob McGannon shows you how to build a solid budget around a work breakdown structure, work with costing standards, and examine capital versus operating costs. The course then teaches how to build, manage, and monitor the budget and shares tips from the trenches of real projects. Plus, get practical advice on recovering from overruns and dealing with scope changes.</p>\n', 'Bob McGannon', 'Project Management', NULL, NULL, NULL, NULL),
(106, 'Lynda', '2014-10-17', 'Acing Your Interview', '<p>\n	Ace your interview and land the job you want. Join author Valerie Sutton as she explores the different types of interview questions and styles you might expect, and how to prepare for them by researching the company and practicing your answers. Uncover the best ways to create a good first impression and navigate the interview, as well as handle the tricky questions and identify the unlawful ones. Plus, learn how to assess your own performance, thank the company for their time, and follow up on a decision.</p>\n', 'Valerie Sutton', 'Personal', NULL, NULL, NULL, NULL),
(107, 'Lynda', '2014-10-20', 'Giving Your Elevator Pitch', '<p>\n	It&#39;s important to make a good impression in just the first few minutes you spend with potential mentors, clients, or even friends. In this short course, author and business coach Dr. Todd Dewett explains how to tell others what you do and make a memorable impression in a short period of time with a personal &#39;elevator pitch.&#39; Maximize your connection in a minimal amount of time, and start making valuable additions to your network from the get-go.</p>\n', 'Todd Dewett', 'Project Management', 'Management', NULL, NULL, NULL),
(108, 'Lynda', '2014-10-20', 'Writing Recommendations', '<p>\n	In this short course, Kelley School of Business lecturer and author Judy Steiner-Williams shows you the elements of a strong recommendation letter and how to use specificity to make your remarks memorable and relevant. At the end of the course, you&#39;ll also see how to ask for a recommendation if you need someone to write one for you.</p>\n', 'Judy Steiner-Williams', 'Project Management', 'Management', NULL, NULL, NULL),
(109, 'Lynda', '2014-10-20', 'Connecting with Peers in the Workplace', '<p>\n	Great communication means connecting, not just getting your point across. In this short course, coach Todd Dewett outlines helpful techniques for forging those important connections that make it easier to come to work every day. He introduces the key &#39;helping&#39; behaviors, the importance of sharing the spotlight and finding mutual interests, and the good example that modeling professional behavior can have on the entire team dynamic.</p>\n', 'Todd Dewett', 'Project Management', 'Management', NULL, NULL, NULL),
(110, 'Lynda', '2014-10-21', 'Discovering Your Strengths', '<p>\n	Join author and business coach Dave Crenshaw as he demonstrates ways to discover what you&#39;re truly best at doing and how to leverage those strengths and abilities in your professional life. This course reveals how to uncover your strengths and talents, match them to job responsibilities, and develop a path to apply those strengths at work. Set yourself up for continued success with self-assessments and the ability to invest in yourself and make continual improvements as your career grows.</p>\n', 'Dave Crenshaw', 'Project Management', 'Management', NULL, NULL, NULL),
(111, 'Lynda', '2014-10-22', 'Mac OS X Yosemite New Features', '<p>\n	Explore all the cool new features in <strong>Yosemite</strong>, <strong>Mac OS X 10.10,</strong> including the exciting continuity features that allow you to take work from an iPhone or iPad back to your computer. Author Nick Brazzi also covers instant personal hotspots, enhancements to the Notification Center and Spotlight, and updates to built-in apps like <strong>Safari</strong> and Mail.</p>\n', 'Nick Brazzi', 'IT', NULL, NULL, NULL, NULL),
(112, 'Lynda', '2014-10-23', 'Influencing Others', '<p>\n	Ever had trouble persuading someone to do something, even if it was in their best interest? Sometimes people don&#39;t budge, but thankfully you have more than rewards and penalties at your disposal. Join John Ullmen, PhD, as he explains how to influence others when you&#39;re at the &#39;pivot point of influence,&#39; by applying 18 scientifically confirmed methods. Whether you&#39;re influencing at work or at home, you&#39;ll learn what the best influencers do before they influence, and see how to choose the best steps for your situation, and have people want to be influenced by you.</p>\n', 'John Ullmen', 'Project Management', 'Management', NULL, NULL, NULL),
(113, 'Lynda', '2014-10-23', 'Managing Virtual Teams', '<p>\n	Do you have a remote team and need to engage them more effectively? Or perhaps you are stepping into a management role for the first time, or with a team that&#39;s scattered across office branches? In this course, author and PMP Bob McGannon shares the secrets he&#39;s used for managing remote teams across continents and time zones for over 20 years. Discover how to build rapport, set mutual expectations, communicate, connect, overcome conflict, get work done, and grow the team. Also included is a look at the top five challenges managers face in leading remote teams and helpful solutions that will get your team on track.</p>\n', 'Bob McGannon', 'Project Management', 'Management', NULL, NULL, NULL),
(114, 'Lynda', '2014-10-24', 'Conflict Resolution Fundamentals', '<p>\n	Improve your relationships with your coworkers, clients, and managers and find your way through conflict back to cooperation. In this course, negotiation consultant Lisa Gates shares the secrets of effective conflict resolution and reveals simple, repeatable techniques that apply in most business situations. She&#39;ll present a six-step framework for exploring and navigating conflict resolution, including identifying the issue, separating the people from the problem, overcoming roadblocks to resolution, exploring cultural differences, and getting to agreement.</p>\n', 'Lisa Gates', 'Project Management', NULL, NULL, NULL, NULL),
(115, 'Lynda', '2014-10-24', 'Managing for Results', '<p>\n	To be a high-performing manager, you need an advanced understanding of the principles of great leadership. In this course, author and business coach Dr. Todd Dewett shares the secrets businesses large and small use to manage teams, achieve precise results, and intelligently execute business strategies. He focuses on three key areas: motivation, positive change, and decision making. Discover how to shift your mindset, create a culture of motivation and accountability, make decisions that matter, and maintain excellence over time.</p>\n', 'Todd Dewett', 'Project Management', NULL, NULL, NULL, NULL),
(116, 'Lynda', '2014-10-24', 'Leading Productive Meetings', '<p>\n	In this course, author and business coach Dave Crenshaw teaches you to get the most from your meetings turning them into productive avenues for communicating, connecting, and accomplishing real work. The course demonstrates a simple, usable framework that will help you lead and participate in meetings large and small and provides insight into how to schedule, conduct, and follow up on meetings with minimum time and maximum results.</p>\n', 'Dave Crenshaw', 'Project Management', NULL, NULL, NULL, NULL),
(117, 'Lynda', '2014-10-25', 'Managing Project Quality', '<p>\n	Ensure you&#39;re producing results that meet the needs of stakeholders, by incorporating the four major indicators of quality-function, outputs, performance, and reliability-into your project planning. In this course, author and PMP Bob McGannon walks you through the considerations for making sure your project quality is spot on. Discover how to plan for quality, perform testing, and take into account special needs for IT projects.</p>\n', 'Bob McGannon', 'Project Management', NULL, NULL, NULL, NULL),
(118, 'Lynda', '2014-10-25', 'Managing Project Schedules', '<p>\n	Get the upper hand on your project schedules before they begin and see them through to conclusion, on time and on budget. In this course, PMP-credentialed author Bonnie Biafore teaches you how to proactively manage project schedules. This includes a look at the elements that go into a schedule; how to estimate costs and resources; best ways to negotiate and allocate resources; and how to manage a schedule over time.</p>\n', 'Bonnie Biafore', 'Project Management', NULL, NULL, NULL, NULL),
(119, 'Lynda', '2014-10-25', 'MVC Frameworks for Building PHP Web Applications', '<p>\n	In this course, author Drew Falkman tours four open-source <strong>PHP</strong> frameworks: <strong>Zend</strong>, <strong>Symfony</strong>, <strong>CakePHP</strong>, and <strong>CodeIgniter</strong>. The course covers basic framework concepts; explores the <strong>Model-View-Controller</strong> (<strong>MVC</strong>) pattern as a means of simplifying, organizing, and maintaining code; and details the ins and outs of developing basic applications in each of the four frameworks.</p>\n', 'Drew Falkman', 'Web Development', 'Programming Languages', NULL, NULL, NULL),
(120, 'Lynda', '2014-10-25', 'Insights on Software Quality Engineering', '<p>\n	Software quality engineering plays a vital role in the development cycle, saving companies time and money and ensuring that customers have exactly the experience they expect. It&#39;s also a lucrative and underappreciated career path. Here, software quality engineer Aaron Dolberg draws on his years of experience in <strong>quality assurance</strong> (<strong>QA</strong>) to share his personal insights and cautionary tales. Aaron discusses how to get started in QA, how it fits in at companies small and large, and how it has changed since the rise of agile workflows.</p>\n', 'Aaron Dolberg', 'Software Development', NULL, NULL, NULL, NULL),
(121, 'Lynda', '2014-10-25', 'Leading with Emotional Intelligence', '<p>\n	Emotions are all around us in the office, and it&#39;s important for leaders to understand how to harness them to cultivate productivity and positive relationships. In this course, lynda.com director of learning and development Britt Andreatta shows how to develop emotional intelligence to better lead teams, work with peers, and manage up. Learn what emotional intelligence is and how it factors in at work and discover concrete techniques for raising your own<strong> emotional quotient </strong>(<strong>EQ</strong>). This includes perceiving yourself accurately, exercising emotional self-control, practicing resilience, and developing empathy. Then turn those lessons around to build your awareness of others and learn to inspire helpful communication and manage conflict.</p>\n', 'Britt Andreatta', 'Project Management', 'Leadership', NULL, NULL, NULL),
(122, 'Lynda', '2014-10-26', 'Managing Project Communication', '<p>\n	Today&#39;s fast-moving projects generate a lot of email, phone calls, voicemail, and documentation. In this course, author Doug Rose shares the secrets of managing project communication. A solid communication strategy will help your team maximize buy-in, prioritize stakeholder input, and project results. Discover how to use a communication plan to develop two-way communication goals, run meetings, organize feedback, and create clear reports.</p>\n', 'Doug Rose', 'Project Management', NULL, NULL, NULL, NULL),
(123, 'Lynda', '2014-10-26', 'Building High-Performance Teams', '<p>\n	High-performing teams are critical to maintaining an organization&#39;s competitive advantage. These teams consistently show high levels of collaboration and innovation, and outperform their peers. In this course, author and leadership-training expert Mike Figliuolo shows you how to create and lead the teams that get more done for their organizations. Learn about the seven elements of a high-performance team, and the techniques necessary to set direction, gather and deploy the right resources, prioritize work, motivate employees, and help team members develop their individual strengths.</p>\n', 'Mike Figliuolo', 'Project Management', NULL, NULL, NULL, NULL),
(124, 'Lynda', '2014-10-27', 'Managing Your Manager', '<p>\n	In this course, author, keynote speaker, and coach Dr. Todd Dewett shows how to manage your reputation and one of your most important work relationships: your rapport with your boss. Discover how to understand your manager&#39;s world, preferences, and lingo; support your boss&#39;s goals; be a help rather than a hindrance; and lead by offering solutions. Plus, learn how to manage particularly difficult types of bosses, such as the boss who&#39;s never available, the mean boss, or the boss who acts better than everyone else.</p>\n', 'Todd Dewett', 'Project Management', 'Management', NULL, NULL, NULL),
(125, 'Lynda', '2014-10-27', 'Making Decisions', '<p>\n	Smart decision making, whether it&#39;s who to hire or what strategy to play, is a skill that sets you apart personally and professionally. In this short course, Todd Dewett shows you five simple steps to making better decisions. He&#39;ll help you evaluate if you have enough time, sufficient information, the right people involved, and other key factors necessary to making strong choices.</p>\n', 'Todd Dewett', 'Project Management', 'Leadership', NULL, NULL, NULL),
(126, 'Lynda', '2014-10-27', 'Solving Business Problems', '<p>\n	Do you have a business problem that you are having trouble solving? Mike Figliuolo has a simple five step process for solving problems and leading your business through everyday uncertainty and larger change initiatives. Learn to pin the problem down and define it, generate possible solutions, determine the best solution, and create a clear recommendation to solve your particular challenge. This is the same process Mike has taught multibillion dollar companies to solve their business problems. Learn how to use it to solve your own.</p>\n', 'Mike Figliuolo', 'Project Management', 'Management', NULL, NULL, NULL),
(127, 'Lynda', '2014-10-27', 'Embracing Change', '<p>\n	In this short course, author and business coach Todd Dewett explains how you can harness the power of change and benefit those around you by avoiding quick reactions, adopting a positive attitude, and developing a 30 day plan to integrate change.</p>\n', 'Todd Dewett', 'Project Management', NULL, NULL, NULL, NULL),
(128, 'Lynda', '2014-10-27', 'Managing Team Creativity', '<p>\n	Do you ever think, &#39;<em>I&#39;m just not that creative&#39;</em>? You&#39;re not alone. But companies increasingly expect their employees to think about problems in new ways and devise unexpected solutions. The good news is that creativity is not a gift, but a skill that can be developed over time. Learn how in this course with innovation expert Drew Boyd. Discover nine simple tips to boost your creative output at work and learn how to think about the world in a different way, break problems down into manageable parts, divide and conquer a problem, and evaluate ideas systematically.</p>\n', 'Drew Boyd', 'Project Management', 'Management', NULL, NULL, NULL),
(129, 'Lynda', '2014-10-27', 'Motivating and Engaging Employees', '<p>\n	An estimated 70 percent of employees are &#39;disengaged.&#39; They aren&#39;t satisfied or productive, and this costs your organization time and money. In this course, Todd Dewett walks you through the steps to building high-performing and engaged teams of motivated employees. Learn the three keys to engaging and retaining your team: strong relationships, a great work culture, and opportunities for employees to grow. Along the way, discover how to assess engagement, build trust, create intrinsic and extrinsic motivation, honor contributions by your &#39;superstars,&#39; and build pathways for employees to grow and stay with your company.</p>\n', 'Todd Dewett', 'Project Management', 'Management', NULL, NULL, NULL),
(130, 'Lynda', '2014-10-27', 'Delegating Tasks to Your Team', '<p>\n	In this course,<strong><em> lynda.com</em></strong> Director of Learning and Development Britt Andreatta walks you through her delegation process, which helps you assign the right tasks to the right people and better develop your team and meet company needs. The course reveals what delegation can do for you and your team and introduces a four-phase model to delegate tasks and manage projects large and small. The phases include evaluating the task, handing the task over, supporting task completion, and closing the task. In between, learn how to pick the right level of autonomy for each task and the best ways to avoid micromanagement.</p>\n', 'Britt Andreatta', 'Project Management', 'Management', NULL, NULL, NULL),
(131, 'Lynda', '2014-10-27', 'Leading Change', '<p>\n	Help your organization embrace change and make sure new initiatives are successful. In this course, Britt Andreatta, PhD, shows you how to lead your organization through change in a five-phase model that includes assessing the need for change, deciding who to involve, designing the change, announcing it, and implementing it in a way that sticks. Along the way, the course covers techniques that will increase the likelihood of your change succeeding, such as anticipating resistance, creating a compelling vision, and using emotional intelligence to build staff consensus.</p>\n', 'Britt Andreatta', 'Project Management', NULL, NULL, NULL, NULL),
(132, 'Lynda', '2014-10-28', 'Leading and Working in Teams', '<p>\n	Organizations thrive, or fail to thrive, based on how well the teams within those organizations work. What does it take to create a high-performing team? Based on her years of research working with high-performing teams across different industries, Harvard Business School professor Amy Edmondson reveals how high performance arises when teams are encouraged to take risks, fail, and learn from those small failures, a process she calls &#39;teaming.&#39; In this course, she outlines what leaders can do to create the right environment for teaming and explains the responsibilities of individual team members to speak up, collaborate, experiment, and reflect.</p>\n', 'Amy Edmondson', 'Project Management', 'Leadership', NULL, NULL, NULL),
(133, 'Lynda', '2014-10-28', 'Building Confidence', '<p>\n	Confidence can help you accomplish your goals and build strong relationships. But the reverse is also true; a lack of confidence can hurt you personally and professionally. Luckily, there are steps you can take to build lasting self-confidence. In this course, author and educator Todd Dewett shows you 10 techniques for building confidence you can apply at work and in your personal life. Learn how to own where you are and where you want to be, remove negativity, and visualize success.</p>\n', 'Todd Dewett', 'Project Management', 'Leadership', NULL, NULL, NULL),
(134, 'Lynda', '2014-10-28', 'Developing Political Savvy', '<p>\n	In this short course, author Dr. Todd Dewett shares his secrets for developing and utilizing political savvy to get more done at work. Take a look at the success formula at work-what defines &#39;success&#39; in your workplace? Once you understand the social landscape and how political capital works, then you can learn how to audit your own situation and make an action plan to improve your political savvy.</p>\n', 'Todd Dewett', 'Project Management', 'Leadership', NULL, NULL, NULL),
(135, 'Lynda', '2014-10-28', 'Disrupting Yourself', '<p>\n	<span style="color: rgb(51, 51, 51); font-family: Helvetica, Arial, sans-serif; font-size: 13px; line-height: 19px;">&quot;<strong><em>Disruptors</em></strong>&quot; secure a foothold by coming up with ideas and innovations that eventually upend their entire community or industry. Disrupting yourself is the secret to breaking into a new field, never settling for less, and achieving more. In this course, author,&nbsp;</span><em style="margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 13px; vertical-align: baseline; background-color: transparent; color: rgb(51, 51, 51); font-family: Helvetica, Arial, sans-serif; line-height: 19px;">Harvard Business Review&nbsp;</em><span style="color: rgb(51, 51, 51); font-family: Helvetica, Arial, sans-serif; font-size: 13px; line-height: 19px;">blogger, and consultant Whitney Johnson walks you through her seven step model to disrupt yourself and move to the next level in your career. Discover how to take the right risks, play to your strengths, embrace constraints, and more in this short course.</span></p>\n', 'Whitney Johnson', 'Project Management', NULL, NULL, NULL, NULL),
(136, 'Lynda', '2014-10-28', 'Leading with Stories', '<p>\n	<strong>Stories</strong> can make the messages of any leader more memorable, contagious, and enduring. In turn, learning the art of storytelling can make you a better leader. In this short course, author and corporate storytelling coach Paul Smith walks you through the elements of a compelling story. Learn about the common story structures, power of emotion, importance of surprise, appeal of analogies and metaphors, and value of keeping it real.</p>\n', 'Paul A. Smith', 'Project Management', 'Leadership', NULL, NULL, NULL),
(137, 'Lynda', '2014-10-29', 'Business Storytelling with C.C. Chapman', '<p>\n	Storytelling isn&#39;t just for fiction; it&#39;s vital to your business, too. Storytelling can help you communicate with customers and clients, market your ideas, and solve problems. It&#39;s also a great way to take projects from concept to launch. In this course, author and story consultant C.C. Chapman walks you through his storytelling strategies, including identifying your audience, brainstorming, nailing down details, and turning your story into a reality.</p>\n', 'C.C. Chapman', 'Project Management', NULL, NULL, NULL, NULL),
(138, 'Lynda', '2014-10-29', 'Leading with Applied Improv', '<p>\n	Improv theater was designed to help actors solve problems on stage. In this course, facilitator, coach, and former stand-up comedian Izzy Gesell demonstrates how to use the skills, practices, and mindset of improv to develop critical leadership qualities of presence, acceptance, and trust. Izzy shares some games you can play with your team members or coworkers to practice spontaneity and incorporate the improv mindset into your everyday life.</p>\n', 'Izzy Gesell', 'Project Management', NULL, NULL, NULL, NULL),
(139, 'Lynda', '2014-10-29', 'Modeling Courageous Leadership: Intelligent Disobedience', '<p>\n	&#39;<strong><em>Intelligent disobedience</em></strong>&#39; allows service animals to interpret commands in a way that honors their owner&#39;s intent, while avoiding hazards they might not anticipate. In this course, Bob McGannon, PMP, shows how intelligent disobedience translates to the business world and how it can help you become a more courageous leader. Learn how to challenge strict orders, voice unpopular opinions, take risks, and come up with creative solutions, all while keeping stakeholders&#39; goals in mind.</p>\n', 'Bob McGannon', 'Project Management', 'Leadership', NULL, NULL, NULL),
(140, 'Lynda', '2014-10-29', 'Developing Your Leadership Philosophy', '<p>\n	If you want your team to trust you as a leader, it&#39;s important to articulate who you are, what you stand for, and why you&#39;re excited to lead them. In this course, author and executive leadership coach Mike Figliuolo shows you how to distill your leadership philosophy down to one simple page covering four critical aspects of leadership: leading yourself, leading the thinking, leading your people, and leading a balanced life. Get hands-on with introspective exercises that help you define and practice leading authentically, with a style that&#39;s uniquely yours. Along the way, discover how to share and socialize your vision, make decisions, motivate and mentor, and keep your whole life in perspective.</p>\n', 'Mike Figliuolo', 'Project Management', 'Leadership', NULL, NULL, NULL),
(141, 'Lynda', '2014-10-29', 'Building Business Relationships', '<p>\n	Learn how to build four key types of business relationships in your career: with your manager, with your coworkers, with other departments, and with executives. Author and executive coach Simon T. Bailey guides you through building authentic connections with others and creating your own personal board of directors to help you succeed. Discover how you can build meaningful rapport, set yourself up for visibility and success, manage up when you don&#39;t click, develop executive presence, and cross-train within a team to better serve the organization.</p>\n', 'Simon T. Bailey', 'Project Management', NULL, NULL, NULL, NULL),
(142, 'Lynda', '2014-10-29', 'Connecting with Executives', '<p>\n	Develop confidence connecting with executives in a one-on-one meeting. In this course, John Ullmen, PhD, from the UCLA Anderson School of Management, explores common concerns employees have about engaging executives and shares winning strategies to connect with executives one-on-one-and make sure the relationship endures after the meeting is over.</p>\n', 'John Ullmen', 'Project Management', NULL, NULL, NULL, NULL),
(143, 'Lynda', '2014-10-29', 'Delivering Employee Feedback', '<p>\n	In this course, author Todd Dewett helps you identify ways to give both positive and negative feedback to employees. Learn how to create a culture driven by meaningful feedback and deliver coaching and suggestions to help employees stretch and grow. Discover the characteristics of helpful feedback, different feedback types, structured conversations, and strategies to refocus difficult employee reactions.</p>\n', 'Todd Dewett', 'Project Management', 'Leadership', NULL, NULL, NULL),
(144, 'Lynda', '2014-10-30', 'Having Difficult Conversations', '<p>\n	Leadership coach and lynda.com director of learning and development Britt Andreatta shares her tips and strategies for having difficult conversations. In her four-phase model, you&#39;ll discover the situations that lead up to difficult conversations, decide when the conversation is warranted, prepare for the interaction, and monitor outcomes to ensure success. Along the way, learn the secrets of turning difficult conversations into successful interactions that enhance communication and rapport. Improve both your professional and personal relationships, finding your way back from conflict through mutually successful outcomes.</p>\n', 'Britt Andreatta', 'Project Management', NULL, NULL, NULL, NULL),
(145, 'Lynda', '2014-10-30', 'Performance Review Fundamentals', '<p>\n	Make performance reviews more useful and motivating and less stressful for both you and your employees. In this course, Todd Dewett, PhD, shows managers how to conduct effective performance reviews, explaining how to set appropriate goals, gather feedback, write the formal review, and conduct effective meetings with employees. He also shows how to build performance review activities into your management style so that the review is no longer a once-yearly conversation.</p>\n', 'Todd Dewett', 'Project Management', 'Management', NULL, NULL, NULL),
(146, 'Lynda', '2014-10-30', 'Managing Employee Performance Problems', '<p>\n	Managing teams is more than just hiring and motivating hard workers. Even the best managers will encounter challenging employees who, due to poor performance or personality conflicts, are dragging down the morale and productivity of their whole team. As a manager, it&#39;s your job to stop the damage. Todd Dewett shares a repeatable four-step model for getting difficult employees back on track. The course addresses over 15 common difficulties managers experience with employees, including workplace-tested scripts to get each employee back on track. Whether it&#39;s a slacker, procrastinator, a gossip, or a bully, this course will help you turn poor performers into valuable team members once again.</p>\n', 'Todd Dewett', 'Project Management', 'Management', NULL, NULL, NULL),
(147, 'Lynda', '2014-10-30', 'Letting an Employee Go', '<p>\n	All managers know they need to invest extra resources in developing underperforming employees. But at some point, you need to stop that investment and start the process of letting an employee go. In this course, author and business coach Dr. Todd Dewett walks you through the factors you need to consider and plan for before letting an employee go. He provides advice on preparing your pre-meeting work and conducting the termination meeting to minimize difficulty. The course includes reenactments of a typical termination meeting, showing realistic examples for you to consider.</p>\n', 'Todd Dewett', 'Project Management', 'Management', NULL, NULL, NULL),
(148, 'Lynda', '2014-10-30', 'Leadership Insights from Dan Rockwell', '<p>\n	Dan Rockwell is a leadership coach, speaker, and author of the popular daily leadership blog Leadership Freak. After reaching a personal and professional turning point, he realized he wanted to share his leadership journey, and he&#39;s been blogging daily ever since. In this interview, Dan shares how he began his journey, the insights he&#39;s gleaned speaking with some of the world&#39;s top CEOs and industry leaders, and smart strategies for developing your own leadership presence. Learn how to stop and reevaluate strategies that aren&#39;t working, be a leader and an introvert, build relationships, nurture others, and respond to a failure in a way that makes you a better mentor.</p>\n', 'Dan Rockwell', 'Project Management', 'Leadership', NULL, NULL, NULL),
(149, 'Lynda', '2014-10-30', 'Communicating across Cultures', '<p>\n	When you travel, some differences are easy to identify: the language, the food, the music. But in order to communicate effectively in a cross-cultural business setting, it&#39;s important to understand your international colleagues&#39; underlying values, beliefs, and history. In this course, Kelley School of Business professor and executive coach Tatiana Kolovou demonstrates simple techniques to communicate well across cultures as a manager, peer, and coworker.</p>\n', 'Tatiana Kolovou', 'Project Management', NULL, NULL, NULL, NULL);
INSERT INTO `wd_course` (`id`, `institute`, `when_date`, `title`, `desc`, `lecturer`, `section`, `group`, `award`, `award_url`, `url`) VALUES
(150, 'Lynda', '2014-10-31', 'Managing Small Projects', '<p>\n	Have you wondered how to make your small projects run as smoothly as possible-without building in so many steps that they get cumbersome? In this course, author and project manager Bonnie Biafore shows how a successful small project starts with planning: documenting goals, identifying risks, measuring success, and confirming decision makers. The course also covers organizing your files, estimating time and costs, building a solid team, scheduling work, and getting the project underway. In addition, you&#39;ll explore how to hand out and track assignments, communicate with the team, work through issues, and bring your project to a close. This course follows the relocation of a small business as the sample project, but the course&#39;s strategies apply to a wide variety of small projects, including those in marketing, business development, product development, software development, freelancing, and the like.</p>\n', 'Bonnie Biafore', 'Project Management', NULL, NULL, NULL, NULL),
(151, 'Lynda', '2014-10-31', 'jQuery UI Widgets', '<p>\n	Despite the possibilities offered in <strong>HTML5</strong>, there&#39;s still a call for customizable widgets that can be used in websites and web apps. <strong>jQuery UI</strong>, a popular plugin for <strong>jQuery</strong>, is here to answer that call. Joe Chellman shows how to install the plugin, use the accordion and date picker widgets, and add behaviors that change how existing page elements respond to user input. Finally, you&#39;ll apply the concepts you&#39;ve learned to a typical project you might see coming from a client survey form.</p>\n', 'Joe Chellman', 'Web Development', NULL, NULL, NULL, NULL),
(152, 'Lynda', '2014-10-31', 'HTML5: Managing Browser History', '<p>\n	This course describes how to use the <strong>HTML5</strong> <strong>Session History</strong> application programming interface to present bookmark-friendly URLs while updating parts of a page and preventing unnecessary network activity. Author Bill Weinman shows how to manipulate history by adding entries to the stack, visibly changing the URL in the address bar, and removing entries when the user presses the back or forward buttons, all without reloading the web page. The course uses practical examples that can be applied to most web sites, and also shows how to detect support for the History API in browsers and how to handle exceptions.</p>\n', 'Bill Weinman', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(153, 'Lynda', '2014-11-01', 'HTML5: Geolocation in Depth', '<p>\n	This course shows how to add location tracking to a web application with a combination of <strong>JavaScript</strong>, <strong>CSS</strong> and <strong>HTML5</strong>. First, author and HTML5 expert Bill Weinman provides a thorough explanation of the geolocation API, including considerations every developer should take into account, such as data dependability, power usage, and privacy concerns. The course then covers how to detect support for geolocation, retrieve coordinates from a device (whether once or continuously), handle errors, and integrate the results with Google Maps to create a location-aware web application that will run on many mobile browsers.</p>\n', 'Bill Weinman', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(154, 'Lynda', '2014-11-01', 'HTML5: Document Editing in Depth', '<p>\n	This course describes how to create editable content on the web using the document-editing application programming interface (API) in <strong>HTML5</strong>. Author Bill Weinman explains the document-editing process, detecting support for the document-editing API, using the contentEditable and designMode attributes, and editing a full document. The course also explores some of the limitations of the feature and shows how to make document-editing pages work across different browsers.</p>\n', 'Bill Weinman', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(155, 'Lynda', '2014-11-01', 'HTML5: Messaging and Communications in Depth', '<p>\n	This course shows how to communicate between web pages, both within a single domain and across one or more domains, using the <strong>HTML5</strong> Messaging API. Author Bill Weinman reviews security and the same origin policy, details cross-origin scripting techniques, and explores examples of cross-document messaging. The course describes how to register and send messages to listeners and handle errors.</p>\n', 'Bill Weinman', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(156, 'Lynda', '2014-11-01', 'HTML5: Background Processes with Web Workers', '<p>\n	In this course, author Bill Weinman describes how to perform background processing using the Web Workers API in <strong>HTML5</strong>. Web workers provide background processing for JavaScript, keeping pages responsive while allowing your scripts to run independently. The course demonstrates practical examples for detecting web workers support, setting up workers, implementing shared workers, and handling errors.</p>\n', 'Bill Weinman', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(157, 'Lynda', '2014-11-01', 'HTML5: File API in Depth', '<p>\n	Join author Joe Marini as he demonstrates how to use the <strong>HTML5 File API</strong> to perform file-related operations from within a web page, including manipulating files, reading and accessing data within files, and retrieving information about files. The course also covers how to complete tasks that were previously only possible with native code, such as picture processing, file conversion, and content checking.</p>\n', 'Joe Marini', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(158, 'Lynda', '2014-11-02', 'HTML5: Drag and Drop in Depth', '<p>\n	Join Bill Weinman as he shows how to make just about any web page element draggable with a combination of <strong>JavaScript</strong> and <strong>HTML5</strong>, a technique that has increased browser support and that eliminates the need for external libraries such as <strong>jQuery</strong>. The course covers how to detect drag-and-drop support in the user&#39;s browser, code a simple event listener, use a drop zone, and even receive dropped objects without a drop zone. A simple working example game, a practical implementation of drag-and-drop that can be applied to almost any web site, is also demonstrated.</p>\n', 'Bill Weinman', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(159, 'Lynda', '2014-11-02', 'Time Management Fundamentals', '<p>\n	Effective time management is an indispensable skill. In <strong>Time Management Fundamentals</strong>, Dave Crenshaw explains how to sensibly allocate time in order to achieve greater productivity. Dave details a set of principles for staying organized, consolidating the workspace, keeping a clear mind, and developing a time budget. Also covered are techniques for managing a full inbox, processing email, and reserving time for the most important activities.</p>\n', 'Dave Crenshaw', 'Project Management', NULL, NULL, NULL, NULL),
(160, 'Lynda', '2014-11-03', 'Negotiating Your Salary', '<p>\n	In this course, author Valerie Sutton shows smart ways to set up a foundation for negotiating your salary, discuss your strengths, and follow up to achieve agreement. Discover how to research the salary range for the position you&#39;re applying for, put it in the context of your salary history, and make a persuasive request. Whether you&#39;re at your current job or making a leap to the next, this course will help compare your expectations and performance with others, and negotiate for not only the best take-home pay, but also a combination of benefits, such as vacation days and flextime, that work for both you and your employer.</p>\n', 'Valerie Sutton', 'Personal', NULL, NULL, NULL, NULL),
(161, 'Lynda', '2014-11-03', 'Creating an Effective Resume', '<p>\n	In Creating an Effective Resume, author Mariann Siegert provides step-by-step guidance on creating resumes that highlight accomplishments and specifically target a potential employer&#39;s needs. The course covers how to build a resume that encompasses action statements, keywords, styling, and effective content, while addressing common stumbling blocks such as handling employment gaps and career changes. Framing the resume as a vital component of a personalized marketing campaign, Mariann shows how to conduct employer research and utilize keyword optimization techniques to increase a resume&#39;s potential of being found by employers and recruiters on resume banks and job sites. Also included are tips on writing cover letters and thank-you notes. Exercise files accompany the course.</p>\n', 'Mariann Siegert', 'Personal', NULL, NULL, NULL, NULL),
(162, 'Lynda', '2014-11-04', 'Managing Your Career', '<p>\n	What do you enjoy doing, and how are you uniquely qualified to build a rewarding career out of your interests, skills, and experience? In this course, author Valerie Sutton guides you through the process of proactively managing your career by identifying your options, needs, and interests. Discover how to assess your experience, work-reward values, and qualifications, all with the goal of creating a robust career profile that charts your future growth. The course also shows how to fully investigate career options and perform a gap analysis in order to find key opportunities.</p>\n', 'Valerie Sutton', 'Personal', NULL, NULL, NULL, NULL),
(163, 'Lynda', '2014-11-04', 'Up and Running with NoSQL Databases', '<p>\n	Explore the possibilities <strong>NoSQL</strong> databases offer developers for unparalleled flexibility and performance. In this course, author Joseph LeBlanc shows how to build an entire web application with <strong>CouchDB</strong> and introduces techniques such as querying with <strong>JavaScript</strong>, working with nested data, and creating views. He also explains some of the trade-offs you might encounter with NoSQL databases, such as the complexity of partitioning data across multiple servers, and presents five commonly used <strong>NoSQL</strong> databases: <strong>CouchDB</strong>, <strong>MongoDB</strong>, <strong>Cassandra</strong>, <strong>Riak</strong>, and <strong>Redis</strong>.</p>\n', 'Joseph LeBlanc', 'Software Development', 'Databases', NULL, NULL, NULL),
(164, 'Lynda', '2014-11-05', 'Communication Fundamentals', '<p>\n	Effective communication is more than what you say. Make your message more impactful, and get the results you want in work and life. In this course, author and UCLA Anderson School Professor John Ullmen, PhD, walks you through strong and clear communication strategies that will help you improve your listening, your message, your delivery, and your effectiveness. These strategies work across departments, teams, and cultures and help you get through communication blockers.</p>\n', 'John Ullmen', 'Project Management', NULL, NULL, NULL, NULL),
(165, 'Lynda', '2014-11-06', 'Business Analysis Fundamentals', '<p>\n	Every project needs someone that can help turn ideas into reality: a business analyst. Join author and certified business analyst Haydn Thomas as he walks you through the fundamentals of business analysis tools and techniques. Haydn will demonstrate how these skills are used to gather requirements and identify solutions to provide better business outcomes on your change initiatives. Discover where business analysis lives in the project life cycle, how to initiate a project, the best way to gather requirements, and smart strategies to monitor results and test outcomes.</p>\n', 'Haydn Thomas', 'Project Management', NULL, NULL, NULL, NULL),
(166, 'Lynda', '2014-11-07', 'Insights from a Business Analyst', '<p>\n	Explore the career of business analysis, in this interview-style course with experienced analyst Haydn Thomas. Learn how business analysis fits in with project and change management and how business analysis works on large projects. Then find out what traits a business analyst must possess and the role of an analyst within an organization.</p>\n', 'Haydn Thomas', 'Project Management', NULL, NULL, NULL, NULL),
(167, 'Lynda', '2014-11-07', 'Classroom Management Fundamentals', '<p>\n	K-12 educators: create a classroom culture that increases achievement and decreases disruption-without inhibiting your students&#39; creativity or desire to learn. In this course (our first with real kids in a classroom setting), Aaron Quigley shows you how to create learning-focused environments by minimizing off-task behavior and increasing student engagement. Learn how to develop the traits of effective classroom managers, reduce distraction, give clear instruction, and escalate problems when necessary. Aaron will also provide guides for building a positive classroom culture that sets students up for success, wherever they go next.</p>\n', 'Aaron Quigley', 'Project Management', 'Management', NULL, NULL, NULL),
(168, 'Lynda', '2014-11-07', 'HTML5 Projects: Integrating Google Store Locator', '<p>\n	This concise <strong>HTML5</strong> project demonstrates how to take advantage of browser-based geolocation by using the <strong>Google Store Locator </strong>Utility Library. Author Joseph Lowery shows designers how to include a robust store locator application in their projects, with access to directions, custom markers, and feature filtering. HTML5 technologies covered include HTML5 geolocation and advanced JavaScript API.</p>\n', 'Joseph Lowery', 'Web Development', NULL, NULL, NULL, NULL),
(169, 'Lynda', '2014-11-08', 'HTML5 Projects: Engaging Ecommerce', '<p>\n	The <strong>HTML5</strong> Projects series combines <strong>HTML5</strong>, <strong>CSS3</strong>, and recent <strong>JavaScript</strong> API technologies to work-enhancing your web projects with interactivity and multimedia. This installment shows you how to build features that allow visitors to your online store to filter their selections interactively via sliders, drag items onto wish lists, and automatically save them locally. Author Joseph Lowery uses this scenario as an opportunity to introduce concepts such as HTML5 form elements with JavaScript enhancements, local content storage, and drag-and-drop.</p>\n', 'Joseph Lowery', 'Web Development', NULL, NULL, NULL, NULL),
(170, 'Lynda', '2014-11-08', 'Practical Apache Web Server Administration', '<p>\n	Quickly learn how to manage and configure an <strong>Apache</strong> web server. This course is designed for IT professionals, office managers, and anyone who&#39;s been saddled with an Apache server without any idea of where to start. Author Jon Peck describes what the <strong>Apache HTTP Server</strong> is and what it&#39;s used for, and provides practical information on configuration and logging. Then discover how to troubleshoot common problems and control the server, and learn what questions you should be asking when determining whether to delegate this responsibility to a third party.</p>\n', ' Jon Peck', 'Web Development', NULL, NULL, NULL, NULL),
(171, 'Lynda', '2014-11-08', 'ITIL Foundations', '<p>\n	The <strong>Information Technology Infrastructure Library</strong> (<strong>ITIL</strong>) has become the standard framework for the IT service industry. In this course, instructor Mark Thomas explains what ITIL is and how it can help align IT services with the needs of your organization. The course is comprised of eight modules, drawn from ITIL objectives that follow the phases of the service life cycle. Mark explains the key principles, models, and concepts behind the ITIL model of service management, and then dives deep into the life-cycle processes, from business-relationship management to problem management, using real-word examples from his own career.</p>\n', 'Mark Thomas', 'Project Management', NULL, NULL, NULL, NULL),
(172, 'Lynda', '2014-11-09', 'ISO20000', '<p>\n	Learn the core components of <strong>ISO/IEC 20000</strong>. I<strong>SO/IEC 20000</strong> is the first international standard for IT service management developed by the <strong>International Organization for Standardization (ISO) </strong>and <strong>International Electrotechnical Commission (IEC)</strong>. Suzanne Van Hove introduces the core concepts of IT service management, explores critical terms, examines the service delivery processes, and takes a look at relationship, resolution, and control processes.</p>\n', 'Suzanne Van Hove', 'Project Management', NULL, NULL, NULL, NULL),
(173, 'Lynda', '2014-11-10', 'Design the Web: Graphics and CSS Pseudo-Elements', '<p>\n	Learn to combine graphics and pseudo-elements to add more design and layout possibilities without adding more <strong>HTML</strong> to your web pages. Combining web graphics and <strong>CSS3</strong> pseudo-elements allows you to style text, add graphics, and position objects, all while keeping your HTML clean and organized and without sacrificing responsive elements of your design.</p>\n', 'Chris Converse', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(174, 'Lynda', '2014-11-10', 'Practical Project Management for Creative Projects', '<p>\n	Project management is key to taking an idea from start to finish, but video and photography projects face very special challenges that set them apart from traditional business projects. In this course, Rich Harrington introduces viewers to the core concepts of effective project management within the context of the video production and photography industries. Covering topics like effectively matching your services offered with the project, estimating time, and communicating with clients, Rich shares insights from his many years as a business owner and creative professional.</p>\n', 'Richard Harrington', 'Project Management', NULL, NULL, NULL, NULL),
(175, 'Lynda', '2014-11-10', 'Presentation Fundamentals', '<p>\n	What makes a compelling presentation? A presentation that is built on strong research, tailored to your audience&#39;s interests, and designed to anticipate and answer questions about your message. In this course, author and Kelley Business School professor Tatiana Kolovou teaches you how to prepare strong business presentations. Learn how to find your story, appeal to logic and emotion, gain credibility, build a deck, and deliver a compelling presentation. Along the way, follow Katie, a young professional, as she prepares to give a presentation to the executives at her organization.</p>\n', 'Tatiana Kolovou', 'Project Management', NULL, NULL, NULL, NULL),
(176, 'Lynda', '2014-11-10', 'Public Speaking Fundamentals', '<p>\n	Develop the skills you need to prepare and deliver an outstanding speech or presentation with our public speaking training. Author Laura Bergells offers practical insights that can help presenters prepare, open, deliver, and close their speeches. Along the way, discover how to project confidence, storyboard a speech, take questions, respond with thoughtful answers, and develop the creative story that adds life to a speech.</p>\n', 'Laura Bergells', 'Project Management', NULL, NULL, NULL, NULL),
(177, 'Lynda', '2014-11-10', 'Onboarding New Hires', '<p>\n	You&#39;ve completed the process of recruiting and hiring and are looking forward to your new employee&#39;s first day. Now what? In this course, discover how you can effectively integrate new hires into your team and set them up for success in working with you, their colleagues, and the company at large. Learn about the prep work you need to do before Day 1 and how to make the first day, week, month, three months, and year successful experiences. Todd Dewett will help you make your new hires feel welcome, informed, and ready to contribute.</p>\n', 'Todd Dewett', 'Project Management', 'Management', NULL, NULL, NULL),
(178, 'Lynda', '2014-11-12', 'Writing Email', '<p>\n	Discover the secrets to writing powerful emails your colleagues will read and answer by crafting your message and delivery. In this short course, author and business writing professor Judy Steiner-Williams shows you how to write emails for maximum readability and impact. Discover how to craft a compelling opening, how to message the right people at the right time, and how to leverage etiquette to use email as one of many communications tools.</p>\n', 'Judy Steiner-Williams', 'Project Management', NULL, NULL, NULL, NULL),
(179, 'Lynda', '2014-11-12', 'Business Writing Fundamentals', '<p>\n	Discover the secrets to effective business writing and crafting messages that others want to read and act on. Judy Steiner-Williams, senior lecturer at Kelley School of Business, introduces you to the 10 Cs of strong business communication and provides you with before-and-after writing samples that give you the opportunity to apply each principle and sharpen your communication skills. Judy also points out common grammar and writing mistakes and shares special considerations for formats like emails and reports.</p>\n', 'Judy Steiner-Williams', 'Project Management', NULL, NULL, NULL, NULL),
(180, 'Lynda', '2014-11-13', 'Writing Business Reports', '<p>\n	Learn how to write a well-constructed business report. In this course, author and senior Kelley School of Business lecturer Judy Steiner-Williams outlines the different types of business reports and then provides guidance on how to write your own from cover letter to concluding sentence. Follow Judy as she researches her topic, crafts her opening, builds an executive summary, drafts copy, and adds illustrations and appendices. After watching this course, you&#39;ll have a better idea how to draft a report that meets your organization&#39;s needs.</p>\n', 'Judy Steiner-Williams', 'Project Management', NULL, NULL, NULL, NULL),
(181, 'Lynda', '2014-11-14', 'Unit Testing with PHPUnit', '<p>\n	Unit testing is a way to confirm proper execution of a computer program. <strong>PHPUnit</strong> provides a testing framework for PHP developers to do it right. This brief course covers everything you&#39;ll need to get up and running with PHPUnit: where to download it, how to install it, and how to use it to unit test your code. Kristian Secor provides a high-level overview of this invaluable framework, helping you guide test-driven development at your organization.</p>\n', 'Kristian Secor', 'Web Development', 'Programming Languages', NULL, NULL, NULL),
(182, 'Lynda', '2014-11-14', 'Choosing a PHP Editor', '<p>\n	A coding professional needs professional tools, and while you can write <strong>PHP</strong> with a regular text editor, a specialized editor or <strong>IDE</strong> will make the job easier and your code more accurate. In this course, programming expert Joseph Lowery takes you on a survey of the most popular all-purpose and PHP-specific editors. Learn what features are absolutely required from any good editor; explore options that can boost your productivity, like snippets and database integration; and then take a look at tools that work with multiple technologies (such as <strong>Aptana Studio</strong> or <strong>Sublime Text</strong>) and those more directly targeted at PHP (like <strong>Eclipse</strong> or <strong>PhpStorm</strong>). This course is vital to anyone starting on the path to PHP programming, as well as developers seeking to ramp up their efficiency.</p>\n', 'Joseph Lowery', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(183, 'Lynda', '2014-11-15', 'Up and Running with PHP: PEAR, PECL, and Composer', '<p>\n	Instead of downloading <strong>PHP</strong> code and figuring out how it fits into your project structure, use <strong>PEAR</strong>, <strong>PECL</strong>, and <strong>Composer</strong> to do it for you. Composer manages libraries for your PHP project, PEAR installs packages for your entire server, and PECL compiles extensions directly into PHP itself. In this course, author Joseph LeBlanc demonstrates how to find, install, update, and remove packages with this suite of invaluable PHP tools.</p>\n', 'Joseph LeBlanc', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(184, 'Lynda', '2014-11-16', 'Web Site Strategy and Planning', '<p>\n	In Web Site Strategy and Planning, Jen Kramer shows that there&#39;s more to building a web site than just implementation. She describes how to create a plan that will ensure the end product meets the client&#39;s needs and is as efficient and scalable as possible. Jen explains how to identify the right technology for the design, whether it is <strong>CMS</strong> driven or static, and how to organize content and graphics. She shows how to create a project proposal that includes pricing and milestones that demonstrate to the client that work is being done. She also discusses how to measure the success of the design through analytics and user feedback.</p>\n', 'Jen Kramer', 'Web Development', NULL, NULL, NULL, NULL),
(185, 'Lynda', '2014-11-16', 'Project Management Simplified', '<p>\n	Almost everything you do in the workplace is a project, from the smallest task to the largest endeavor. All of this work can benefit from some simple project-management techniques. In this course, management trainer Chris Croft outlines the twelve steps to managing projects without creating a lot of extra overhead, and shows how to use traditional PM tools--such as Gantt charts and network diagrams--to help you manage your workload.</p>\n', 'Chris Croft', 'Project Management', NULL, NULL, NULL, NULL),
(186, 'Lynda', '2014-11-17', 'Collaborative Design: Managing a Team', '<p>\n	Effective collaboration can make or break a project, as anyone who&#39;s ever suffered through &#39;design by committee&#39; can attest. But how do you manage a team-often including many external clients and internal creatives-so that collaboration moves smoothly and nets great results? This kind of teamwork requires clear roles and responsibilities, well-defined parameters, opportunities for input, people-management skills, and more. In this course, veteran web entrepreneur Lauren Bacon provides a proven framework for bringing people together collaboratively to create extraordinary outcomes.</p>\n', 'Lauren Bacon', 'Project Management', 'Management', NULL, NULL, NULL),
(187, 'Lynda', '2014-11-17', 'Foundations of UX: Content Strategy', '<p>\n	Content is key to delivering a successful user experience on websites, apps, and other digital properties. But what sets good content apart from the rest? This course takes you through the process of analyzing and reshaping your web content-not only text but also video, imagery, social interactions, and the metadata that underlies it all-to improve your <strong>SEO</strong> while refining your brand&#39;s voice. Learn how to construct meaningful content and measure just how successful your site is after launch. Author Patrick Nichols also shows you how to develop personas to better understand your audience and evaluate the needs of important stakeholders and influencers.</p>\n', 'Patrick Nichols', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(188, 'Lynda', '2014-11-18', 'Building Trust', '<p>\n	The &#39;circles of trust&#39; model is a helpful tool for describing relationships. In the innermost circle, you work on your trustworthiness and ethical decision making. In the middle circle, you work on your everyday relationships with colleagues and peers. In the outer circle, you project credibility and trustworthiness beyond your usual circle, building relationships that are based on mutual benefit. In this course, author Brenda Bailey-Hughes shows how to strengthen relationships within the three circles of trust. Plus, learn how to build trust in remote teams, repair lost or broken trust, and deliver an apology to speed the rebuilding process.</p>\n', 'Brenda Bailey-Hughes', 'Project Management', NULL, NULL, NULL, NULL),
(189, 'Alison', '2014-11-19', 'Diploma in Project Management', '<p>\n	This free online project management professional certification course from ALISON offers a comprehensive review of project management such as methodology, tool sets and documentation, and the project life cycle including analysis, planning, design and evaluation. The course also includes a project management case study.</p>\n', 'N/A', 'Project Management', NULL, NULL, NULL, NULL),
(190, 'Lynda', '2014-11-20', 'Up and Running with Amazon Web Services', '<p>\n	Discover how Amazon Web Services (AWS) can be leveraged to deploy and scale your web applications. Author Jon Peck demonstrates how to build a simple application leveraging the Amazon cloud services while introducing the wide variety of products and services provided with AWS. This course starts with an overview of the foundational services, such as Amazon EC2 for virtual servers, Amazon S3 for online data storage, and Amazon RDS for a scalable database solution. Plus, explore how application services such as the Amazon Simple Notification Service can reduce overhead. Jon combines these services in the final chapter, where he builds, deploys, and monitors an application.</p>\n', 'Jon Peck', 'Software Development', NULL, NULL, NULL, NULL),
(191, 'Lynda', '2014-11-20', 'Amazon Web Services Essential Training', 'If you''re considering moving your applications to the cloud, this course is a must. Amazon Web Services (AWS) is a leading cloud-based services platform, and developers who want to keep current need to know what benefits AWS has to offer. This course provides you with a solid conceptual foundation on which to architect your next cloud-based application. Jeff Winesett begins with a general overview of cloud concepts and best practices (like designing for failure), and then continues to build upon each of these best practices and architectural guidelines by using examples that will help you best take advantage of AWS. Among other things, he''ll show you how to implement elasticity through Auto Scaling, decouple your application components by using message queues, and keep your system secure in the cloud. Plus, learn how to set up Amazon Web Services for your next project in a start-to-finish chapter that covers everything from signing up for an AWS account to autoscaling your final application architecture using load balancing, server images, and the Relational Database Service.', 'Jeff Winesett', 'PM', 'PM', '', '', ''),
(192, 'Lynda', '2014-11-21', 'Web Site Planning and Wireframing: Hands-On Training', '<p>\n	In Web Site Planning and Wireframing: Hands-On Training, Laurie Burruss, director of digital media at Pasadena City College, demonstrates the essentials of creating a web site with a polished, professional appearance and a compelling user experience. The goal of this hands-on course is to deconstruct a web site&#39;s home page in order to identify its structural elements and feature set. Using Acrobat Pro and the web developer&#39;s toolkit, Laurie shows how to capture a homepage and create, in another layer, its visual framework (wireframe). Exercise files and a downloadable PDF quiz accompany the course.</p>\n', 'Laurie Burruss', 'Web Development', NULL, NULL, NULL, NULL),
(193, 'Lynda', '2014-11-21', 'Effective Design of RESTful APIs', '<p>\n	Developers creating websites needs to know how to build RESTful APIs correctly. This course will help you plan and model your own APIs and understand the six REST design constraints that help guide your architecture. Author Keith Casey starts with a simple overview, including advice on identifying the users or &#39;participants&#39; of your system and the activities they might perform with it. He&#39;ll help you paper test your model, validating the design before you build it. You&#39;ll then explore the HTTP concepts and REST constraints needed to build your API. Challenges along the way help you test your skills and open your mind to other API design possibilities, such as APIs without documentation.</p>\n', 'Keith Casey', 'Web Development', NULL, NULL, NULL, NULL),
(194, 'Lynda', '2014-11-22', 'Relational Database Fundamentals', '<p>\n	Have you ever opened up a database that someone else built and felt a little lost? Or ever thought of designing your own simple database and been unsure of where to start? Or perhaps you need to work with a team of database professionals and don&#39;t know how to speak their language? This course will help you overcome these hurdles. Adam Wilbert teaches the basics of relational database design, regardless of whether you are using <strong>Access</strong>, <strong>FileMaker</strong>, <strong>Open Office</strong>, or <strong>SQL Server</strong>. Learn common database mistakes to look out for, discover how to diagram use cases and requirements to plan your design, and develop a conceptual data model- translating your ideas into components like tables, relationships, queries, and views.</p>\n', 'Adam Wilbert', 'Software Development', 'Databases', NULL, NULL, NULL),
(195, 'Lynda', '2014-11-23', 'Executive Leadership Fundamentals', '<p>\n	In this course, author John Ullmen, PhD, gives you the keys to the C suite: a look at executive leadership qualities that set the best apart from the rest. Discover the importance of knowing how to set a foundation and direction, create a compelling vision of the future for your company, motivate your staff to achieve, and much more. The course also looks at the importance of maintaining a mentality of service as you move up the org chart.</p>\n', 'John Ullmen', 'Project Management', 'Leadership', NULL, NULL, NULL),
(196, 'Lynda', '2014-11-23', 'Customer Service Fundamentals', '<p>\n	Do your customers feel valued? When they do, they keep coming back. When they don&#39;t, your business suffers. In this course, author and customer service consultant Jeff Toister teaches you the three crucial skill sets needed to deliver outstanding customer service and increase customer loyalty. Learn how to build winning relationships, provide the right assistance at the right times, and effectively handle angry customers. He&#39;ll also share ways to find out what your customers really think about your service, and use their feedback to improve.</p>\n', 'Jeff Toister', 'Project Management', NULL, NULL, NULL, NULL),
(197, 'Lynda', '2014-11-24', 'Up and Running with PHP CodeIgniter', '<p>\n	Speed up your development with <strong>CodeIgniter</strong>, a fast and powerful <strong>PHP</strong> web application framework. Author Jon Peck shows how to build a magazine cataloging system while describing how to use a <strong>MVC</strong> (<strong>Model-View-Controller</strong>) framework like CodeIgniter. Starting with the what and why of CodeIgniter, Jon introduces key concepts such as the MVC pattern and libraries by demonstrating how to create static pages, then storing and displaying magazine info in a database. Advanced topics like classes and helpers are explored to validate user input, upload files, and much more. By creating a complete system, you&#39;ll have the foundation to build your own applications with CodeIgniter.</p>\n', 'Jon Peck', 'Web Development', 'Programming Languages', NULL, NULL, NULL),
(198, 'Lynda', '2014-11-25', 'Up and Running with Symfony2 for PHP', '<p>\n	Build <strong>PHP</strong> applications the modern way with <strong>Symfony2</strong>, a popular PHP <strong>MVC</strong> framework. In this course, Jon Peck shows you how to install and configure Symfony and start saving time with typical development tasks, such as directing traffic, creating persistent models, and rendering content with templates. He&#39;ll also show you how to define and validate forms and debug your applications. Don&#39;t reinvent the wheel; start learning how to use Symfony to get a head start on your PHP projects.</p>\n', 'Jon Peck', 'Web Development', 'Programming Languages', NULL, NULL, NULL),
(199, 'Lynda', '2014-11-25', 'Up and Running with CakePHP', '<p>\n	Speed up your development with <strong>CakePHP</strong>, the popular open-source <strong>PHP</strong> framework. In this course, author Jon Peck builds a magazine cataloging system while explaining how to work with the <strong>Model-View-Controller</strong> (<strong>MVC</strong>) development pattern. The course demonstrates how to install and configure CakePHP, describing the layout and components. Then, leveraging the Bake console, Jon shows how to generate and customize code, and explores form validation, database persistence, and even image uploads. By developing a complete, functional application, you&#39;ll have the foundation you need to build your own applications with CakePHP.</p>\n', 'Jon Peck', 'Web Development', 'Programming Languages', NULL, NULL, NULL),
(200, 'Lynda', '2014-11-26', 'Up and Running with Laravel', '<p>\n	What is <strong>Laravel</strong>? It&#39;s a popular <strong>PHP</strong> framework similar to <strong>CakePHP</strong> or CodeIgniter. It offers all of the standard <strong>MVC</strong> capabilities and provides features targeted specifically at designers. In this course, Joseph Lowery shows you how to install Laravel and Composer its dependencies manager and start creating pages with Laravel&#39;s powerful syntax and flexible HTML views. He&#39;ll also show how to use the Blade templating system, which will be a big help in the next chapter, when you build your first Laravel app - a user authentication app. Last, you&#39;ll check your app and see how Laravel code holds up in testing.</p>\n', 'Joseph Lowery', 'Web Development', 'Programming Languages', NULL, NULL, NULL),
(201, 'Lynda', '2014-11-26', 'User Experience Fundamentals for Web Design', '<p>\n	Discover how to create a user experience that embodies utility, ease of use, and efficiency by identifying what people want from websites, how they search for information, and how to structure your content to take advantage of this. In this course, author Chris Nodder shows how to merge engineering, marketing, graphical and industrial design, and interface design to create a website that meets the needs of your customer, and is simple, elegant, and engaging. The course shows how to use graphics to help rather than hinder visitors, balance advertising and content, and integrate video, audio, and other media. Other tutorials consider the landing page experience and elements like contact forms from the visitor&#39;s perspective.</p>\n', 'Chris Nodder', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(202, 'Lynda', '2014-11-26', 'Foundations of UX: Making the Case for Usability Testing', '<p>\n	Why is usability testing important to you and your organization? For one, it empowers anybody in web or app development to find out just what their users need, and increases ROI by focusing design improvements on areas that have the biggest impact. In this short summary course, interaction design specialist Chris Nodder explains the what, why, who, and how of usability testing, and shows how to turn the benefits of usability testing into a convincing argument for performing it at your company.</p>\n', 'Chris Nodder', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(203, 'Lynda', '2014-11-26', 'Top 5 Tips for Search-Friendly Press Releases', '<p>\n	Press releases don&#39;t have to appeal just to your readers; they also need to attract the attention of search engines like Google and Bing. Marketing expert Lorrie Thomas shares the top 5 tips for writing search-friendly press releases.</p>\n', 'Lorrie Thomas Ross', 'Web Development', NULL, NULL, NULL, NULL),
(204, 'Lynda', '2014-11-27', 'UX Design Techniques: Overview', '<p>\n	Join Chris Nodder as he provides a road map to his new series, UX Design Techniques. He reviews the six steps of the user-centered design process, including: gathering and analyzing user data, creating personas, using ideation techniques, storyboarding, designing and testing prototypes, and planning your development cycle with all this information. Chris will also help you understand the benefits of user-centered design, and offer advice for getting your team on board.</p>\n', 'Chris Nodder', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(205, 'Lynda', '2014-11-27', 'UX Design Techniques: Analyzing User Data', '<p>\n	How do you know your project really fulfills your users&#39; needs? In this, the second installment of UX Design Techniques, Chris Nodder walks through the process of acquiring user data through careful observation, and transforming that data into actionable project ideas. Learn how to observe users interacting with a prototype or existing project, build experience maps that depict those interactions, and analyze the data before you progress to the next step in the series: creating user personas.</p>\n', 'Chris Nodder', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(206, 'Lynda', '2014-11-27', 'UX Design Techniques: Creating Personas', '<p>\n	Who are you developing for? How will they use your design? These are the important questions that user personas can answer for you. In this course, the third installment in our UX Design Techniques series, Chris Nodder will show you how to take the user data you&#39;ve gathered from site visits and other interactions to build a picture of the users you care about most. These personas can help drive development and make sure your entire team is designing your product, application, or website with the same goals and customer in mind, resulting in a UX design that&#39;s coherent and focused.</p>\n', 'Chris Nodder', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(207, 'Lynda', '2014-11-27', 'UX Design Techniques: Ideation', '<p>\n	Ideation is the process of generating a lot of different ideas in a short amount of time. And in UX design, a broad set of ideas is more likely to lead to a more creative, more satisfactory solution for your users. In this installment of UX Design Techniques, Chris Nodder explores the variety of ideation techniques available, their benefits, and how ideation can help designers &#39;think outside the box&#39; when it comes to user experience.</p>\n', 'Chris Nodder', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(208, 'Lynda', '2014-11-27', 'UX Design Techniques: Creating Scenarios and Storyboards', '<p>\n	Scenarios and storyboarding provide a reality check for your designs, allowing you to see how the interaction will play out in a real environment. This course shows how to use these tools to map your ideas about what the user needs to their day-to-day tasks and workflow. Author Chris Nodder explains how to write scenarios and transform them into visual storyboards that show elements of the interactions that are hard to describe with words alone, such as emotion, action, detail, and progression.</p>\n', 'Chris Nodder', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(209, 'Lynda', '2014-11-27', 'UX Design Techniques: Paper Prototyping', '<p>\n	This installment of UX Design Techniques brings together all of the information you&#39;ve gathered from previous steps. Here, Chris Nodder shows how to get fast, inexpensive, and early validation of your design ideas, using the simplest of materials: paper, Post-it notes, index cards, and Sharpies. With these tools, you&#39;ll learn how to create paper prototypes and present them to representative users of your product or system. It&#39;s a great way to test your ideas before you write any code.</p>\n', 'Chris Nodder', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(210, 'Lynda', '2014-11-27', 'UX Design Techniques: Implementation Planning', '<p>\n	User-centered design doesn&#39;t stop with visualization. In this, the final installment of UX Design Techniques, Chris Nodder shows how to gather the documentation you&#39;ve created so far and start planning the implementation of your design, from prioritizing features with the most business benefit to setting achievable metrics.</p>\n', 'Chris Nodder', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(211, 'Lynda', '2014-11-27', 'Foundations of UX: Accessibility', '<p>\n	The Internet has removed many obstacles to communication and interaction. However, when websites, technologies, or tools are poorly designed, they can create barriers that exclude people with disabilities from using the web. In this course, you&#39;ll learn how accessibility lowers the barrier to entry, by providing equal access and opportunity to people with a diverse range of hearing, movement, sight, and cognitive abilities. Derek Featherstone introduces the core concepts of accessibility as they apply to UX design, including an overview of the assistive technology visitors may use to access your projects. He includes practical examples, from re-creating visual interactions to writing great alternative text; introduces different personas and their unique challenges navigating the web; and shows how to make accessibility a regular part of your design workflow. Once you learn the foundations, you&#39;ll find that the benefits of accessibility - enhanced search, improved usability, and increased audience reach aid your designs almost as much as they aid your users.</p>\n', 'Derek Featherstone', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(212, 'Lynda', '2014-11-27', 'Foundations of UX: Usability Testing', '<p>\n	Run your own basic usability study to find out just what your users need from your website, application, or device and learn where to focus design improvements to have the biggest impact. Author Chris Nodder shows how to design a study so that it answers your questions, recruit the right participants, and set up the test environment. The course also teaches you how to moderate and observe a usability session, interact with participants and ask the right kind of questions, and then analyze the results and share them with your team in a meaningful way.</p>\n', 'Chris Nodder', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(213, 'Lynda', '2014-11-27', 'Foundations of UX: Information Architecture', '<p>\n	Improving the way the information in your site or application is organized and presented is one of the most cost-effective ways of increasing user satisfaction and engagement. Information architecture can help you find out how your users think about the world, and transition those lessons to your product. In this course, Chris Nodder teaches you how to perform card sort research to get information about user interactions, analyze the results, and create a validated information architecture plan. Then translate your plan into refined menus, content classification, and page layouts. Finally, test the success of your new structure with reverse card sorting and by monitoring feedback from server logs, site searches, and help desk calls.</p>\n', 'Chris Nodder', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(214, 'Lynda', '2014-12-05', 'Foundations of UX: Logic and Content', '<p>\n	Foundations of UX: Logic and Content looks at how designers, developers, and content creators can use the ancient art of logic and reasoning to improve user experiences and facilitate communication. Morten Rand-Hendriksen looks at the principles of logic, how computer logic and human logic differ, and how these differences can be used to improve communication. The core idea of logic is to create a system in which communication is clear, precise, and unambiguous, which is (or at least should be) the goal of any website or other communication.</p>\n', 'Morten Rand-Hendriksen', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(215, 'Lynda', '2014-12-05', 'Responsive Media', '<p>\n	Why restrict yourself to inline images and static text, especially in our multidevice, multiplatform era? Responsive media allows you to share more content with more people. Learn what you need to know to build image- and typography-rich pages (with HTML5 video!) that display correctly on a wide variety of devices. Christopher Schmitt will also show you how to convert fixed-width layouts into fluid grid layouts that adapt to different screen sizes, use media queries to deliver custom design experiences, and prepare and retrieve PNG, JPEG, and SVG images so that they look their best.</p>\n', 'Christopher Schmitt', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(216, 'Lynda', '2014-12-05', 'Responsive Design Fundamentals', '<p>\n	Web projects need to work across multiple devices, screen sizes, and browsing contexts. Web designs need to be responsive to these variables, providing an optimal viewing experience for each scenario. In this course, author James Williamson introduces responsive design to new web designers and fills in any gaps experienced designers may have, while providing a deeper exploration of how current trends in devices, connectivity, and user experience are driving its adoption. The course covers concepts like screen density, fluid grids, and responsive images, as well as actual design strategies that guide you from mock-up to testing.</p>\n', 'James Williamson', 'Web Development', 'UI/UX', NULL, NULL, NULL);
INSERT INTO `wd_course` (`id`, `institute`, `when_date`, `title`, `desc`, `lecturer`, `section`, `group`, `award`, `award_url`, `url`) VALUES
(217, 'Alison', '2015-09-14', 'Diploma in Six Sigma', '<p>\n	The<strong> Diploma in Six Sigma</strong> is free and online. It is a Six Sigma quality management training course that describes a set of techniques and tools which seek to improve the quality of process outputs by identifying and removing the causes of defects (errors) and minimizing variability in manufacturing and business processes. Each Six Sigma project carried out within an organization follows a defined sequence of steps and has quantified value targets, for example: reduce process cycle time, reduce pollution, reduce costs, increase customer satisfaction, and increase profits. In this free online Diploma course the learner will be introduced to important Six Sigma concepts such as using control charts, Design of Experiments and Taguchi methods which are very important tools used in Statistical Process Control (SPC); Benchmarking which is the process of comparing one&#39;s business processes and performance metrics to industry bests or best practices from other industries; How Six Sigma processes are powerful tools that managers can use to identify and solve supply chain problems. This free online Six Sigma training course will be of great interest to all professionals who work in the areas of Six Sigma, Quality Management and manufacturing who would like to learn more about the techniques and tools used in Six Sigma projects. It will also be of great interest to all learners who would like a career in the area of Six Sigma and quality control.</p>\n', 'N/A', 'Project Management', 'Six Sigma', NULL, NULL, NULL),
(218, 'Alison', '2015-09-02', 'Diploma in Web Design', '<p>\n	<span style="color: rgb(85, 85, 85); font-family: ''Open Sans'', Arial, sans-serif; font-size: 14px; line-height: 24px; text-align: justify;">ALISON&rsquo;s free online <strong>Diploma in Web Design</strong> course is ideal if you&rsquo;ve always wanted to create your own website but lacked the skills or knowledge to do so. Aimed at both the novice and intermediate web-designer, this comprehensive, easy-to-understand course will enhance your understanding of web development tools and techniques.</span></p>\n<p>\n	<br style="box-sizing: border-box; color: rgb(85, 85, 85); font-family: ''Open Sans'', Arial, sans-serif; font-size: 14px; line-height: 24px; text-align: justify;" />\n	<span style="color: rgb(85, 85, 85); font-family: ''Open Sans'', Arial, sans-serif; font-size: 14px; line-height: 24px; text-align: justify;">Topics covered include the essential tools for web page development including <strong>HTML</strong>, <strong>Cascading Style Sheets</strong> (<strong>CSS</strong>), and <strong>Adobe Dreamweaver</strong>. It also examines the practical steps needed to build a website such as registering a domain name and choosing a hosting account.</span></p>\n', 'N/A', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(218, 'Toastmasters International', '2003-04-01', 'Competent Toastmaster - Communication and Leadership', '<p>\n	The heart of the <strong>Toastmasters</strong> curriculum is the communication track, defined by the <strong>Communication and Leadership Program</strong> and a series of fifteen advanced manuals. The Competent Communication manual consists of ten speech projects, each building upon the other in skills and difficulty. The advanced manuals have five projects each, and each manual focuses on a particular aspect of communication (such as technical presentations, storytelling, or interpersonal communication).</p>\n', 'N/A', 'Project Management', 'Leadership', NULL, NULL, NULL),
(219, 'Alison', '2015-09-03', 'Diploma in Web Business Development and Marketing', '<p>\n	Having a business presence on the Internet has become a necessity in today&rsquo;s world. This free online diploma course from ALISON will guide learners through the initial steps of setting up an online business, from choosing a web hosting account for your site through registering your domain name. The course will then explore some of the essential tools in building your site, including <strong>HTML</strong>, <strong>Cascading Style Sheets</strong> (<strong>CSS</strong>), and <strong>Adobe Dreamweaver</strong>. Also covered are affiliate and e-mail marketing, as well as the use of social media such as <strong>Facebook</strong> to help build your business. The Diploma in Web Business Development and Marketing is ideal for anyone who always wanted to set up a Web business but felt they lacked the skills, or for those with a desire to further their understanding of how online businesses work.</p>\n', 'N/A', 'Web Development', NULL, NULL, NULL, NULL),
(220, 'Alison', '2015-09-04', 'Diploma in Social Media Marketing', '<p>\n	The importance of social media marketing for businesses and organizations is no longer questioned. It has become a worldwide trend in which helps businesses and organizations connect with their customers online.&nbsp;<br />\n	<br />\n	ALISON&#39;s free online course covers the concepts and application of social media marketing and will equip you with the skills to plan and implement a successful social media marketing strategy.<br />\n	<br />\n	Course topics include the use of email marketing, affiliate marketing, using social media tools such as <strong>Twitter</strong>, podcasting and blogging, and how to use <strong>Facebook</strong> to create a business page and get it noticed by current and potential customers.<br />\n	<br />\n	This free online course will be of interest to people who wish to learn more about social media marketing or to advance their career prospects in the social media marketing arena.</p>\n', 'N/A', 'Web Development', NULL, NULL, NULL, NULL),
(221, 'Udemy', '2015-08-23', 'Introduction to Project Management', '<p>\n	If you are thinking to transition into project management or if you just started in your project management career this course is for you. Discover how to efficiently lead projects by learning tools and techniques to manage scope, time and resources. The course will enhance your proficiency in project management. Course topics include:</p>\n<ul>\n	<li>\n		Overview of popular methods, e.g. <strong>PMI</strong>&reg;, <strong>PRINCE2</strong>&reg;, <strong>Agile</strong>, <strong>Lean</strong>, <strong>Six Sigma</strong> etc.</li>\n	<li>\n		Developing a project charter</li>\n	<li>\n		Defining a business case</li>\n	<li>\n		Gathering Requirements</li>\n	<li>\n		Planning schedule, costs and communication</li>\n	<li>\n		Reporting progress and managing stakeholders</li>\n	<li>\n		Differentiating between risks and issues</li>\n	<li>\n		Managing team, schedule, costs and quality</li>\n	<li>\n		Transitioning or closing a project</li>\n</ul>\n<p>\n	In addition to video lectures, the course also includes supplementary material such as ready to use templates and forms.&nbsp;</p>\n<p>\n	This course is an introduction to project management concepts and tools. If you are an experienced project manager or want to prepare for the&nbsp;PRINCE2&reg; or PMP&reg;certification exam we recommend to use additional resources to cover exam relevant knowledge areas more in depth. However, completion of this certificate course may count for&nbsp;credit toward certification or continuing education. Please review&nbsp;professional association websites&nbsp;for further&nbsp;details on certification and recertification requirements.</p>\n', 'Martin Vonderheiden', 'Project Management', NULL, NULL, NULL, NULL),
(222, 'Udemy', '2015-08-23', 'How To Be A Winner in Today''s Project Management World', '<p>\n	Successful projects range from reorganizing your office to building a rocket ship that will take you to the moon and beyond.&nbsp;</p>\n<p>\n	The topics covered in this presentation&nbsp;&quot;<em><strong>How to be A Winner in Today&#39;s Project Management World</strong></em>&quot;&nbsp;covers the six cornerstone concepts of&nbsp;&ldquo;Soft Skills&rdquo;&nbsp;as they are integrated into the discipline of Project Management:</p>\n<p>\n	<strong>Motivation / Value-Based Goals</strong></p>\n<p>\n	<strong>Art and/or Science</strong></p>\n<p>\n	<strong>Project Rescue</strong></p>\n<p>\n	<strong>Ethics &amp; Integrity</strong></p>\n<p>\n	<strong>Teams</strong></p>\n<p>\n	<strong>Attitude</strong></p>\n<p>\n	The lecture will give you a clear insight and enable you to better understand what is required for project success in order to define your individual destiny. Additionally you will learn what happens in the &ldquo;Real World&rdquo; of Project Managers who are leading projects in today&#39;s organizational and operational environments.</p>\n<p>\n	A Bonus Lecture is also provided to you on the subject of&nbsp;&ldquo;<strong>USERcentric Systems</strong>&rdquo;, my Trademarked Methodology which details for you the very important concept of developing systems with Users in order to ensure your success in the Application Development discipline.</p>\n<p>\n	The course prepares you to perceive Project Management from multiple view points, understand the strengths of such dispositions and prepares you to choose the right approach in order to become a winner in today&#39;s highly complex &amp; competitive scenario.</p>\n', 'Allen M. Price', 'Project Management', NULL, NULL, NULL, NULL),
(223, 'Udemy', '2015-09-10', 'JIRA and GreenHopper for Agile Teams', '<p>\n	This course is targeted at new <strong>Scrum</strong> and <strong>Kanban</strong> teams that are looking to get started quickly with <strong>Atlassian JIRA</strong> and <strong>GreenHopper</strong>. We will explore both methodologies and help your team become a high performing agile team.</p>\n<p>\n	We start with introductory usage of JIRA and move on to advanced topics. Supporting documents are available for greater detail, allowing you to follow along at your own pace.&nbsp;</p>\n', 'Nicholas Muldoon', 'Project Management', 'Agile', NULL, NULL, NULL),
(224, 'Udemy', '2015-09-11', '22 Practical Lessons in Leadership', '<p>\n	It is no longer enough to just have technical skills when most tasks are now structured around teams.&nbsp;</p>\n<p>\n	It is no longer enough to work long hours and hope for your boss to notice your contributions.&nbsp;</p>\n<div>\n	Whether you&rsquo;re a working professional who strives to obtain a job promotion or a student participating in group projects, you will find that leadership skills play a huge role in your success. This X-factor determines the difference between you and any other soul willing to slave more hours than you.&nbsp;</div>\n<div>\n	<br />\n	<div>\n		Leadership has become an essential skill that is greatly valued in every single industry.&nbsp;</div>\n	<div>\n		<br />\n		<p>\n			Most believe that you need to have the spirit of a leader within you, from the minute you&#39;re born. Sure, some are born with that incredible confidence to lead, but does that mean confidence and beliefs cannot be changed or obtained?&nbsp;</p>\n		<div>\n			There is a leader within you, your neighbour, your gardener and your mother!&nbsp;</div>\n		<div>\n			<br />\n			<p>\n				It&#39;s in everyone. But how many choose to hone it?&nbsp;</p>\n			<p>\n				You can make a difference to the people in your life. But first, you need to choose to take a step forward, to understand that leadership is a skill that can be acquired and improved upon.&nbsp;</p>\n			<div>\n				Steve Jobs, Mother Teresa, Martin Luther King and Mahatma Gandhi are examples of extraordinary leaders who have touched the lives of many.&nbsp;\n				<p>\n					All of them came from humble backgrounds, but they constantly sought to improve themselves and overcome obstacles.&nbsp;</p>\n				<div>\n					Roshan Thiran is the Founder and CEO of Leaderonomics, a social enterprise dedicated to providing access to leadership development to everyone of all ages.&nbsp;</div>\n				<div>\n					<br />\n					<p>\n						He has won multiple awards in business and leadership development and hopes to reach out to others who want to become an effective leader.&nbsp;</p>\n					<p>\n						The short clips in this course will bring you through typical work scenarios where you can understand and learn to apply leadership techniques. With Roshan&rsquo;s guidance, you will realize that leadership can be practiced very frequently in your life.&nbsp;</p>\n					<p>\n						Through this 22 video course, you will receive precious nuggets of advice on how to become a leader in your own right. Armed with these practical skills, you can now thrive in your organisation and make a positive difference!&nbsp;</p>\n					<p>\n						You can be a leader, and the time to take action is NOW!</p>\n				</div>\n			</div>\n		</div>\n	</div>\n</div>\n<p>\n	&nbsp;</p>\n', 'N/A', 'Project Management', 'Leadership', NULL, NULL, NULL),
(225, 'Udemy', '2015-09-15', 'Change and Innovation Management', '<p>\n	Achieve greater performance within your organization by learning the essential skills necessary to define your&nbsp;goals, generate and execute better&nbsp;ideas&nbsp;and empower your&nbsp;teams. These innovation skills will increase efficiency and value, make your organization a better place to work, and help you&nbsp;become a more successful manager. This course draws on best practice within leading organizations to present you with a&nbsp;step by step approach&nbsp;for planning effective change.&nbsp;Class projects&nbsp;will help you practice what you learn. Carefully designed&nbsp;templates&nbsp;will then allow you to effortlessly create development plans for your own organization. This course is supported, updated and delivered to you&nbsp;free&nbsp;from the National University of Ireland Galway.</p>\n', 'David O''Sullivan', 'Project Management', NULL, NULL, NULL, NULL),
(226, 'Lynda', '2014-12-06', 'Web Design Fundamentals', '<p>\n	New to web design? Start here first. In these tutorials, James Williamson introduces the fundamental concepts, tools, and learning paths for web design. He explains what it means to be a web designer, the various areas of specialization, and whether web design is the right hobby or career for you. Along the way, he talks to five prominent designers and developers, who have each found success in a different corner of the web.</p>\n<div>\n	If you want to get up and running fast, check out the chapter on getting online, choosing a domain name and web host, and getting around the backend of a standard website. Need to stock your tool chest? Learn what you&#39;ll need to build a brand new site, from web design software and content management systems, to testing and prototyping tools and development frameworks. Finally, James outlines learning paths for where to go next, touching on subjects such as standards and accessibility, responsive design, and the three core web technologies: <strong>HTML</strong>, <strong>CSS</strong>, and <strong>JavaScript</strong>.</div>\n', 'James Williamson', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(227, 'Lynda', '2014-12-11', 'WordPress Developer Tips: DRY Development', '<div>\n	<strong>DRY</strong> development is &quot;<strong>don&#39;t repeat yourself</strong>&quot; development: a smart strategy for reusing code and reducing repetition, wherever possible. This short course shows how to put DRY development techniques into practice in your <strong>WordPress</strong> sites. Staff author Morten Rand-Hendriksen introduces four techniques for DRY development in WordPress, and shows how they are used in both default themes and custom themes like Simone.</div>\n', 'Morten Rand-Hendriksen', 'Web Development', NULL, NULL, NULL, NULL),
(228, 'Lynda', '2014-12-20', 'Brainstorming Basics', '<p>\n	What is brainstorming? Invented in 1948, brainstorming is still the dominant technique when it comes to idea generation. It combines creativity, problem solving, and group discussion. Unfortunately for creator Alex Osborn, most brainstorms fail before they ever begin. Why? Because the organizer doesn&#39;t have a clear picture of the purpose, process, or intended outcome. In this course, Stefan Mumaw brings brainstorming into the modern age, with rules and techniques that will help you set up and run more-effective creative brainstorming sessions.</p>\n', 'Stefan Mumaw', 'Project Management', NULL, NULL, NULL, NULL),
(229, 'Lynda', '2014-12-20', 'The Fundamentals of Document Retention and Data Management', '<p>\n	Do you know which documents to keep, and how long to keep them? A solid document-retention policy can preserve knowledge, prevent liabilities, and keep you compliant with government regulations. In this course, William R. Joseph will help you get the proper documentation and data-management policies in place at your organization. He introduces the basic concepts behind document retention.</p>\n', 'William Joseph', 'Project Management', NULL, NULL, NULL, NULL),
(230, 'Lynda', '2014-12-20', 'Holding Skip-Level Meetings', '<p>\n	A new type of meeting is emerging: skip-level meetings. Skip-level meetings are meetings you hold with employees who work for the managers who report to you - essentially &quot;skipping&quot; a level to learn more about the organization around you. In this short course, author Todd Dewett shows you how to successfully initiate and hold these meetings with employees who work for your direct reports. Discover how to set the tone, ask for candid feedback, and make meaningful connections. At the end of this course, you&#39;ll have the skills you need to build bridges across teams, and learn much more about your organization than you could through your direct reports alone.</p>\n', 'Todd Dewett', 'Project Management', NULL, NULL, NULL, NULL),
(231, 'Lynda', '2014-12-20', 'WordPress Quick Tips: Migration and Database Reset', '<p>\n	Migrating <strong>WordPress</strong> databases.</p>\n', 'Morten Rand-Hendriksen', 'Web Development', NULL, NULL, NULL, NULL),
(232, 'Lynda', '2014-12-23', 'WordPress Developer Tips: Managing Users in the Database', '<p>\n	Welcome to another installment of <strong>WordPress</strong> Developer Tips. In this quick course, staff author Morten Rand-Hendriksen shows you how to edit WordPress user accounts directly in the database with <strong>phpMyAdmin</strong> - bypassing WordPress entirely. This is a useful technique for managing large pools of users and troubleshooting unresponsive accounts. Dive in and learn how to reset passwords, change user names and roles, and remove users from the database altogether.</p>\n', 'Morten Rand-Hendriksen', 'Web Development', NULL, NULL, NULL, NULL),
(233, 'Lynda', '2014-12-23', 'The Five-Step Creative Process', '<p>\n	The creative process isn&#39;t just &quot;generating ideas.&quot; The reality is it&#39;s a five-step process, and ideation is only one of those steps. The entire creative process is made up of objective finding, data gathering, problem design, ideation, and selection. Understanding the role of each step enables us to ensure that we generate the most effective solutions. In this course, Stefan Mumaw guides us through the five steps and then shows us what the complete process looks like, with a real-world project: designing a website.</p>\n', 'Stefan Mumaw', 'Project Management', NULL, NULL, NULL, NULL),
(234, 'Lynda', '2014-12-23', 'The Science of Logo Design', '<p>\n	Logo design requires artistry, but did you know your logos can also benefit from science? William Lidwell introduces the whys behind well-known guidelines and even debunks a few outdated design myths along the way. He reviews the 4 principles that make a logo ARMM&#39;d for use: attention, response, meaning, and memory. Use these tips to bring scientific rigor to your logos and start designing on evidence, not industry hearsay.</p>\n', 'William Lidwell', 'Web Development', NULL, NULL, NULL, NULL),
(235, 'Lynda', '2014-12-23', 'Improving Your Conflict Competence', '<p>\n	Workplace conflict is inevitable. But it doesn&#39;t have to end badly. In this course, author and conflict expert Craig Runde helps you manage workplace conflict more effectively. He first explains the dynamics that create conflict, and helps you become aware of what your conflict response is. Once you are aware of how conflict arises, learn some practical steps you can take to manage your emotions and engage with others constructively.</p>\n', 'Craig Runde', 'Project Management', NULL, NULL, NULL, NULL),
(236, 'Lynda', '2014-12-23', 'Pay Strategy Fundamentals', '<p>\n	Pay isn&#39;t just a cost; it&#39;s a contributor to business culture and performance, too. In this course, HR expert Ed Lawler addresses the impact of an organization&#39;s pay and rewards strategies on its business goals. Based on his years of research, teaching, and consulting, Ed outlines the effectiveness of using pay to drive particular objectives, such as attracting new talent, encouraging and rewarding behavior, accomplishing a specific goal, and driving performance in a business unit. Last, Ed reveals how to create an overall pay system to match your business strategy.</p>\n', 'Edward Lawler III', 'Project Management', NULL, NULL, NULL, NULL),
(237, 'Lynda', '2014-12-23', 'Creative Insights: Lauren Bacon on Web Design', '<p>\n	Lauren Bacon ran a successful web design and development firm for twelve years. Now she is working as a business coach, helping entrepreneurs get their own businesses up and running. In this course, she shares her insights on breaking into the industry: acquiring the right skills, thinking beyond the digital toolset, and specializing in areas that will make your firm in demand. Lauren also answers questions about navigating career transitions, from employee to manager, to freelancer (and maybe even back again), and what the future will look like for new web designers.</p>\n', 'Lauren Bacon', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(238, 'Lynda', '2014-12-28', 'Mapping the Modern Web Design Process', '<p>\n	Once you eliminate the trends and terminology, web design is about one thing and one thing only: getting your message across to an online audience. This course offers a 10,000-foot view of the web design process, to help ensure you never lose sight of your users. Morten Rand-Hendriksen takes you on a journey from initial consultation and discovery through content strategy and UX considerations, to development, content creation, design, testing, and launch. By the end, you&#39;ll understand the different players and phases and how they fit together in a web design approach focused on meaningful communication and a great user experience.</p>\n', 'Morten Rand-Hendriksen', 'Software Development', NULL, NULL, NULL, NULL),
(239, 'Lynda', '2014-12-28', 'Collaborative Design: Vision and Strategy', '<p>\n	Beneath the surface of great design - where the color palettes, fonts, and graphics live - lies a strong core vision. Creating that vision requires what Lauren Bacon calls &quot;deep collaboration&quot; with your clients. When you can get inside the heads of the people you&#39;re designing for, you can do extraordinary work. In this course, Lauren teaches you how to listen, ask better questions, and collaborate more effectively with clients and other stakeholders, in order to develop a project vision and strategy that results in better, more effective designs.</p>\n', 'Lauren Bacon', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(240, 'Lynda', '2015-01-01', 'Foundations of UX: Multidevice Design', '<p>\n	If users really like your website or app, they&#39;re not logging in from a single device. They&#39;re visiting from their desktop at work, their phone on the train, and their tablet at home. Your design also needs to perform elegantly and consistently on all platforms. In this course, Brian Thurston shows how to design complete experiences that take visitors from one device to another, and back again. You&#39;ll leave with a solid understanding of the planning it takes to ensure your site is prepared for success, the importance of flexible content creation and preparation, and special considerations involved in designing for touch screens. Brian also takes a look forward at the impact wearable devices and future tech will have on the UX designs of today.</p>\n', 'Brian Thurston Bralczyk', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(241, 'Lynda', '2015-01-01', 'Design Aesthetics for Web Design', '<p>\n	A basic understanding of the principles of good design (such as contrast, unity, and balance) is the foundation for creating beautiful websites. In this course, Sue Jenkins explains design aesthetics in simple terms, and shows how to incorporate the principles of design in specific ways that improve your site. Learn how to adjust adjacent colors to add contrast, create depth with texture, incorporate movement, and use repeating shapes, patterns, and borders to unify your design. Then, in the final chapter, learn about special issues designers should address in their web layouts, such as responsive design for mobile devices, accessibility, and originality.</p>\n', 'Sue Jenkins', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(242, 'Lynda', '2015-01-02', 'CSS for Developers', '<p>\n	<strong>CSS for Developers</strong> is designed to give a working knowledge of <strong>CSS</strong> to web developers and coders who already have a firm grasp of XHTML/HTML and want to harness the power of style sheets to take their web sites to the next level. Instructor Bill Weinman reviews CSS fundamentals, including the benefits and limitations of the language, and then dives straight into creating styles. This course covers how to format text, images, and backgrounds; how to position elements on the page; and how to apply styles, both inline and via an external style sheet. CSS best practices and browser support issues are also addressed.</p>\n', 'Bill Weinman', 'Web Development', 'UI/UX', NULL, NULL, NULL),
(243, 'Udemy', '2015-09-17', 'PRINCE2 Foundation Introduction - Management Plaza', '<p>\n	The <strong>PRINCE2 Foundation Introduction</strong> / Demo course gives you an insight about the material of the full course that is also available on Udemy. <strong>PRINCE2</strong> Foundation certification is one of the most sought after certifications in the project management world. This tip of the iceberg introduction course will not only show you the benefits of the PRINCE2 methodology, but it will also demonstrate the best way to achieve the PRINCE2 Foundat&#39;on certification.&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	<em><strong>PRINCE2&reg; is a registered trade mark of APMG</strong></em></p>\n', 'Frank Turley', 'Project Management', 'PRINCE2', NULL, NULL, NULL),
(244, 'Lynda', '2015-01-03', 'WordPress Developer Tips: Locking Down WordPress', '<p>\n	You need to lock <strong>WordPress</strong> down to keep your site secure and prevent malicious attacks. This installment of Morten Rand-Hendriksen&#39;s WordPress Developer Tips covers security best practices, such as backing up your site, limiting admin and server access, and using settings and code snippets to block access to core files. Morten also introduces valuable security plugins and third-party services that will help you limit login attempts, enable two-factor authentication, and divert malicious traffic.</p>\n', 'Morten Rand-Hendriksen', 'Web Development', NULL, NULL, NULL, NULL),
(245, 'Lynda', '2015-01-16', 'Body Language for Leaders', '<p>\n	Research shows that when your verbal and nonverbal signals are out of alignment, people are forced to choose between what they hear and what they see. And subconsciously, they&#39;ll believe your body language. In this course, workplace body-language expert Carol Kinsey Goman, PhD, reveals how body language is perceived and often misread, and shares the six nonverbal signals you need to know to make a positive first impression. She also discusses the importance of body language for leaders, and shows how you can establish leadership presence. Lastly, she provides simple and effective tips on communicating with gestures and stance.</p>\n', 'Carol Kinsey Goman', 'Project Management', 'Leadership', NULL, NULL, NULL),
(246, 'Lynda', '2015-01-16', 'Dealing with a Difficult Boss', '<p>\n	Author and professional coach Todd Dewett helps you address the challenge of working with a difficult boss by helping you identify, understand, and manage the triggers that contribute to your problematic relationship. He also outlines actions you can take, such as correctly documenting events, knowing when to speak up, and - sometimes - not taking any action at all.</p>\n', 'Todd Dewett', 'Project Management', NULL, NULL, NULL, NULL),
(247, 'Lynda', '2015-01-17', 'Overcoming Procrastination', '<p>\n	Is procrastination getting in the way of your work? Take 20 minutes now to identify why you do it and set yourself up to overcome procrastination in the future. Author and Kelley School of Business lecturer Brenda Bailey-Hughes shows you how to separate procrastination from other behaviors, identify your stalls, and address your procrastination head on with strategies that will help you get more done.</p>\n', 'Brenda Bailey-Hughes', 'Project Management', NULL, NULL, NULL, NULL),
(248, 'Lynda', '2015-01-17', 'Improving Your Judgment', '<p>\n	Want to make better decisions at work? In this short course, author, innovation expert, and professor Drew Boyd discusses ways to confront our hardwired cognitive biases, in order to make good decisions and exercise more balanced, sound judgment.</p>\n', 'Drew Boyd', 'Project Management', 'Leadership', NULL, NULL, NULL),
(249, 'Lynda', '2015-03-30', 'Making Business Projections', '<p>\n	Estimating future financial performance plays a big part in the life of start-ups and corporations large and small. By looking ahead, companies can proactively manage changes. Start-ups can use projections to build business plans and raise capital. This course is about making those financial projections: not by predicting the future, but by learning from past performance. Rudolph Rosenberg shares the techniques used by financial planning professionals to build robust financial projections using Microsoft Excel. He shows how to combine two approaches - bottom up and top down&mdash;into a well-rounded projection that will help you analyze revenue and expenses, anticipate changes, and incorporate company goals in a realistic picture of your company&#39;s future.</p>\n', 'Rudolph Rosenberg', 'Project Management', NULL, NULL, NULL, NULL),
(250, 'Lynda', '2015-03-30', 'Financial Literacy: Reading Financial Reports', '<p>\n	A wealth of information is available to you if you know how to read financial documents. Being able to glean information from an income statement, a cash flow statement, or a balance sheet can give you an edge in understanding not only your own business but also your competition. In this course, Rudolph Rosenberg, a finance expert, takes you through the steps of making sense of what is contained in financial reports and how to read them. You&#39;ll also learn how they fit together to give you a view of a company&#39;s situation.</p>\n', 'Rudolph Rosenberg', 'Project Management', 'Management', NULL, NULL, NULL),
(251, 'Lynda', '2015-08-04', 'Managing Technical Teams', '<p>\n	In this course, Bob McGannon outlines the critical elements for successfully managing a technical team. Since you are dealing with highly skilled workers, it is important for you to focus on WHAT needs to be accomplished, rather than HOW to accomplish goals. Other critical skills include knowing your role and what decisions to make, balancing the needs of your stakeholders and customers while allowing for creativity within your team, supporting and rewarding differing creative styles, and much more. This course also includes a model for dividing, tracking, and sharing the accomplishments of your team.</p>\n', 'Bob McGannon', 'Project Management', 'Management', NULL, NULL, NULL),
(252, 'Lynda', '2015-08-09', 'Solving Common Project Problems', '<p>\n	When you&#39;re balancing the triple constraints of project management (cost / quality / time) and trying to accomplish something new, problems are bound to crop up. In the course, project management trainer Chris Croft shows how to solve the most common problems that arise when working on projects. By breaking these issues into 4 major categories - people problems, quality problems, cost problems, and time problems&mdash;he provides helpful advice and techniques for how to handle them.</p>\n', 'Chris Croft', 'Project Management', NULL, NULL, NULL, NULL),
(253, 'Lynda', '2015-08-15', 'Managing Project Integration', '<p>\n	Project integration ensures all processes in a project run smoothly, and results in a properly synchronized series of deliverables such as the project charter, project plan, and preliminary project scope statement. This course will help managers plan the integration needs, communicate with staff and stakeholders, and integrate the project into an organizational portfolio. Along the way, Bob McGannon, PMP, shows how to ensure your scope, risk, and change approaches are in sync; recognize warning signs when integration goes awry; and plan the simultaneous integration of multiple projects and customer deliverables.</p>\n', 'Bob McGannon', 'Project Management', NULL, NULL, NULL, NULL),
(254, 'Lynda', '2015-08-15', 'Managing Project Stakeholders', '<p>\n	Create healthy partnerships with your stakeholders and build a win-win environment for your business. In this course, author and PMP Terri Wagner shows you how to manage stakeholders with savvy communication strategies that increase engagement in the final project. Learn how to analyze stakeholders, map power structures, keep open lines of communication, and use interpersonal skills to connect.</p>\n', 'Terri Wagner', 'Project Management', NULL, NULL, NULL, NULL),
(255, 'Lynda', '2015-08-15', 'Working with Upset Customers', '<p>\n	More than any other topic, frontline employees ask for advice on how to serve angry and upset customers. This course will reveal proven techniques for effectively neutralizing negative situations. Customer service expert Jeff Toister also shares specific actions employees can take before and after encounters with upset customers that will reduce the likelihood of problems occurring in the future.</p>\n', 'Jeff Toister', 'Project Management', NULL, NULL, NULL, NULL),
(256, 'Lynda', '2015-08-20', 'Managing Project Schedules', '<p>\n	Get the upper hand on your project schedules before they begin and see them through to conclusion, on time and on budget. In this course, PMP-credentialed author Bonnie Biafore teaches you how to proactively manage project schedules. This includes a look at the elements that go into a schedule; how to estimate costs and resources; best ways to negotiate and allocate resources; and how to manage a schedule over time.</p>\n', 'Bonnie Biafore', 'Project Management', NULL, NULL, NULL, NULL),
(258, 'Lynda', '2015-08-22', 'Negotiation Fundamentals', '<p>\n	Coach, negotiation expert, and author Lisa Gates demonstrates the skills empowered communicators use to achieve mutual benefit at the negotiation table. The course delivers repeatable strategies for negotiating common issues such as asking for a raise, setting fees, promoting teamwork, and bringing out the best in those you manage. Along the way, discover how to use interest-based negotiation, distributive bargaining, diagnostic questioning, and conflict resolution to handle both simple and complex negotiations.</p>\n', 'Lisa Gates', 'Project Management', 'Management', NULL, NULL, NULL),
(259, 'Pluralsight', '2015-08-08', 'Agile Fundamentals', '<p>\n	In <strong>Agile Fundamentals</strong>, we explore how working on an <strong>Agile</strong> project has benefits for your development team, your end users, and your organization as a whole. This course starts by exploring the more traditional waterfall process, and then covers why running an Agile team is a good idea. This course is ideal for software developers, project managers, software leadership, or anyone that would have an interest and gain benefit from running an Agile project and delivering maximum value early to your customers.</p>\n', 'Stephen Haunts', 'Project Management', 'Agile', NULL, NULL, NULL),
(260, 'Lynda', '2015-08-09', 'Agile in the Real World', '<p>\n	<strong>Agile</strong> practices often sound great on paper, but quickly lose their luster once you try to apply them in the real world. This course will show you how to take the best of Agile methodologies and apply them to your own team in a way that actually makes sense. Rather than focus on the theory of how agile works in a vacuum, the techniques taught in this course are based on the most common places where agile breaks down in reality and the concrete strategies to fix them.</p>\n', 'Jeremy Jarrell', 'Project Management', 'Agile', NULL, NULL, NULL),
(261, 'Coursera', '2015-09-03', 'Project Management: The Basics for Success', '<p>\n	This course combines the essential elements of <strong>Project Management</strong> and <strong>Team Leadership</strong> into one course. Through class engagement and reflection, you will acquire further understanding of the responsibilities of leadership and become better prepared to apply this knowledge to the project environment.</p>\n', 'Rob Stone', 'Project Management', NULL, NULL, NULL, NULL),
(262, 'Coursera', '2015-09-08', 'Work Smarter, Not Harder: Time Management for Personal & Professional Productivity', '<p>\n	You will be able to gain and apply your knowledge and understanding of personal and professional awareness, organization and commitment, and use the tools, methods and techniques that you have learned in goal setting, prioritization, scheduling, and delegation to overcome time management challenges and enhance productivity.</p>\n', 'Margaret Meloni', 'Project Management', NULL, NULL, NULL, NULL),
(263, 'Pluralsight', '2015-08-14', 'Developing Resourcefulness', '<p>\n	Being able to do more with less is a highly valued skill in any organization, and not just in down times. In this course, management expert and trainer Todd Dewett helps you assess your resourcefulness by first evaluating your professional resources (personal network, expertise, information, and access to finances) and how to decide when and how to use them. He also provides advice on developing habits to cultivate resourcefulness, such as asking the right questions and building your network across a broad spectrum.</p>\n', 'Todd Dewett', 'Project Management', 'Leadership', NULL, NULL, NULL),
(264, 'Lynda', '2015-08-23', 'Learning to Be Assertive', '<p>\n	We all get frustrated when we feel taken advantage of, or alternatively, respond too aggressively when we feel provoked or trapped. Overcome these knee-jerk responses by learning how to be assertive. This course reveals what assertiveness really means, and how it is different from aggression, and outlines specific techniques you can use to respond to challenging situations and difficult people.</p>\n', 'Chris Croft', 'Project Management', 'Leadership', NULL, NULL, NULL),
(265, 'Pluralsight', '2015-09-01', 'Windows 10 First Look', '<p>\n	A quick, concise, look at what&#39;s coming in Windows 10.</p>\n', 'N/A', 'IT', NULL, NULL, NULL, NULL),
(266, 'Pluralsight', '2015-08-26', 'Big Scrum', '<p>\n	Grounded in pragmatism and eschewing dogmatism, this course draws on the experiences of the author successfully applying and participating in Scrum in large organizations. This course specifically focuses on growing Scrum without changing what <strong>Scrum</strong> is or how it works. David examines the roles, artifacts, and events of Scrum and the specific challenges they face when scaled beyond a single team integrating into a single product.</p>\n', 'David Starr', 'Project Management', 'Agile', NULL, NULL, NULL),
(267, 'Pluralsight', '2014-10-31', 'Becoming an Outlier: Reprogramming the Developer Mind', '<p>\n	As a developer, your image and your mind are your product. So to get what you&rsquo;ve never had, you must do what you&rsquo;ve never done with these precious tools. If you want to make a bigger impact, raise your income, and code with purpose, this course will outline the path to get you there. This course is about making a paradigm shift in how you manage your career. We&rsquo;ll discuss concrete activities and skills that transform average developers into outliers. You&rsquo;ll learn why developers can&#39;t afford cable, ways to improve your &ldquo;luck surface area&rdquo;, and techniques to compress your career through accelerated development. You&#39;ll learn the foundational skills for becoming an outlier: command your time, hack your image, and own your trajectory. Prepare to think about your development career in a whole new way.</p>\n', 'Cory House', 'Personal', NULL, NULL, NULL, NULL),
(268, 'Pluralsight', '2014-11-02', 'Career and Survival Strategies for Software Developers', '<p>\n	A software development career poses challenges that we don&#39;t often discuss: How do you keep up with rapidly changing technology? When, and how often should you change jobs? How do you evaluate a job offer? How and when should you move from programming into management, or into some other related career? How do you leverage those relatively high salaries into real financial security? Should you work for a large company? A startup? Or found your own company? This course will help you answer those questions and more, whether you are just learning programming or have been developing software for decades.</p>\n', 'Dan Appleman', 'Personal', NULL, NULL, NULL, NULL),
(269, 'Pluralsight', '2014-11-09', 'Drupal 7: Foundation', '<p>\n	This course provides a solid foundation for developing custom content management systems using the <strong>Drupal 7</strong> Content Management Framework. Through dozens of thoroughly explained, direct demonstrations, you will learn how to be productive using the core tools and building blocks of a Drupal site: modules, themes, content types, nodes, menus, blocks, URL patterns, views, and more.</p>\n', 'Leo Schuman', 'Web Development', NULL, NULL, NULL, NULL),
(270, 'Pluralsight', '2014-11-17', 'Fundamentals of Written Proposals', '<p>\n	Fundamentals of Written Proposals covers how to create, develop, and eventually write a technical or business proposal. Specific modules cover the role of proposals in professional culture, different types of proposals, common persuasive techniques and strategies, main and secondary sections of an unsolicited proposal, and how to critically read and develop a solicited proposal.</p>\n', 'Alan Ackmann', 'Project Management', NULL, NULL, NULL, NULL),
(271, 'Pluralsight', '2014-11-23', 'Incident Management', '<p>\n	In this course, you will learn about the specific goals and objectives, interfaces, and purpose of the Incident Management process, as well as how it is applied in real life. The course uses a case study approach to illustrate the benefits companies have derived through process maturity. This course also covers the basics of how the <strong>PDCA</strong> cycle can be used to assist in process improvement.</p>\n', 'Lowell Amos', 'Project Management', NULL, NULL, NULL, NULL),
(272, 'Pluralsight', '2014-12-06', 'Introduction to the Bash Shell on Mac OS and Linux', '<p>\n	The command line is one of the most important tools for a <strong>Linux</strong> / <strong>UNIX</strong> power user. Bash is the default login shell on Linux and <strong>Mac OS</strong>, and adding it to your skillset will open up a whole new world of possibilities. For one thing, it gives you access to a huge number of command line utilities, simplifying many everyday tasks. But Bash also provides you with a powerful scripting language for automating just about anything. For remote access and system administration, Bash is an absolute must.</p>\n', 'Reindert-Jan Ekker', 'Software Development', NULL, NULL, NULL, NULL),
(273, 'Pluralsight', '2014-12-14', 'ITIL Service Operation', '<p>\n	This course is for students who have completed their <strong>ITIL</strong> Foundations certification and wish to gain deeper insights into the processes, challenges, critical success factors and benefits of Service Operation within the ITIL framework. It is primarily aimed at leaders and practitioners who deliver quality service management practices. Topics include the value of Service Operation to the business, how the areas of Service Operation interface with other processes, and the workflows for event, incident, problem, and access management. The main target group for the ITIL&reg; Expert Qualification: Service Operation Certificate includes, but is not restricted to CIOs, CTOs, managers, supervisory staff, team leaders, designers, architects, planners, IT consultants, IT audit managers, IT security managers and ITSM trainers involved in the ongoing management, coordination and integration of operation activities within the Service Lifecycle. Qualification Level: Intermediate (Lifecycle stream).</p>\n', 'Lowell Amos', 'Project Management', NULL, NULL, NULL, NULL),
(274, 'Pluralsight', '2014-12-21', 'Pitching Your Idea Effectively', '<p>\n	An introduction to the three types of pitches that you can make to an investor or in other business environments. Properly structuring your pitch will help with delivery and be more persuasive.</p>\n', 'Stephen Forte', 'Project Management', 'Leadership', NULL, NULL, NULL),
(275, 'Pluralsight', '2014-12-26', 'PMP - Organizational Influences & Project Management Lifecycle', '<p>\n	Building on the foundation set in Introduction to Project Management and the <strong>PMP</strong>&reg; Exam, this course will focus on the topics discussed in Chapters 2 and 3 of the <strong>Project Management Body of Knowledge</strong>, more commonly referred to as the &quot;<strong>PMBOK</strong>&reg; Guide.&quot; The course explores how organizational cultures, styles, communication preferences, and structure factor into project management. It defines the role of project stakeholders and the composition of successful project teams, and describes the phases and characteristics of the project life cycle. Continuing on, the course outlines the five process groups in project management: initiating, planning, executing, monitoring/controlling, and closing. Finally, it lays the groundwork for future courses focused on the knowledge areas encountered in each phase of project management.</p>\n', 'Casey Ayers', 'Project Management', 'PMP', NULL, NULL, NULL),
(276, 'Pluralsight', '2014-12-27', 'PMP – Introduction to Project Management & the PMP Exam', '<p>\n	This course serves as an introduction to project management and the <strong>PMP</strong>&reg; certification exam. The course discusses the PMP&reg; certification &ndash; what it is, how one may qualify to earn it, and the certification&#39;s benefits &ndash; as well as the qualification and application process and how to minimize the financial burden of attaining the certification. Additionally, foundational concepts of project management are explored, including the introduction of the <strong>PMBOK</strong> Guide, the precise definitions and interconnections of project, program, and portfolio management, and the role and value of project managers within organizations.</p>\n', 'Casey Ayers', 'Project Management', 'PMP', NULL, NULL, NULL),
(277, 'Pluralsight', '2014-12-31', 'SOLID Principles of Object Oriented Design', '<p>\n	The <strong>SOLID</strong> principles are fundamental to designing effective, maintainable, object-oriented systems. Whether you&#39;ve only just begun writing software or have been doing so for years, these principles, when used appropriately, can improve the encapsulation and coupling of your application, making it more malleable and testable in the face of changing requirements.</p>\n', 'Steve Smith', 'Software Development', NULL, NULL, NULL, NULL),
(278, 'Pluralsight', '2015-01-03', 'PMP - Organizational Influences & Project Management Lifecycle', '<p>\n	Building on the foundation set in Introduction to Project Management and the <strong>PMP</strong>&reg; Exam, this course will focus on the topics discussed in Chapters 2 and 3 of the <strong>Project Management Body of Knowledge</strong>, more commonly referred to as the &quot;<strong>PMBOK</strong>&reg; Guide.&quot; The course explores how organizational cultures, styles, communication preferences, and structure factor into project management. It defines the role of project stakeholders and the composition of successful project teams, and describes the phases and characteristics of the project life cycle. Continuing on, the course outlines the five process groups in project management: initiating, planning, executing, monitoring/controlling, and closing. Finally, it lays the groundwork for future courses focused on the knowledge areas encountered in each phase of project management.</p>\n', 'Casey Ayers', 'Project Management', 'PMP', NULL, NULL, NULL);
INSERT INTO `wd_course` (`id`, `institute`, `when_date`, `title`, `desc`, `lecturer`, `section`, `group`, `award`, `award_url`, `url`) VALUES
(279, 'Udemy', '2015-09-17', 'The Agile Samurai Bootcamp', '<p>\n	Enter the world of the <strong>Agile Samurai</strong>, where the most dire of software projects are dispatched with ease and grace. By learning the ways of the Agile Samurai you will discover:&nbsp;</p>\n<p>\n	- what Agile is, how it works, and the mindset necessary for working iteratively&nbsp;</p>\n<p>\n	- common myths and pitfalls and how to choose the right Agile method for you&nbsp;</p>\n<p>\n	- how to build a good Agile team&nbsp;</p>\n<p>\n	- how from traditional waterfall roles (like developer, analyst, tester, and project manager) change on Agile project&nbsp;</p>\n<p>\n	- how to create a plan you and your customer can believe in&nbsp;</p>\n<p>\n	- how to gather requirements in a fraction of the time using Agile User Stories&nbsp;</p>\n<p>\n	- how to deliver something of value every week&nbsp;</p>\n<p>\n	- what to do when the schedule is wrong, and how to look like a pro correcting it, and&nbsp;</p>\n<p>\n	- the four essential Agile Engineering practices, and why they are so important for Agility.&nbsp;</p>\n<p>\n	By the end of this course you&rsquo;ll have everything you need to successfully set up, execute, and deliver your own Agile project.&nbsp;</p>\n<p>\n	<strong>Course Outline&nbsp;</strong></p>\n<p>\n	<strong>Agile In a Nutshell</strong></p>\n<p>\n	What Agile is, how it works, and how to choose the right Agile method for you.&nbsp;</p>\n<p>\n	<strong>Agile Teams</strong></p>\n<p>\n	What makes the Agile team tick. Characteristics of good Agile teams. And how to find quality players.&nbsp;</p>\n<p>\n	<strong>User Stories</strong></p>\n<p>\n	In this session we break down what user stories are, how they work, what effective user stories look like for your project, and how to host great story gathering work shops.&nbsp;</p>\n<p>\n	<strong>Estimation</strong></p>\n<p>\n	By learning how to estimate the Agile way, you&rsquo;ll stop trying to get something your up-front estimates can&rsquo;t give (precision and accuracy) and instead focus on what really matters&mdash;building a plan you and your customer can believe in.&nbsp;</p>\n<p>\n	<strong>Planning</strong></p>\n<p>\n	In this session, you&rsquo;re going to learn how to create plans you can believe in and follow through on commitments you and your team make.&nbsp;</p>\n<p>\n	<strong>Iteration Mechanics</strong></p>\n<p>\n	This session shows teams how to set the iterations up for success, breaks down what actually occurs during an iteration, and how to setup an agile communication plan for you and your team.&nbsp;</p>\n<p>\n	<strong>Visible Workspaces</strong></p>\n<p>\n	By learning how to create a visual workspace, you and the team will never be at a loss for what to do next or where you can add the greatest value.&nbsp;</p>\n<p>\n	<strong>Engineering</strong></p>\n<p>\n	Agile doesn&rsquo;t work on planning alone. That would be wishful thinking. Only by apply these core software engineering practices can you reduce the time it takes to test, ensure you always have a good design, and confidently make necessary changes with speed.&nbsp;</p>\n<p>\n	<strong>Unit Testing</strong> - Automated tests proving your software works&nbsp;</p>\n<p>\n	<strong>Refactoring</strong> - Paying down technical debt, while continuously improving your design&nbsp;</p>\n<p>\n	<strong>Test-Driven Development</strong> - Write the tests first to help improve your design&nbsp;</p>\n<p>\n	<strong>Continuous Integration</strong> - Maintaining a culture of production readiness, and deploying at a moments notice</p>\n', 'Jonathan Rasmusson', 'Project Management', 'Agile', NULL, NULL, NULL),
(280, 'Pluralsight', '2016-01-03', 'Managing Developers', '<p>\n	If you&#39;re having a tough time connecting with the developers on your team, this course can help. This course is targeted at experienced software development managers, developers interested in management opportunities, and non-technical managers leading development teams. The unique perspective of developers, along with the way they think and solve problems, is explored in an easy-to-view narrative.</p>\n', 'Kevin Murray', 'Project Management', 'Management', NULL, NULL, NULL),
(281, 'Lynda', '2015-08-19', 'Office Sway: First Look', '<p>\n	Create and share interactive reports and presentations on the fly with Sway, the new Microsoft Office app. Oliver Schinkten provides your first look at Sway. Learn what it is, where to access it, and how to start building your own Sways presentations, tutorials, newsletters, stories, and more from content you have stored locally or online. Plus, explore how to use Sway&#39;s unique interactive format to collaborate on projects and share them with others.</p>\n', 'Oliver Schinkten', 'Software', NULL, NULL, NULL, NULL),
(284, 'Lynda', '2015-09-18', 'Decision Making Fundamentals', '<p>\n	Learn the art and science of business decision-making from leadership trainer and coach Mike Figliuolo. Mike outlines the four styles of decision making autocratic, participatory, democratic, and consensual and reveals which styles are best suited for specific situations. Recognizing that ambiguity is a part of any decision-making process, Mike covers the four types of ambiguity you&#39;ll face so that you can recognize what you don&#39;t know in order to reduce risk and plan for contingencies. He also presents techniques for involving stakeholders in the decision-making process, and explains how to use a <strong>RACI</strong> (responsible, accountable, consulted, and informed) matrix. Applying these major concepts will help you make better decisions faster, incur less risk, and gain more support for your decisions.</p>\n', 'Mike Figliuolo', 'Project Management', 'Management', NULL, NULL, NULL),
(285, 'Lynda', '2015-10-01', ' Transitioning from Waterfall to Agile Project Management', '<p>\n	If your organization is looking to realize the time, quality, and cost benefits of agile project management, this course is for you. <strong>Agile</strong> expert Kelley O&#39;Connell helps those interested in experimenting with agile understand the difference between traditional waterfall and agile methodologies and what is required for a successful transition between the two. She provides advice on garnering support for a pilot project: by identifying supporters early on and keeping them engaged, while also responding to detractors. She then leads you through the process of choosing the pilot project, selecting the right team, and setting the vision, and provides a short overview of agile basics to you get started. Finally, learn how to perform a retrospective review of the pilot and identify the drivers to continue an agile rollout.</p>\n', 'Kelley O''Connell', 'Project Management', 'Agile', NULL, NULL, NULL),
(286, 'Lynda', '2015-10-02', 'Crisis Communication Fundamentals', '<p>\n	Every organization needs to plan how to communicate internally and externally in the event of a crisis. In this course, business communication expert Laura Bergells walks you through the process of preparing your organization to communicate with employees, customers, suppliers, media, and the public at large. She&#39;ll cover identifying audiences, assembling a crisis response team, crafting an initial statement, and evaluating your response once the crisis has passed.</p>\n', 'Laura Bergells', 'Project Management', 'Leadership', NULL, NULL, NULL),
(287, 'Lynda', '2016-01-04', 'PRINCE2 Fundamentals', '<p>\n	Learn about the fundamental themes and processes of <strong>PRINCE2: PRojects IN Controlled Environments</strong>. PRINCE2 is a process-based approach to project management providing an easily tailored and scalable method for the management of all sizes and types of projects. The method is practiced worldwide, but it is the de facto standard for project management in the UK. Here Claudine Peet reviews the seven themes and principles of PRINCE2 and the seven main processes, from initiation to delivery to closure.</p>\n', 'Claudine Peet', 'Project Management', 'PRINCE2', NULL, NULL, NULL),
(288, 'Lynda', '2016-01-04', 'Agile at Work: Driving Productive Agile Meetings', '<p>\n	Many new agile teams think flexibility in their meetings allows them to do whatever feels right. In reality, agile projects move more smoothly by running short, well structured activities. Each activity is timeboxed, so the teams stay on track and work within a set time and agenda.</p>\n', 'Doug Rose', 'Project Management', 'Agile', NULL, NULL, NULL),
(289, 'Lynda', '2016-01-16', 'Lean Six Sigma Fundamentals', '<p>\n	<strong>Lean Six Sigma </strong>combines the principles of lean enterprise and lean manufacturing with Six Sigma to improve performance and systematically remove waste. Supply chain expert and professor Steven Brown explains the basics of using Lean Six Sigma as a structure for your improvement efforts.</p>\n', 'Steven Brown', 'Project Management', 'Six Sigma', NULL, NULL, NULL),
(290, 'Lynda', '2016-01-16', 'Up and Running with QGIS', '<p>\n	Enrich your <strong>GIS</strong> data and make more effective maps with <strong>QGIS</strong>. Gordon Luckett shows how to get QGIS up and running on your computer and create maps with vector and raster data. Plus, learn how to stylize maps, get more insights from data with overlays and heat maps, and publish results with powerful <strong>Python</strong> driven plugins for QGIS.</p>\n', 'Gordon Luckett', 'Software Development', NULL, NULL, NULL, NULL),
(291, 'Udemy', '2015-09-18', 'Lean Six Sigma Green Belt Training', '<p>\n	This is a complete audio/video course for aspiring Lean Six Sigma Green Belts, and is immensely helpful for anyone interested in learning more about Six Sigma.</p>\n', 'GreyCampus', 'Project Management', 'Six Sigma', NULL, NULL, NULL),
(292, 'Udemy', '2015-09-15', 'Strategic Planning and Execution', '<p>\n	Develop the essential skills for planning and executing strategy and other change initiatives. These skills are guaranteed to increase performance and quality, make your organization a better place to work, and help you become a more successful manager. Learn how to build an innovation community capable of transforming any organisation into a great place to work. This course draws on best practice within world leading organizations to present you with a step by step approach for planning and executing effective change. Class projects will help you practice what you learn. Carefully designed templates will allow you to effortlessly create strategic and operational plans within your own organization.</p>\n', 'David O''Sullivan', 'Project Management', 'Management', NULL, NULL, NULL),
(293, 'Udemy', '2015-09-24', 'Excel Hacking', '<p>\n	I hear excuses and bad approaches when it comes to learning <strong>Excel</strong> all the time. Here&#39;s the truth - Excel is extremely complex and is not an easy thing to master. However, I truly believe that you can hack your way through learning it - that is, know exactly what the most important aspects in Excel are and master them one by one. That&#39;s why I organised this course into so called &quot;Hacks&quot;, so that you can focus on the most important information first and foremost.</p>\n', 'Dragos Stefanescu', 'Project Management', 'Management', NULL, NULL, NULL),
(294, 'Udemy', '2015-09-23', 'Better virtual meetings', '<p>\n	One of the most common situations you are facing when working with a remote team are virtual meetings. This course will help you improve your virtual meetings to be more engaging and more productive.</p>\n', 'Hans Gaertner', 'Project Management', 'Management', NULL, NULL, NULL),
(295, 'Udemy', '2015-09-28', 'Professional Communication Essentials', '<p>\n	This course teaches communication skills for professional audiences in diverse disciplines. It focuses on Web 2.0 communication such as email and web/URL searching, as well as analog communication such as letter writing. To equip students to communicate effectively, this course emphasizes thinking, writing, and information literacy in various electronic environments.</p>\n', 'Brooks Doherty', 'Project Management', NULL, NULL, NULL, NULL),
(296, 'Udemy', '2015-11-23', 'How to Handle Difficult People', '<p>\n	We teach a simple three step model called Flare Care Share. You will learn about the triggers which send you into an emotional state - that&#39;s when you flare up and move towards feelings of violence or silence. We teach you how to avoid entering into a career limiting confrontation or a damaging funk of avoidance and self loathing. This is the care phase.In the share phase, you will learn how to initiate a dialogue in a professional way and hold a conversation which can lead to an improved outcome without animosity. You will be able to effortlessly restore good order and benefit both you and the other person.</p>\n', 'Peter Urey', 'Project Management', 'Management', NULL, NULL, NULL),
(297, 'Udemy', '2015-11-19', 'How to give feedback without giving offence', '<p>\n	This course is about delivering feedback and appraisals which are free from the misunderstanding which arises from making assumptions about what is said.<br />\n	When feedback is supported by the evidence of what you have seen and heard and how it made you think and feel then the recipient is more likely to be able to comprehend and react appropriately.</p>\n', 'Peter Urey', 'Project Management', 'Leadership', NULL, NULL, NULL),
(298, 'Udemy', '2015-11-27', 'Ultimate Influence: The Way Of Superior Leadership', '<p>\n	Superior Leadership Inspires Followers That Genuinely Want To Follow, where Non-Leaders Lead Those Who Believe That They Need To Be Led. Influential Leadership will be recognised in a Leader&#39;s ability to encourage positive action in others and create an environment where everyone has the same opportunity to grow, learn and make more efficient progress in life.</p>\n', 'Kain Ramsay', 'Project Management', 'Leadership', NULL, NULL, NULL),
(299, 'Udemy', '2015-11-25', 'Machiavelli on Power Politics', '<p>\n	Quickly discover Machiavelli&#39;s &quot;The Prince&quot;.</p>\n<p>\n	&quot;The Prince&quot; is a classic text on Leadership - a must read for aspiring CEOs.</p>\n<p>\n	107 pages condensed into about an hour of short video lectures. This is a great use of valuable time for busy people. We correct the old misconceptions about Machiavelli as a voice of evil and focus on his pre-occupation with stability and good order.</p>\n', 'Peter Urey', 'Project Management', 'Leadership', NULL, NULL, NULL),
(300, 'Udemy', '2015-11-30', '7 Scientifically Proven Steps to Increase Your Influence', '<p>\n	I&#39;m going to help you increase your influence. This is a completely new way to think about how you interact with people and the impact you have on those around you.</p>\n', 'Vanessa Van Edwards', 'Project Management', 'Leadership', NULL, NULL, NULL),
(301, 'Udemy', '2015-11-30', 'Art of War by Sun Tzu - the Tao of Leadership', '<p>\n	Situation - you are new to Leadership and you are being introduced to the classic texts on the subject for the first time. Problem - you have got a lot of material to read on the subject but you&#39;ve still got to do your day job. Implications - if you are not very careful you will do a bad job of learning about leadership and your results at work will suffer at the same time. Need - what you need is this course. In about 45 minutes we will describe the key message in the book and the key quotes which you will be expected to know. We cut out all the extraneous material and leave you with the key learnings on leadership. We keep it simple and use 90% video with some written support. You could even just listen to the commentary whilst doing other things. After taking this course you will have a deeper insight into the value of the book in Leadership Development and be able to talk about it with complete confidence.</p>\n', 'Peter Urey', 'Project Management', 'Leadership', NULL, NULL, NULL),
(302, 'Udemy', '2015-12-18', 'Project Management: Deliver on Time + Scrum Project Delivery', '<p>\n	Concise overview of scrum - Including theory, and checklsts for all events, roles, rules and artefacts used to deliver a project.<br />\n	The facts based on real industry experience and research - The correct terminology and use of scrum is essential to mastering it. My experience in industry and research into the topic has been used to give you a solid grounding in the most concise way possible.<br />\n	I give you a complete overview of how to deliver on time with scrum as used in the business work place without having to do a face to face course saving you hundreds if not thousands of dollars.</p>\n', 'Paul Ashun', 'Project Management', 'Agile', NULL, NULL, NULL),
(303, 'Udemy', '2016-02-14', 'An Introduction To Working With Electronic Maps', '<p>\n	This course will introduce you to <strong>Geographic Information Systems (GIS)</strong> and how to work with maps on your computer. The software used in this course is called QGIS and is free and open source. GIS can be used for a wide range of tasks and this course will help you get an idea of how it can be used. Sign up for this extremely easy to follow introductory course.</p>\n<p>\n	The course includes a series of videos that will take you through an introduction on what GIS is, and how to use this type of software.</p>\n', 'Thomas Fagernes', 'Software', NULL, NULL, NULL, NULL),
(304, 'Udemy', '2016-02-14', 'An Overview of Spatial Data and GIS for the DBA', '<p>\n	Managing a spatial database, or as some vendors call it, a geodatabase, requires some insight into spatial data, the collection of the data, different datatypes used to store the data, and the ultimate display of the data. This course is meant to give you more common ground with the <strong>GIS</strong> Professional, to do the best job of managing spatial data as a <strong>DBA</strong>, and see some differences in how spatial data is managed. The philosophy that is presented is that if you know something about the data, you will do a much better job of managing it as a DBA. So, in the introduction, a few examples are given about how spatial data is created.</p>\n', 'Gil Scholl', 'Software', NULL, NULL, NULL, NULL),
(305, 'Udemy', '2016-02-15', 'ITIL Foundation Overview', '<p>\n	This course will provide you a brief overview of the <strong>5 ITIL Service Lifecycle Stages</strong>:</p>\n<ol>\n	<li>\n		<strong>Service Strategy</strong></li>\n	<li>\n		<strong>Service Design</strong></li>\n	<li>\n		<strong>Service Transition</strong></li>\n	<li>\n		<strong>Service Operation</strong></li>\n	<li>\n		<strong>Continual Service Improvement (CSI)</strong></li>\n</ol>\n<p>\n	Scope, objectives and goals of each service lifecycle stage is described briefly. Content and Processes of the Service Lifecycle stages are described.</p>\n<p>\n	<br />\n	By enrolling in this course, you will be able to:</p>\n<ul>\n	<li>\n		Learn the overview of Service Strategy Service Lifecycle</li>\n	<li>\n		Learn the overview of Service Design Service Lifecycle</li>\n	<li>\n		Learn the overview of Service Transition Service Lifecycle</li>\n	<li>\n		Learn the overview of Service Operation Service Lifecycle</li>\n	<li>\n		Learn the overview of Continual Service Improvement Lifecycle</li>\n	<li>\n		Get downloadable handouts and materials during course</li>\n	<li>\n		Get special offer to my other courses</li>\n</ul>\n', 'Resit Gulec', 'Project Management', 'Management', NULL, NULL, NULL),
(306, 'Udemy', '2016-02-15', 'Practical Drupal 8 for the Beginner', '<p>\n	Practical Drupal empowers you to quickly build your own <strong>Drupal 8</strong> site and customize the features and design to create a unique digital experience.</p>\n<p>\n	<br />\n	Drupal 8 basics will deliver the site you desire and adapt with changing technology.</p>\n<p>\n	<br />\n	Discover how the structure of Drupal 8 empowers the site creation experience resulting in an engaging and powerful digital experience.</p>\n<p>\n	<br />\n	Learn how to easily add engaging content then modify it to deliver the experience you want.<br />\n	Recognize the best modules and themes the community has produced to expand your site.<br />\n	Learn the best ways to expand and grow your site with easy to install, pre-existing modules and themes.<br />\n	Discover the timesaving and effective ways to work with team to maintain and grow your site with a high level of security.<br />\n	This course was designed to provide you with the skills to create, maintain and adapt a cutting edge Drupal site. You will master the Drupal interface and be selectively introduced to the technology that runs behind the scenes. As Drupal expands in popularity and the Drupal 8 platform makes deeper connections into other web development technologies the demand for these skills have skyrocketed.</p>\n<p>\n	<br />\n	The journey of mastering the basics of Drupal 8 it will put you in a powerful position. You will have the ability to create, modify and launch world class digital experiences and gain a deep foundational knowledge of how all the pieces work together. Completing this course provides you with the foundation of knowledge that makes it easier for you to master more advanced Drupal functionality and the backend technology that runs everything.</p>\n', 'Learning Services', 'Software Development', NULL, NULL, NULL, NULL),
(307, 'Udemy', '2016-02-16', 'Sharpen Your GIS Skills', '<p>\n	Expand your knowledge of the latest <strong>GIS</strong> tools and how you can take advantage of them.</p>\n<p>\n	<br />\n	Learn about the wealth of data, templates, and other resources available for your projects.</p>\n<p>\n	<br />\n	See examples of how and when to use basic to complex analysis tools to drive better decision making.</p>\n<p>\n	<br />\n	Get ideas for extracting more value and better information from your existing software and data.</p>\n', 'Esri Experts', 'Software', NULL, NULL, NULL, NULL),
(308, 'Udemy', '2016-02-16', 'Practical Presentations Easily and Effortlessy', '<p>\n	This course gives you a basic practical approach to presenting. It supports you to feel comfortable, confident and in control, to present yourself anywhere, anytime, anyplace. This is a series of short videos and worksheets for you to complete. These allow you to practice the physical elements, one at a time, at your own speed and build your confidence easily, taking you to completing a short presentation of your own about you. I offer to review and feedback to you with positive suggestions. This is the foundation to further your desire to bring your passion to the world.</p>\n', 'Linda Woodgate', 'Project Management', 'Leadership', NULL, NULL, NULL),
(309, 'Udemy', '2016-02-16', 'Culture | How to Support Team Culture', '<p>\n	Culture is not so easily defined. We think about culture as the mix of ingredients to get a recipe right. How to support team culture with Learoy Tonight will provide you with the skills and knowledge to understand what drives culture and what you can do to create and foster the one that&#39;s right for you.</p>\n<p>\n	<br />\n	If culture is about a feeling or an atmosphere then how do you create one that has a sense of a team? Whatever your mix, it&#39;s going to come with some sort of diversity; of skillset, ways of thinking, personalities, backgrounds, religions, ways doing things. Whatever it is, your culture should be able to bring them all together to work in some sort of harmony.</p>\n', 'Learoy Tonight', 'Project Management', 'Leadership', NULL, NULL, NULL),
(310, 'Udemy', '2016-02-19', 'How to Run Professional Meetings', '<p>\n	Do you want the meetings you run to have the impact and results you need to improve your business? Ever wonder why you just never get what you want out of your meetings?</p>\n<p>\n	<br />\n	Well in this course you will learn how to run professional business meetings.</p>\n', 'Jimi Okubanjo', 'Project Management', 'Leadership', NULL, NULL, NULL),
(311, 'Udemy', '2016-02-19', 'Practical PHP: Master the Basics and Code Dynamic Websites', '<p>\n	This course is a total beginners guide to coding dynamic websites with PHP so you need no prior knowledge or experience with <strong>PHP</strong> - although, it is a good idea if you know some <strong>HTML</strong> &amp; <strong>CSS</strong>.</p>\n', 'Brad Hussey', 'Web Development', 'Programming Languages', NULL, NULL, NULL),
(312, 'Udemy', '2016-02-21', 'Getting Started with Elasticsearch', '<p>\n	From real-time search and event management to sophisticated analytics and logging at scale, Elasticsearch has a great number of uses. Getting Started with Elasticsearch course will help you learn the basics of Elasticsearch. If you already have a knowledge of Relational Databases and you are eager to learn Elasticsearch, then this course is for you. You will end your journey as a Elasticsearch Padawan.</p>\n', 'Sezin Karli', 'Web Development', NULL, NULL, NULL, NULL),
(313, 'Udemy', '2016-02-21', 'Introducing Automation with Unified Functional Testing/UFT', '<p>\n	UFT tutorial videos and UFT basics have made easy by QAEversity. HP Unified Functional Testing (UFT) does cost a fortune but it&#39;s still a market leader in the automation testing industry. Nowadays, many open source and low-cost automation tools came into play but QTP and UFT are still popular for their advanced features and controls. UFT provides a better control over our automation process and it came up with many advanced and useful features QTP did not have. It is suitable for both people with non-programming and programming backgrounds. UFT supports VB script for customization and better control which is easy to learn. However, it has been difficult to find a end-to-end UFT training solution for basic and advanced UFT features including. It is essential to have UFT skills to be able to gain competitive advantages in today&#39;s market. QAEversity is committed to provide a unique learning experience for delivering UFT training online throughout our award-winning UFT training videos. In this course, we cover all the important aspects of UFT starting from the very basics to the most advanced level concepts. This course treats every student as a freshman and explains each and every single step thoroughly. It can be a great source to brush up a specific topic or master the entire course. Our set of UFT training videos cover basic and advanced topics including, new features in UFT 12.0 and UFT 12.02, new features in UFT, VB scripting, checkpoints, output values, descriptive programming, object repositories, and last but not the least Mainframe/AS400 application automation and Siebel application automation using UFT.</p>\n', 'QAEversity', 'Software Development', NULL, NULL, NULL, NULL),
(314, 'Udemy', '2016-02-21', 'Master Data Management', '<p>\n	This introductory level course provides students with a high level understanding of Master Data Management. Master Data refers to having a single copy of a data record for an organization to ensure that the proper data quality measures are in place. Master data also ensures consistency of reporting across all multiple lines of business within an organization.</p>\n<p>\n	<br />\n	This course highlights key Master Data Management concepts, methodologies, and processes including definitions, examples, common master data challenges, architecture considerations, types of master data projects, the data mastering process, and matching and merging techniques. The course also touches on best practices of master data storage within a repository structure.</p>\n', 'Adastra Academy', 'Software Development', 'Databases', NULL, NULL, NULL),
(315, 'Udemy', '2016-02-21', 'Master Your Mac - 10 Top Yosemite Tips and Tricks', '<p>\n	Learn 10 awesome Yosemite Tips and Tricks</p>\n<p>\n	<br />\n	Learn how to master your mac and be more productive</p>\n<p>\n	<br />\n	Get an exclusive discount on my main Yosemite course</p>\n<p>\n	<br />\n	Wether you&#39;ve just bought a brand new mac or owned one for a while then this is introductory course is for you. This course will show you 10 awesome tip and tricks for OS X Yosemite and give you a taste of what your mac is capable of.</p>\n<p>\n	<br />\n	Your mac not only runs on the most user friendly operating system, it also runs on one of the most sophisticated and feature rich operating systems available to date!</p>\n<p>\n	<br />\n	In this tips and tricks course I have picked 10 awesome features and presented them in an easy to follow format which will show you how to use OS X Yosemite like a pro.</p>\n', 'Simon Says Learn', 'Software', NULL, NULL, NULL, NULL),
(316, 'Udemy', '2016-02-22', 'ServiceNow Kickstart: On-Demand Training for ServiceNow', '<p>\n	This course is what you need to Kickstart your ServiceNow knowledge. This course includes a series of videos that cover various aspects of ServiceNow to get you going with the Basics of ServiceNow Administration and give you an overview of various aspects and features of ServiceNow.</p>\n', 'Shivraj Vichare', '', NULL, NULL, NULL, NULL),
(317, 'Udemy', '2016-02-22', 'Mac Essentials (Intro Course)', '<p>\n	I&#39;m JZ, a former Apple employee of 5 years as an Expert. I&#39;ve helped thousands of people from beginners to pros, discover more amazing things they could be doing on their Apple devices.<br />\n	This course is about uncovering some of the amazing things you can be doing right now on your Mac. You&#39;ll learn a few incredibly useful shortcuts as well as productivity tips and tricks that will surely enhance your Mac experience. These lectures are made up of short and to the point video instructions.</p>\n', 'Mac Stars', 'Software', NULL, NULL, NULL, NULL),
(318, 'Udemy', '2016-02-22', 'Marketing Yourself for Career Success', '<p>\n	In this course, you&rsquo;ll learn how to become a strong and dynamic job search candidate, one who is able to compete in today&rsquo;s competitive job market. This two-week course is full of tools and techniques to help you secure the job of your dreams. You&rsquo;ll cover a wide variety of topics in our course including self-assessment, resume writing, and interviewing techniques. You&rsquo;ll also learn about what to do after the interview, after the job offer, and techniques for career success. I&rsquo;m excited to work with you. Together we will help you discover new strategies to realize your career and life goals.</p>\n', 'Helene Lamarre', 'Personal', NULL, NULL, NULL, NULL),
(319, 'Udemy', '2016-02-22', 'Handling Strong Emotions in the Workplace', '<p>\n	The purpose of this lesson is to review and strengthen your knowledge of how you can apply primary factors to address and manage strong emotions at work. The lesson will give you anytime access to the fundamental skills and concepts of the course.</p>\n', 'Ms. Dawn Tedesco', 'Project Management', 'Leadership', NULL, NULL, NULL),
(320, 'Udemy', '2016-02-23', 'SAP BusinessObjects Business Intelligence - An Introduction', '<p>\n	In this course, we will Install <strong>SAP BusinessObjects</strong> programs, namely <strong>Information Design Tool (IDT) </strong>and <strong>Web Intelligence (WebI)</strong> - for free.<br />\n	We will create a sample database in <strong>Access 2010</strong> (although you may already have your own database that you want to use), and then create a database connection to it.</p>\n<p>\n	<br />\n	We will then create a &quot;<em>universe</em>&quot; in IDT, with a database Relational Connection, Data Foundation and Business Layer.</p>\n<p>\n	<br />\n	We will then export this universe from IDT and open it in WebI.</p>\n<p>\n	<br />\n	We will then create some tables and graphs.</p>\n', 'Phillip Burton', 'Project Management', 'Management', NULL, NULL, NULL),
(321, 'Udemy', '2016-02-24', 'Big Data in Cloud for E-Commerce companies', '<p>\n	Welcome to this course on Big Data&#39;s percolation into E-commerce: How Big Data in Cloud can be an added advantage. This course is targeted towards the tech enthusiasts who are willing to keep themselves updated in the technology space. At the end of this course, we aim to help the students Get an understanding of the practical implications of implementing Big Data projects in E-Commerce companies; Get a fair level knowledge on what is Big Data and how it evolved; Spot some of the latest updates in Big Data; Understand the level of maturity attained by Cloud Computing; Derive a high level knowledge on how cloud environment is favourable for implementing Big Data projects; Study some business drivers that is motivating firms to move into the Data-Cloud models.</p>\n', 'James Alwyn Durai Xavier', 'Software Development', 'Databases', NULL, NULL, NULL),
(322, 'Udemy', '2016-02-24', 'Office 365 - Basics of Microsoft''s Cloud Service', '<p>\n	&quot;Office 365&quot; is the way of the future in Information Technology (IT).<br />\n	You should take this course as an introduction to Cloud Computing. It&#39;s also used as the foundation to all of my courses on Office 365.<br />\n	For this course you don&#39;t need to have any type of computer or software.<br />\n	We will cover the basic principle of this Cloud Service developed by Microsoft.</p>\n', 'Robert Mira', 'Project Management', 'Management', NULL, NULL, NULL),
(323, 'Udemy', '2016-02-24', 'Agile Management: The art of servant leadership', '<p>\n	Great leaders aren&rsquo;t born, they&#39;re grown. They cultivate their own skills over time. Become a great leader with this course!<br />\n	The best leaders magnify their team&rsquo;s productivity. They inspire their teams to always be better, always be learning, and always solve issues before they become problems. They cultivate collaboration, not competitiveness. They help everyone combine their diverse talents and skills into innovative solutions and better products.</p>\n', 'Karen Greaves, Samantha Laing', 'Project Management', 'Agile', NULL, NULL, NULL),
(324, 'Udemy', '2016-02-25', 'Scrum Case Studies: Confessions of a Scrum Master', '<p>\n	Short Stories / Case Studies based on real industry experience and research - The correct methods for improvement and dealing with difficult situations is essential to mastering agile scrum. My experience in industry and research into the topic has been used to give you a solid grounding in the most concise way possible.</p>\n<p>\n	<br />\n	Expert Knowledge - I give you a complete overview of how I dealt with difficult situations on the job and techniques used in the business work place without having to do a face to face course saving you hundreds if not thousands of dollars.</p>\n<p>\n	<br />\n	Concise overview of agile scrum - Including the way that the scrum framework is used to deliver projects in industry.</p>\n', 'Paul Ashun', 'Project Management', 'Agile', NULL, NULL, NULL),
(325, 'Udemy', '2016-02-25', 'Scrum Advanced: Software Development and Program Management', '<p>\n	Complete, Concise, Confident Overview of advanced scrum techniques - I cover the theory and give you examples of how the theory is used in industry.</p>\n<p>\n	<br />\n	Confidence in using advanced scrum techniques - In a very simple way, I teach you the fundamentals of the scrum of scrums program management technique and how to influence and coach others with solid explanations of scrum in industry without going into a class room or spending $&pound;1000.</p>\n<p>\n	<br />\n	You get to ask me questions and see me respond to every single one of them thoughtfully!</p>\n', 'Paul Ashun', 'Project Management', 'Agile', NULL, NULL, NULL),
(326, 'Udemy', '2016-02-25', 'Getting Started with Kanban for Software Development', '<p>\n	With growing volatility in business environment, software development process has to be responsive enough to ensure that it enables the business agility rather than becoming a bottle neck. The fast adaption of agile based processes shows that software development groups are responding to the need of business. Most of the recent surveys show growing adaption of Kanban processes and in this program you will learn how to apply Kanban for solving your software development problems.</p>\n<p>\n	<br />\n	This program first looks at the problem we face in software development and then gets into the details of how Kanban can solve them, in the process, one gets introduced to Kanban principles and understand how they work in real project environment.</p>\n', 'iZenBridge Consultancy', 'Project Management', 'Agile', NULL, NULL, NULL),
(327, 'Udemy', '2016-02-26', 'Introduction to Project Management', '<p>\n	Even wondered how big companies choose their Project Managers? In this course, you will be introduced to eye-opening concepts of Project Management. This course will help you understand why some projects fail, and why others succeed, and you will be able to identify project management life cycle and processes as well as organizational influences.</p>\n', 'Bayhas Al Sawady', 'Project Management', NULL, NULL, NULL, NULL),
(328, 'Udemy', '2016-02-26', 'PMP Stakeholder Management', '<p>\n	Stakeholder management is critical to the success of every project in every organization,By engaging the right people in the right way in your project, you can make a big difference to its success... and to your career.</p>\n<p>\n	<br />\n	Having conducted a Stakeholder Analysis exercise, you will have most of the information you need to plan how to manage communication with your stakeholders.</p>\n<p>\n	<br />\n	You will have identified the stakeholders in your job and in your projects, and will have marked out their positions on a stakeholder map.<br />\n	The next stage is to plan your communication so that you can win them around to support your projects. Stakeholder Planning is the process by which you do this.</p>\n', 'Manager IT Arshad', 'Project Management', 'Management', NULL, NULL, NULL),
(329, 'Udemy', '2016-02-26', 'Outsourcing and Remote Teams - Getting Started', '<p>\n	Overcome the challenges of finding, hiring and inducting overseas employees<br />\n	Create the team culture you need to work towards success<br />\n	Avoid the challenges of communication problems<br />\n	Create a relationship of trust between yourself and remote workers<br />\n	The systems you need to use to get started and effective</p>\n', 'Adam Maddison', 'Project Management', 'Management', NULL, NULL, NULL),
(330, 'Udemy', '2016-02-26', 'Skype for Business (Microsoft Lync 2010)', '<p>\n	Learn how to connect with co-workers throughout the office, or colleagues around the world, while on your mobile device or at your desktop. Instant Message a colleague to ask a quick question, conduct a video conference call, or engage in a spontaneous brainstorm meeting with team members using PowerPoint, virtual white boards and desktop sharing, Lync does it all!</p>\n', 'SONIC', 'Project Management', 'Management', NULL, NULL, NULL),
(331, 'Udemy', '2016-02-26', 'The Complete Guide to Microsoft Outlook 2013', '<p>\n	The Complete Guide to Microsoft&reg; Outlook 2013<br />\n	With this comprehensive, performance-based certification preparation online program, you can build and validate your business computer skills using Microsoft Outlook 2013 software. You&#39;ll cover basic through advanced topics. Upon completion, you&#39;ll be prepared to earn your certification and gain an important edge in today&#39;s competitive job market.</p>\n', 'Elizabeth Nofs', 'Project Management', 'Leadership', NULL, NULL, NULL),
(332, 'Udemy', '2016-02-26', 'Installing Symfony', '<p>\n	In this tutorial you will learn how to set up easily your Mac, Linux or Windows development environment for Symfony.<br />\n	You will learn to:<br />\n	- Install PHP<br />\n	- Prepare the Symfony coding standards<br />\n	- Create a project<br />\n	- Configure the PhpStorm IDE<br />\n	- Start the web server</p>\n', 'David Morales', 'Software Development', NULL, NULL, NULL, NULL),
(333, 'Udemy', '2016-02-27', 'Optimising People Performance in your team/organisation!', '<p>\n	This leading edge course is designed to provide you with practical, hands-on knowledge and tools for any business or organisation to achieve competitive advantage. It focuses on optimising your only true source of competitive advantage - the people!<br />\n	Designed and facilitated in an easy to watch style, it includes examples, tips, worksheets and exercises to customise the learning for your particular team or organisation or group.</p>\n<p>\n	<br />\n	The course consists of lecture videos and support materials such as worksheets, assessments and guides which will assist you step by step to achieve new levels of performance and results for your team and/or organisation.</p>\n<p>\n	<br />\n	The facilitator has over thirty years of global experience in implementing performance enhancing initiatives in many varied industries. His style includes many examples of his personal experience to illustrate important learning points.</p>\n<p>\n	<br />\n	The world of the 21st century consists of a complex and rapidly changing environment. Leaders of groups, teams, departments and organisations need to remain at the forefront of leading edge thinking in order to survive and remain competitive. This course will provide you with powerful insights, tools and techniques.</p>\n', 'Dave Woods', 'Project Management', 'Leadership', NULL, NULL, NULL),
(334, 'Udemy', '2016-02-27', 'Job Interview Skills Training Course', '<p>\n	Master your interviewing skills with this comprehensive course from TeachUcomp, Inc. Mastering Your Interview Made Easy features 33 video lessons. Watch, listen and learn as your expert instructor guides you through each lesson step-by-step. During this media-rich learning experience, you will see each lesson just as if your instructor were there with you. You will learn what to do before your interview is scheduled, specific interviewing techniques such as mirroring and body language and you will have the opportunity to practice the most common interview questions and much more. Whether you are completely new to the job market, re-entering the workforce or looking to advance your career, this course will empower you with the knowledge and skills necessary to dazzle during your next interview. We have incorporated years of classroom training experience and teaching techniques to develop an easy-to-use course that you can customize to meet your personal learning needs.</p>\n', 'TeachUcomp, Inc.', 'Personal', NULL, NULL, NULL, NULL),
(335, 'Udemy', '2016-02-28', 'Get Hired! Answer The Toughest Job Interview Questions', '<p>\n	Learn what to include and what to avoid in your answer when you prepare the answers to the toughest common interview questions.<br />\n	Become confident and ready to answer the most common interview questions asked during any job interview using the points and tips presented in this course.<br />\n	Get Ready for a Job Interview<br />\n	Learn what to expect<br />\n	Learn how to answer the most common interview questions<br />\n	Become more confident during any job interview</p>\n', 'Florentin Leo', 'Personal', NULL, NULL, NULL, NULL),
(336, 'Udemy', '2016-02-28', 'Learn the Truth About Agile versus Waterfall', '<p>\n	Learn to see Agile and traditional plan-driven project management principles and practices in a fresh new perspective as complementary to each other rather than competitive in order to get the best of these two worlds!</p>\n<p>\n	<br />\n	Many businesses and project managers are faced with a choice of choosing a traditional plan-driven approach (or what is sometimes called &ldquo;Waterfall&quot;) or a more Agile approach for critical projects which can be a very important decision with significant business impact but there are many stereotypes and misconceptions that exist about both &ldquo;Agile&quot; and &ldquo;Waterfall&quot; that can be very confusing and misleading. Many people see this as a binary and mutually-exclusive choice between two extremes and attempt to force-fit projects to one of these two approaches when the right solution is to go in the other direction and fit the approach to the project.</p>\n', 'Chuck Cobb', 'Project Management', 'Agile', NULL, NULL, NULL),
(337, 'Udemy', '2016-02-28', 'Basics of Scrum, Agile and Project Delivery', '<p>\n	&#39;Introduction to Scrum&#39; course is tailored to help anyone interested to know more about Scrum; learn about key concepts in Scrum as defined in the SBOK&trade; Guide; and to get a basic understanding of how Scrum framework works in delivering successful projects.</p>\n', 'SCRUMstudy ', 'Project Management', 'Agile', NULL, NULL, NULL),
(338, 'Udemy', '2016-02-29', 'Building a Website with Drupal', '<p>\n	Building a Website with Drupal is aimed at those with web designer skills wishing to learn how to use Drupal to build sites. Beginning with a tour of the Drupal site, the attention shifts to establishing a web test server that is setup to house the prototype. Various customization topics are covered for content types, menus, and views. Building a custom theme without writing any PHP is covered next. The final steps of this course include prep work for migration to an actual web server.</p>\n<p>\n	<br />\n	Surmount the initial learning curve associated with building sites using Drupal by studying how a community site is put together.</p>\n', 'Packt Publishing', 'Web Development', NULL, NULL, NULL, NULL),
(339, 'Udemy', '2016-02-29', 'Excel: 2015 to 2016 Edition', '<p>\n	Excel is a complex software that doesn&#39;t have to be! This course teaches the basics of Excel&#39;s interface in easy to understand tutorials. Perfect for all finance and accounting students, or those who want to manage a mailing list. The lectures are divided into 5 parts and made easy to follow, with high quality videos as well as HD sound. When done with the course you should know the fairly basics, such as: setting up pivot tables, the sum button, Excel&#39;s interface, entering data, etc. I promise this is one of the most introductory, yet organized Excel courses you can take.</p>\n', 'Rucha Prabhune', 'Project Management', 'Management', NULL, NULL, NULL),
(340, 'Udemy', '2016-02-29', 'Product Management 101', '<p>\n	Product Management 101 is an overview of the work of product management - from market intelligence and strategy to new product development. The course has been designed for product managers with 0-5 years of experience, and through a series of lectures we will share industry best practices that span the spectrum of product management work. We will follow this later with Product Management 102, which will focus on lifecycle management, i.e. managing an in-market product or service.</p>\n', 'Product Management', 'Project Management', 'Management', NULL, NULL, NULL),
(341, 'Udemy', '2016-03-01', 'Drupal 7 Module Development', '<p>\n	In this course you will learn to build a Drupal custom module by completing short tasks and ultimately weave the tasks together to get a completed and fully functional module. Drupal 7 Module Development introduces you to module development by understanding the essential hooks and functions, building tables and querying the Drupal database, exploring module security, performance and how our module interacts with Drupal core and contributed modules. Each video walks you through essential Drupal functions and demonstrates how to use these functions in a module that we build hands-on together Drupal 7 Module Development starts by showing you how to set up your local development environment to support custom module development. You will learn how to use the best tools and configure them. Next you will learn to configure a Feeds importer to import content into your site that you will then leverage with your custom module and write a menu callback using hook_menu and hook_permissions. We will then look at the form API and write a hook_form_alter function and create a .install file and build a db schema function to create a table in our database Finally we create a block using our module and theme the block. We end the course by reviewing our module from a security and performance standpoint. From the local development to the review of security we build a custom module step-by-step throughout the course&rsquo;s short videos.</p>\n', 'Packt Publishing', 'Web Development', NULL, NULL, NULL, NULL),
(342, 'Udemy', '2016-03-01', 'An Introduction to Neuroscience for Coaches', '<p>\n	The world of Coaching is changing. Expectations are higher and Coaches are stepping up to equip themselves with the latest research that enables them to serve their clients.</p>\n<p>\n	<br />\n	Neuroscience is one field that is providing a valuable source of practically applicable information. With over 5000 studies being published every month there is a lot of jargon heavy research to work though.</p>\n<p>\n	<br />\n	Amy Brann ploughs through these resources bringing the most relevant to you as a Coach. This introduction is designed to give you a flavour of what neuroscience can give you.</p>\n', 'Amy Brann', 'Project Management', 'Leadership', NULL, NULL, NULL),
(343, 'Udemy', '2016-03-01', 'The Neuroscience of Reframing and How to Do It', '<p>\n	Reframing should be in the water we drink, scientists say. Reframing is the ability to change your perspective deliberately. But why is it praised like that? What happens in the brain when you reframe? What are the inner and outer effects? And how do you do it?</p>\n', 'Anette Prehn', 'Project Management', 'Leadership', NULL, NULL, NULL);
INSERT INTO `wd_course` (`id`, `institute`, `when_date`, `title`, `desc`, `lecturer`, `section`, `group`, `award`, `award_url`, `url`) VALUES
(344, 'Udemy', '2016-03-01', 'Meet your brain: a short introduction to neuroscience', '<p>\n	The NBA (or Neurocognitive and Behavioral Approach) is a fascinating, innovative and multi-disciplinary approach born out of 25 years of scientific research. Discover how 4 brain structures are responsible for all of our decisions and internal conflicts.</p>\n', 'Gregory Caremans', 'Project Management', 'Leadership', NULL, NULL, NULL),
(345, 'Udemy', '2016-03-02', 'SEO Introduction from an ex-Googler', '<p>\n	Google Search ranking plays a major role in getting free organic traffic to your website. However, Google&#39;s rules change very frequently, and website owners, marketers are always confused on what they need to do to get their website on the top of the Google Search Results.</p>\n<p>\n	<br />\n	While no one can (and should) guarantee a good ranking, following some best practices will help you with a better chance of getting higher search ranking and hence more free traffic from Google Search. These are genuine tips that are prescribed by Google and hence everyone website owner and marketer should know about them.</p>\n<p>\n	<br />\n	Also, there are so many misconceptions about what matters for SEO that I have seen some very good site get in the trap of bad SEOs (called Black Hat SEOs) which get their site in trouble. Once your site has been blacklisted, it is very difficult to get it back up the ranking, and sometimes, get it in the search rankings itself. Hence fully understanding the implication of their SEO efforts is very important.</p>\n<p>\n	<br />\n	This is an attempt to educate the common users about SEO and the best practices one should follow. I have tried to keep away from heavy jargons and explain the basics in a manner that everyone can understand and appreciate.</p>\n', 'Amitabh Verma', 'Web Development', NULL, NULL, NULL, NULL),
(346, 'Udemy', '2016-03-02', 'MongoDB Essentials - Understand the Basics of MongoDB', '<p>\n	This is a beginners level course to understanding the basics of what mongoDB is.</p>\n<p>\n	<br />\n	The intention of this course is to provide a foundational level knowledge of mongoDB so that you can start developing applications that require a database storage.</p>\n', 'Patrick Schroeder', 'Web Development', 'Databases', NULL, NULL, NULL),
(347, 'Udemy', '2016-03-02', 'Understanding Data Quality and Reference Data Management', '<p>\n	The Data Management overview course is a free, high-level course that covers two challenging data related issues that face organizations in the modern day:</p>\n<p>\n	<br />\n	Reference Data Management<br />\n	Data Quality Management.</p>\n<p>\n	<br />\n	The Reference Data Management overview highlights the key principles and processes for effective reference data management within organizations. The lectures cover Reference Data and Reference Data Management components in order to provide an overall understanding of key concepts and terminologies. The course also provides insight on Reference Data challenges, benefits of a Reference Data Management solution, best practices in implementation, and typical solution architecture.</p>\n<p>\n	<br />\n	The Data Quality Management overview provides an overall understanding of key Data Quality Management concepts, methodologies and terminologies including profiling, data quality metrics, and stewardship responsibilities. Upon completion of this course, students will gain insights into key data quality activities such as, parsing, validation, standardization, cleansing, enrichment, scoring, measurement, and exception management.</p>\n', 'Adastra Academy', 'Software Development', 'Databases', NULL, NULL, NULL),
(348, 'Udemy', '2016-03-02', 'Learn AngularJS Step By Step', '<p>\n	i want to teach intermediate angular JS to developers who have basic knowledgeapplication development and want to be able to use Angular javascript at client side effectively in business applications.<br />\n	<br />\n	This course is covering some of the important Angular JS concepts with practical codes and most of useful directives and services are covered in this. We have also covered Angular JS routing with Single Page Application in last section of this series.<br />\n	<br />\n	I have used Visual Studio 2013 in this Course because it support full intellisense but when learners wants to do this they can use any tool they are comfortable and i am sure all codes will work as it is.<br />\n	&nbsp;</p>\n', 'Maruti Makwana', 'Web Development', NULL, NULL, NULL, NULL),
(349, 'Udemy', '2016-03-02', 'Learn Angular JS for Beginners - Lite', '<p>\n	This class was created to assist one in understanding the basic principles of AngularJS in a methodical and fast manner. It extends the scope of HTML with new and added topics, making it a more comprehensive and easily understandable lesson that can produce straightforward results, since HTML was never designed to be for the masses. AngularJS can be tricky to understand, therefore learning it can be daunting. Every attribute of it can be changed depending on the conditions.</p>\n', 'EDUmobile Academy', 'Web Development', NULL, NULL, NULL, NULL),
(350, 'Udemy', '2016-03-03', 'Quickstart AngularJS', '<p>\n	AngularJS doesn&#39;t have to be hard to learn. Its concepts are bit difficult to grasp at start. This course will not only teaches you how to make applications in AngularJS, but how to start, plan, design and develop an application. How to structure your application into three different components of MVC: Model, View and Controllers. How to code these components using AngularJS. The analysis used to make an application can be used for developing application in any other frameworks like Backbone and Ember.</p>\n<p>\n	<br />\n	While making the application called BooKart, you will learn:</p>\n<ol>\n	<li>\n		How to design, plan and develop your application using MVC</li>\n	<li>\n		Data Binding to update views automatically</li>\n	<li>\n		Moving data to scope &amp; business logic to controllers</li>\n	<li>\n		Organizing your code using Modules</li>\n	<li>\n		Create Single page application (SPA) using Routing</li>\n	<li>\n		Dependency Injection to organize your code into small reusable objects</li>\n	<li>\n		Directives to teach new syntax to HTML and filters for formatting data</li>\n	<li>\n		Apply animations to different parts of the application</li>\n</ol>\n', 'Sandip Gautam', 'Web Development', NULL, NULL, NULL, NULL),
(351, 'Udemy', '2016-03-03', 'Hit the ground running with AngularJS with Dion Yang', '<p>\n	If you want to cut through the indirect crap and just go head first into building an AngularJS app then this course will take you there.<br />\n	Hit the ground running with AngularJS is broken down into 12 modules with each module ending with a real world application exercise.</p>\n', 'Dion Yang', 'Web Development', NULL, NULL, NULL, NULL),
(352, 'Udemy', '2016-03-03', 'Angular 2 Fundamentals', '<p>\n	In this course, we&#39;re going to be covering the fundamentals of Angular 2 to get you up &amp; running as fast as possible.<br />\n	Angular 2 is one of the best frameworks out there for building cutting-edge web applications.<br />\n	Have you ever wanted to become a more all-around developer? Being able to develop mobile &amp; web applications as well?<br />\n	Angular 2 is perfect for you. It&#39;s an incredibly fast, light-weight &amp; easy-to-use framework that you won&#39;t regret learning what so ever.</p>\n', 'Nick Kenens', 'Web Development', NULL, NULL, NULL, NULL),
(353, 'Udemy', '2016-03-03', 'Bug Tracking with Jira: Jira for Software/QA Testers', '<p>\n	Quality Assurance is a must need in today&#39;s era of technology. Meeting the expected quality of an application has become an essential factor for organizations. This is where software development and software testing concepts come into play. Organizations need to follow certain quality assurance standards in order to survive in the market competition. It is must required to understand software development life cycle before executing software testing concepts. We often ignore software testing fundamentals and manual testing concepts which is hugely harmful. IT professionals can never reach the expected level of success without a strong foundation in software development and software testing concepts. Also, it has not been easy to find project oriented and real-time training in software testing fundamentals. However, we all need to learn the basics of quality assurance and testing before jumping into any sort of automation. In this course, we took a hands-on and step by step approach to make it easier for IT professionals to master software testing core concepts. This course includes basic and advanced QA training videos with practical examples of different aspects of testing including software development life cycle (SDLC), overview of specific roles and real-time work environment for a software tester, different types of testing, creating comprehensive test plans, and test cases.</p>\n<p>\n	<br />\n	JIRA is the tracker for teams planning and building great products. Thousands of teams choose JIRA to capture and organize issues, assign work, and follow team activity. At your desk or on the go with the new mobile interface, JIRA helps your team get the job done (Atlassian&#39;s site)</p>\n', 'QAEversity', 'Project Management', NULL, NULL, NULL, NULL),
(354, 'Udemy', '2016-03-04', 'User Stories for Agile Scrum+Product Owner+Business Analysis', '<p>\n	A User Story is the description of a product feature or requirement from from a user&#39;s perspective. Based on my experience, it is the simplest way to capture requirements which focus on adding value and help businesses to deliver early return on investment!</p>\n', 'Paul Ashun', 'Project Management', 'Agile', NULL, NULL, NULL),
(355, 'Udemy', '2016-03-04', 'Agile Scrum Training+Scrum Certification Prep.', '<p>\n	Concise overview of Scrum - The exact events, roles, rules and artefacts used to deliver a project using scrum along with the history of Scrum. This includes lectures on the fundamentals of Sprint Planning, The Daily Scrum, Sprint Review, Sprint Retrospective, Scrum Artefacts and more.<br />\n	The facts based on the Scrum Guide - The correct terminology and use of Scrum is essential to mastering it. The Scrum Guide is the rule book on Scrum and many do not use it or know it.<br />\n	Scrum Certification Preparation - A summary of frequently asked questions (FAQs) and frequently misunderstood points around Scrum that have been in past Open Assessment exams.<br />\n	Scrum Certification - I then tell you how to prepare for Scrum Certification and how to sit it online saving you hundreds if not thousands of dollars.<br />\n	The course is video based with no supporting document necessary. I go through key gotchas from the scrum guide.</p>\n', 'Paul Ashun', 'Project Management', 'Agile', NULL, NULL, NULL),
(356, 'Udemy', '2016-03-04', 'Master Public Speaking: Presenting Like a Pro', '<p>\n	Master Public Speaking: Presenting Like a Pro is an enjoyable and practical guide to public speaking mastery, focusing less on technical terms and more on practical application and optimising mindset. The course offers more than the basic tips for presenting successfully with confidence and ease, instead using four key principles as a hinge that connects speaking skills with genuine audience engagement.</p>\n', 'Becky Shortt', 'Project Management', 'Management', NULL, NULL, NULL),
(357, 'Udemy', '2016-03-04', 'Kanban: Productivity &amp; Efficiency for Agile Lean Project', '<p>\n	Kanban is a method for just in time delivery of tasks (such as products services, support and maintenance) without overloading our workforce . Based on my experience, it is the most popular way to meet just in time delivery for a lean businesses while increasing efficiency.</p>\n', 'Paul Ashun', 'Project Management', 'Agile', NULL, NULL, NULL),
(358, 'Udemy', '2016-03-04', 'The Beginners Guide To Using Wufoo Forms', '<p>\n	In this Create Online Forms course you will learn how to use free online forms to create surveys which you can use to gather useful information from fans, subscribers, and visitors, that you can then use to market more effectively too. You can also use this tool to begin to build your own email list.</p>\n', 'Greg Jeffries', 'Web Development', NULL, NULL, NULL, NULL),
(359, 'Udemy', '2016-03-05', 'Free Lean Six Sigma Primer', '<p>\n	If you always wanted to learn Lean Six Sigma, but wasn&#39;t sure how it will help you in profession, this is your opportunity. It&#39;s a free course and meant to share actionable knowledge on Lean Six Sigma principle and concepts.</p>\n<p>\n	<br />\n	You will be able to relate Lean Six Sigma concepts to any give scenario at work, society or home.</p>\n<p>\n	<br />\n	You will be able to decide on the relevance of Lean Six Sigma to your profession and industry, as well as decide what level of certification is needed.</p>\n', 'Nilakantasrinivasan Janakiraman', 'Project Management', 'Six Sigma', NULL, NULL, NULL),
(360, 'Udemy', '2016-03-05', 'Hiring &amp; Managing Performance to Build a Great Team', '<p>\n	If you are a busy entrepreneur or professional, you will benefit from these easy steps to optimize your time managing employees and getting the best out of your people. It is typical for small business owners to assume that they have hired the wrong person when in reality the issue is employee management. This course will provide you with insights that will benefit your hiring process as much as your employee management skills.</p>\n<p>\n	&nbsp;</p>\n<ul>\n	<li>\n		Learn effective hiring strategies</li>\n	<li>\n		Learn powerful insights of the hiring process</li>\n	<li>\n		Understand how to prepare and deal with new employees</li>\n	<li>\n		Learn how to create clear expectations and assess performance</li>\n	<li>\n		Learn how to do a performance review</li>\n</ul>\n', 'Success Skills', 'Project Management', 'Management', NULL, NULL, NULL),
(361, 'Udemy', '2016-03-05', 'How To Make A Great First Impression', '<p>\n	In this course, you are given the 4 keys to creating a great first impression.<br />\n	how to give and hold eye contact and why it is CRITICAL<br />\n	Why the smile is the quickest way to get rapport<br />\n	how in certain countries the handshake is key and how to deliver a great handshake to avoid losing rapport<br />\n	what to say next and how to introduce yourself to make a great first impression at interviews and events<br />\n	This course gives you the skills and confidence to make an great first impression every time.As you gain in confidence you will read other peoples body language with ease to enable you to communicate more effectively with almost anybody, anywhere, anytime.</p>\n', 'David Hyner', 'Personal', NULL, NULL, NULL, NULL),
(362, 'Udemy', '2016-03-05', 'Data Visualization Essentials for Presentations: Intro', '<p>\n	This is an introduction to the &quot;Data Visualization Essentials for High-Impact Presentations&quot; course that will be released in the near future. This introduction course features detailed lectures on data essentials, pie charts, bar charts, and the best ways to properly display text -- all within the mindset of an individual presenting business data for a group of users.</p>\n<p>\n	<br />\n	This course was designed using Microsoft Excel 2007 and virtually every aspect covered in the videos remains relevant to newer versions.<br />\n	After finishing this course you will have a greater understanding of the visualization techniques used by the best in the industry. Data Visualization is not hard, and after completing this course you will have a working knowledge to help you format and prepare professional business presentations.</p>\n', 'Erik Baker', 'Project Management', 'Management', NULL, NULL, NULL),
(363, 'Udemy', '2016-03-05', 'Develop Database Application Without Manual Coding -Tremplin', '<p>\n	Coding an Application is not everyone&#39;s cup of tea.</p>\n<p>\n	<br />\n	Using Tremplin you can develop a Database Application without manual Coding.</p>\n<p>\n	<br />\n	You just need to know about preparing Database and SQL</p>\n<p>\n	<br />\n	If you feel developing database applications take a lot of time, not to worry you are in right place.</p>\n<p>\n	<br />\n	This tutorial will help you understand about how to create a simple database and develop a database application without manual coding.</p>\n', 'Krishna Kamath', 'Software Development', NULL, NULL, NULL, NULL),
(364, 'Udemy', '2016-03-05', 'Big Data and Hadoop Essentials', '<p>\n	Are you interested in the world of Big data technologies, but find it a little cryptic and see the whole thing as a big puzzle.</p>\n<p>\n	<br />\n	Are you looking to understand how Big Data impact large and small business and people like you and me?</p>\n<p>\n	<br />\n	Do you feel many people talk about Big Data and Hadoop, and even do not know the basics like history of Hadoop, major players and vendors of Hadoop. Then this is the course just for you!</p>\n<p>\n	<br />\n	This course builds a essential fundamental understanding of Big Data problems and Hadoop as a solution. This course takes you through:</p>\n<ol>\n	<li>\n		Understanding of Big Data problems with easy to understand examples.</li>\n	<li>\n		History and advent of Hadoop right from when Hadoop wasn&rsquo;t even named Hadoop.</li>\n	<li>\n		What is Hadoop Magic which makes it so unique and powerful.</li>\n	<li>\n		Understanding the difference between Data science and data engineering, which is one of the big confusions in selecting a carrier or understanding a job role.</li>\n	<li>\n		And most importantly, demystifying Hadoop vendors like Cloudera, MapR and Hortonworks by understanding about them.</li>\n</ol>\n<p>\n	Unlock the world of Big Data!!!</p>\n', 'Nitesh Jain', 'Software Development', 'Databases', NULL, NULL, NULL),
(365, 'Udemy', '2016-03-05', 'Learn Power BI Basics for Free', '<p>\n	Learn Power BI Basics for Free !<br />\n	Power BI transforms your company&#39;s data into rich visuals for you to collect and organize so you can focus on what matters to you. Stay in the know, spot trends as they happen, and push your business further.<br />\n	Let us help you bring your data to life !</p>\n', 'Vishal Pawar', 'Software Development', 'Databases', NULL, NULL, NULL),
(366, 'Udemy', '2016-03-05', 'Stairway to Scala - Setup Instructions', '<p>\n	This course will provide you with instructions to be ready to follow the Stairway to Scala Applied and Advanced courses, in particular being able to run activator, Scala and a suitable Scala IDE such as IntelliJ IDEA.<br />\n	The course includes reference slides and an example exercise project to test that your environment is working.<br />\n	The course will take less than an hour to complete.<br />\n	If you are interested in getting a working Scala development environment, or are taking the Stairway to Scala Applied or Advanced courses, this setup course is for you.</p>\n', 'Dick Wall', 'Software Development', NULL, NULL, NULL, NULL),
(367, 'Udemy', '2016-03-06', '2015 Tech - Chrome Extensions', '<p>\n	During this Chrome Extensions video training course, you will review some popular and useful Extensions. Browser extensions can add a great deal of functionality to a browser. Because Google allows anyone to easily post an Extension in the Google store, there are a great number and variety of extensions. Google does review and scan extensions for viruses and malware before they&#39;re listed in the Google store.</p>\n', 'Tom Lahey', 'Web Development', NULL, NULL, NULL, NULL),
(368, 'Udemy', '2016-03-06', 'Excel 2013 Tips In 32 Minutes', '<p>\n	In This Excel-Tips Based Course , You Will Learn Greatest And Most Hidden Secrets .<br />\n	Secrets that has been used by professionals over the years and well-guarded.</p>\n<p>\n	<br />\n	You Need to already be familiar with excel if you are going to take this course .</p>\n<p>\n	<br />\n	I will be showing you various ways in which you can accelerate your work with excel 2013 , cool hidden features , and ways to maximize your productivity.</p>\n<p>\n	<br />\n	We Will Be Looking at tips that will help you work faster and more efficiently.<br />\n	This course will aim at spilling the beans on Microsoft Excel 2013 and will include all important tips that you should know before you even continue with excel !</p>\n', 'Everyday Solutions', 'Project Management', 'Management', NULL, NULL, NULL),
(369, 'Udemy', '2016-03-06', 'Introduction to Digital Payments', '<p>\n	Do you want to transition your career into the payments industry? Have you just started a project in the payments space? Are you looking for a concise overview on payments terminology, methods, key industry players, and emerging trends? This is an exciting time in the global payments industry with innovation in online and offline payment technology. Consumers are starting to understand the advantage of using mobile devices for payments, rather than transacting in cash and credit cards. Innovative startups and established Financial Services players are offering fantastic career opportunities in the payments space. In addition to rapidly evolving technology, complex regulations make it difficult to enter the payments space. For example, Dodd Frank establishes a new regulatory framework for cross-border payments. If you manage projects in the in payments space you must have a fundamental knowledge of the regulatory environment. The course will cover the following topics:<br />\n	Payments Terminology and Acronyms such as AML, SWIFT and ACH<br />\n	Regulatory agencies including the Fed, OCC and FDIC<br />\n	Legislations e.g., BSA, USA Patriot and Dodd Frank<br />\n	Market Environment including Banks, Credit Card Providers, Gateways and eWallets Providers<br />\n	Payment Types e.g., cheques, ACH, Wires, Cards and Virtual Currencies<br />\n	Payment Processing including statuses of a payment lifecycle<br />\n	Industry Standards such as ISO and SEPA<br />\n	Application programming interfaces (APIs)<br />\n	Trends in mobile payments, virtual payments and emerging markets<br />\n	Payments knowledge is critical in almost any role and industry sector &ndash; B2B, B2C and C2C. If you are starting a new job as an Analyst, Engineer, Manager or Sales Representative in the payments industry this course will introduce you into digital payments in a nutshell. Sign up for this course to learn the fundamentals of digital payments today!</p>\n', 'Martin V', 'Web Development', NULL, NULL, NULL, NULL),
(370, 'Udemy', '2016-03-06', 'Crisis Leadership - Winston Churchill', '<p>\n	This course is for people giving serious thought to improving their leadership style and especially their crisis leadership. Only you will know how crisis affects you and where change is required. We use a new technique called Symbolic Modelling, devised by James Lawley and Penny Tompkins, to help you model the mind of the greatest exemplar of crisis leadership - Sir Winston Churchill.</p>\n<p>\n	<br />\n	Specific scenarios from Churchill&#39;s life are illustrated with public domain footage from the period, his speeches and quotes from his books. You are asked to consider your emotional reactions to the events and to reflect upon them at the symbolic or metaphorical level. A key question in this exercise is &quot;And all that&#39;s like what?&quot;</p>\n<p>\n	<br />\n	A fundamental principle of Symbolic Modelling is that you already possess all the inner resources you need to self correct your thinking and behaviour. All you need is to have your attention drawn to aspects of your thought landscape and to muse relectively on the dynamics of your mind.</p>\n<p>\n	<br />\n	Once you are comfortable with your symbolic relationship with crisis leadership, we help you to spot repeating patterns and think about improved outcomes by asking &quot;What would you like to have happen?&quot;The course demands a lot of deep contemplation. Once the process starts change will take place at a subtle level and in unpredictable ways. Be ready to capture any of the effects of change. We are always on hand to provide support. The course content lasts over an hour but the impact and our interest supporting you does not end with the course but lasts for the duration until you can sense recognisable improvement to the point of transformation.</p>\n', 'Peter Urey', 'Project Management', 'Management', NULL, NULL, NULL),
(371, 'Udemy', '2016-03-07', 'Diversity for Dummies: Making Multiculturalism Work', '<p>\n	To build prosperous communities, nurturing schools, and innovative businesses; we require understanding of how to work with people from all walks of life. This course systematically prepares anyone interested in diversity and multiculturalism with important skills to make their environments more inclusive, safe, productive, and connected.</p>\n<p>\n	<br />\n	Concepts covered include the cultural, historical, and philosophical foundations of education in a multicultural society. We begin by outlining the principles of multicultural education, before looking at the connections between issues such as race, class, gender, and sexual orientation.</p>\n<p>\n	<br />\n	We also cover less addressed issues of diversity such as language, geography, religion, and the youth culture. Optional discussions, activities, and a range of additional readings deepen the learning so that anyone taking the class can put the ideas into practice right away.</p>\n', 'Warren Leslie Chalklen', 'Project Management', 'Management', NULL, NULL, NULL),
(372, 'Udemy', '2016-03-07', '10 Things Every Production SQL Server Should Have', '<p>\n	Many organizations don&#39;t have production DBAs so this course can assist them with setting up the very basic necessities for a production SQL Server.</p>\n<p>\n	<br />\n	This is an entry level course and can be taken by developers, network administrators and database administrators. The course is even well suited for those who manage DBAs.</p>\n<p>\n	<br />\n	The course is a real world approach to setting up your SQL Server in a production environment.</p>\n', 'Mike West', 'Web Development', 'Databases', NULL, NULL, NULL),
(373, 'Udemy', '2016-03-07', 'Real World SQL Server From The Ground Up', '<p>\n	SQL Server is one of the most complicated software offerings Microsoft has.<br />\n	<br />\n	This builds upon my course &quot;How To Begin Your Career As a SQL Server DBA.&quot; If you have&#39;t taken it please sign up an take it now. It&#39;s FREE!!<br />\n	<br />\n	This course is my first course filmed entirely in 1080P.<br />\n	<br />\n	This is the first in a multi-part series of courses on SQL Server Administration.<br />\n	<br />\n	You need a solid foundation in networking, databases and programming. This wide range of skills is often difficult to obtain without rigorous learning and years of hands on experience.<br />\n	<br />\n	This course is the first in a two part series that covers much of the foundation of what SQL Server DBAs do and what skills they need to attain in order to excel at their jobs.<br />\n	<br />\n	All of my courses have a real world on component to them. We will cover the topics in our lectures then apply most of them to real world scenarios.<br />\n	<br />\n	The REWARDS YOU will OBTAIN are worth the effort. Here are just a few. DBAs are very well compensated. YOU will get to work with some of the SMARTEST people in the IT world. You&#39;ll LEARN something EVERY DAY. The profession has been and will continue to be one of the highest growth professions. You&#39;ll often get to work remotely.<br />\n	<br />\n	SQL Server Database Administrators are responsible for the design, implementation, support and maintenance of SQL Server Databases. The role also includes architecting, building and scaling databases for future data growth and capacity.<br />\n	<br />\n	DBA are also responsible for security, performance and availability of data to users and customers.<br />\n	<br />\n	This course will give you some direction on how to begin your journey as a SQL Server DBA. I don&#39;t want to create any false promises. In addition to years of experience most Senior Level SQL Server resources have read a voluminous amount of product related material.</p>\n', 'Mike West', 'Web Development', 'Databases', NULL, NULL, NULL),
(374, 'Udemy', '2016-03-07', 'HTML 5 - Learn HTML 5 in 14 steps', '<p>\n	HTML 5 is the leading web development language nowadays. Those days are gone when HTML and CSS were enough to code a web page. Now the demand is high and though the competition. If you want to get a job in some IT company HTML 5 is one of the compulsory language that every web development company expect from their employees. Or if you are a self employed web developer then you are missing the world of innovation in HTML 5. What I am offering in this course? There is a complete training of HTML 5 from Basic level to Advance level in this course. In the starting, at newbie level you will come to know about the basic elements we use in HTML and now in HTML 5. Then you will come to know what are the new elements in this new version of language and what is their use and where to use them. Afterwards, you will come to know about developing your own shapes by writing few lines of code. Then we will move to advance level in which you will learn to embed audios and videos in a professional way without any script and plugin. At the end of the course there is extra section which is optional where you can learn about sockets and server sent events in a detailed way if you want to get deep in back end programming. Why should I buy this course? I could get this information on google also. Definitely, you could get all the details of any thing on the google. But you can&#39;t get all the required and important stuff at one place only. I mean you can get a lot of websites from where you can learn HTML 5 for free. But trust me they are like reading a book. They only says the function of an element and they write a code on how it works. You will never get a practical knowledge. If you buy my course you can learn by watching me writing the codes and explaining the meaning of each and every line. Moreover if you stuck at any part of the course you have to post on various forums and then wait for the members to get a solution. But here, you have many other options. You could read our discussion threads to get your solution. You can start your own discussion thread and I will be there to help you with the best solution. You can even privately message or mail me with your difficulties and I am online most of the time, so you don&#39;t have to wait a lot to get the solution. You can read the curriculum to know more about the topics covering in this course. Plus there is option for all my students to get topics on demand. Let me explain, if you think there is some important topic that I skipped and it need to be posted on the course then you can simply write me and I will publish it for you.</p>\n', 'Ankit Shrivastava', 'Web Development', NULL, NULL, NULL, NULL),
(375, 'Udemy', '2016-03-07', 'Introduction to Google Tools', '<p>\n	&nbsp;This course gives an overview of several powerful Google tools that are free to web site owners. It focuses mainly on Webmaster Tools and Google Analytics. Webmaster Tools helps web site owners track the health of their website. Google Analytics helps web site owners track conversions and visitors.</p>\n', 'Jennifer Martilik', 'Web Development', NULL, NULL, NULL, NULL),
(376, 'Udemy', '2016-03-07', 'Tableau Data Analytics - Must See Introduction to Analytics', '<p>\n	You are interested in learning about Data and Tableau Data Analytics and getting into the wide realm of Data Science. You have probably wondered what is the most practical way of getting your feet wet in Tableau and Data Science (even if you are not interested in this, you should seriously consider so since in the next 10-15 years, Data Science and Artificial Intelligence will be everywhere).<br />\n	<br />\n	I have learned over 14 programming languages such as JAVA, Python, C++, R, Matlab, Ruby, CSS, HTML, Angular JS, Java Script as well as other . I have also had a successful freelancing career programming software and mobile applications and well as working as a finance data analyst. Since technology is changing every day, it is adding new realms of complexity to data science than is already out there. It is getting exponentially harder for new people to learn and navigate the immense amount of data science aspects. My job in this course is to demyistify Tableau and Data Analysis so you can see a clear road to success as a Tableau Data analyst.<br />\n	<br />\n	This course serves to help you navigate Tableau and know what this seemingly difficult concept really is. In this course, I cover what it is like to be a data analyst, what are some jobs of data analysts, what are the sorts of super powers you can possess by learning Tableau Data, and also what resources you will need on your path to development as a Tableau Data Analyst. My hope is to transform you in 4-5 lectures from being a novice to data and what is possible with Tableau to being someone who has a clear idea of whether he/she is interested in Tableau and what path they can take to further their knowledge and harness the POWER of Tableau.<br />\n	<br />\n	There is no risk for you as a student in this course. I have put together a course that is not only worth your money, but also worth your time. This course encompasses the basics of Tableau I urge you to join me on this journey to learn how you can start learning how to dominate data analytics and how you can supercharge your business, marketing, or client with your superb analytics skills.<br />\n	&nbsp;</p>\n', 'Dhruv Bais', 'Software', NULL, NULL, NULL, NULL),
(377, 'Udemy', '2016-03-08', 'Introduction to Web and eCommerce User eXperience Design', '<p>\n	This free, 30-minute course provides an introduction and overview to a track of related courses being developed by The Online User eXperience Institute (OUXI), aimed at the small web business owner and other web designers and developers with little or no prior training in web user experience design.&nbsp; It provides the main foundational points you need to know before taking any of those courses, and they are not repeated in those courses, so please start here.</p>\n', 'Deborah J. Mayhew', 'Web Development', NULL, NULL, NULL, NULL),
(378, 'Udemy', '2016-03-08', 'ADO .Net || Let''s Begin your Era of Programming', '<p>\n	Chances are you&#39;re familiar with the basics of ADO .NET and are hungry to learn more.</p>\n<p>\n	<br />\n	Or perhaps, you&#39;ve taken another course on ado .net and struggled to understand the advanced topics due to poor explanations by trainers without solid knowledge and practical experience. So, you&#39;ve been looking for a course that gives you a clear and in-depth understanding of advance concepts of programming, so you can apply them at work.</p>\n', 'Inspirac technologies', 'Web Development', NULL, NULL, NULL, NULL),
(379, 'Udemy', '2016-03-08', 'Basic overview of Big Data Hadoop', '<p>\n	Big Data is the new Buzz work connecting the new trends of data analytics. Data management has shifted its focus from an important competency to a critical differentiator that can determine market winners. So to run along with latest trends check out this course to understand basics of Big Data.</p>\n<p>\n	<br />\n	Big Data refers to technologies and initiatives that involve data that is too diverse, fast-changing or massive for conventional technologies, skills and infra- structure to address efficiently. Said differently, the volume, velocity or variety of data is too great.</p>\n', 'Jigar Vora', 'Software Development', 'Databases', NULL, NULL, NULL),
(380, 'Udemy', '2016-03-10', 'Learn node.js from scratch', '<p>\n	In this tutorial, you will learn to develop applications using NodeJs, a cutting-edge technology designed to deliver fast, scalable network applications. Beginners will start by learning how to install NodeJs, and how to work with the NodeJs framework and its modules. In additon to informative slides, students will learn nodeJs by doing, developing nodeJs application through a series of screencasts developing increasingly advanced applications.</p>\n', 'Samarth Paboowal', 'Web Development', NULL, NULL, NULL, NULL),
(381, 'Udemy', '2016-03-10', 'AngularJS For Beginners', '<p>\n	HTML works perfectly fine as far as static documents are concerned. If a web application requires dynamic views however, it&#39;s less than ideal. That&#39;s where AngularJS comes in; an open-source framework that extends HTML vocabulary for you application, resulting in intuitive, expressive single page applications. For an AngularJS crash course to get you up to speed with this widely used framework, look no further.</p>\n', 'Stone River eLearning', 'Web Development', NULL, NULL, NULL, NULL),
(382, 'Udemy', '2016-03-10', 'How to Influence Colleagues and Make Friends at Work', '<p>\n	Great communication means much more than just getting your point across, it means connecting. In this short class, coach Fareed Raja talks about helpful techniques for building those important connections that make it easier to come to work every day.<br />\n	He introduces the key helping behaviors, the importance of sharing the spotlight and finding mutual interests, and the good impact that modeling professional behavior can have on the entire team dynamic.</p>\n', 'Fareed Raja', 'Project Management', 'Leadership', NULL, NULL, NULL),
(383, 'Udemy', '2016-03-11', 'EMMET Faster HTML &amp; CSS workflow - Best Tool For Developers ', '<p>\n	On this course I will teach how to use a plugin called emmet to help make your workflow super smooth and efficient. I will show you many handy tricks that will do wonders in saving you time when developing.</p>\n<p>\n	<br />\n	You will become a faster coder in no time and it will be super easy to learn if you already know CSS. Now that I use Emmet, I could NOT imagine living without it.</p>\n', 'Edwin Diaz', 'Web Development', NULL, NULL, NULL, NULL),
(384, 'Udemy', '2016-03-11', 'Geographic Information System for Beginners', '<p>\n	INTRODUCTION TO GIS FOR BEGINNERS: Learn both the theoretical knowledge and practical skills of the latest GIS technologies with easy to follow video lectures and laboratory exercises.<br />\n	This course provides an introduction to GIS, sources of GIS data, GIS data structure and and hands-on practical exercises to processing, downloading, and visualizing large volume of geospatial data in Google Earth Engine platform. Specifically we will cover:</p>\n<ul>\n	<li>\n		Introduction to GIS</li>\n	<li>\n		GIS data structure</li>\n	<li>\n		Sources of GIS data</li>\n	<li>\n		Earth observation data</li>\n	<li>\n		GIS data access</li>\n</ul>\n', 'Alemayehu Midekisa', 'IT', NULL, NULL, NULL, NULL),
(385, 'Udemy', '2016-03-12', 'ArcGIS Explorer Desktop: Your Complete Guide', '<p>\n	Learn ArcGIS Explorer Desktop: Learn both the practical skills of how to use GIS data in ArcGIS Explorer platform with easy to follow video lectures and laboratory exercises.</p>\n<p>\n	<br />\n	This course provides overview on how to download, install, and use ArcGIS Explorer Desktop. Additionally, the course will give hands-on lab exercise on adding GIS data in ArcGIS Explorer, visualizing GIS data, localization of ArcGIS Explorer with multiple languages, and visualizing in 2D and 3D presentation.</p>\n<p>\n	<br />\n	No prior experience required. All are tailored such that anyone can follow them easily.<br />\n	This course will provide you the necessary skills on how to use ArcGIS Explorer Desktop software to visualize and analyze your GIS data. At the end of this course, you will be able to add, visualize, and analyze GIS data in ArcGIS Explorer.</p>\n', 'Alemayehu Midekisa', 'Software Development', NULL, NULL, NULL, NULL),
(386, 'Udemy', '2016-03-12', 'Dropbox Made Easy', '<p>\n	Dropbox is a cloud service that lets you bring your photos, docs, and videos anywhere and share them easily.<br />\n	Today, more than 200 million people, across every continent, use Dropbox to always have their stuff at hand, share with family and friends, and work on team projects.<br />\n	Wherever you are<br />\n	Put your stuff in Dropbox and get to it from your computers, phones, or tablets. Edit docs, automatically add photos, and show off videos from anywhere.<br />\n	Share with confidence<br />\n	Share photos with friends. Work with your team like you&#39;re using a single computer. Everything&#39;s automatically private, so you control who sees what<br />\n	Safe and Secure<br />\n	Even if your phone goes for a swim, your stuff is always safe in Dropbox and can be restored in a snap. Dropbox secures your files with 256-bit AES encryption and two-step verification</p>\n', 'Justin Lawrie', 'Software', NULL, NULL, NULL, NULL),
(387, 'Udemy', '2016-03-12', 'Software project management for start-ups', '<p>\n	This course will teach you software project management fundamentals, and explain how to use those fundamentals, in different business situations.</p>\n', 'Alex Genadinik', 'Project Management', NULL, NULL, NULL, NULL);
