INSERT INTO `wd_wisdom` (`id`, `quote`, `author`, `additional`) VALUES
(1, 'The first responsibility of a leader is to define reality. The last is to say thank you. In between, the leader is a servant.', 'Max DePree', ''),
(2, 'Leadership is the capacity to translate vision into reality.', 'Warren Bennis', ''),
(3, 'Before you are a leader, success is all about growing yourself. When you become a leader, success is all about growing others.', 'Jack Welch', ''),
(4, 'A leader is one who knows the way, goes the way, and shows the way.', 'John Maxwell', ''),
(5, 'My own definition of leadership is this: The capacity and the will to rally men and women to a common purpose and the character which inspires confidence.', 'General Montgomery', ''),
(6, 'Leadership is lifting a person’s vision to high sights, the raising of a person’s performance to a higher standard, the building of a personality beyond its normal limitations.', 'Peter Drucker', ''),
(7, 'To command is to serve, nothing more and nothing less.', 'Andre Malraux', ''),
(8, 'He who has never learned to obey cannot be a good commander.', 'Aristotle', ''),
(9, 'Become the kind of leader that people would follow voluntarily; even if you had no title or position.', 'Brian Tracy', ''),
(10, 'The best executive is the one who has sense enough to pick good men to do what he wants done, and self-restraint enough to keep from meddling with them while they do it.', 'Theodore Roosevelt', ''),
(11, 'A good general not only sees the way to victory; he also knows when victory is impossible.', 'Polybius', ''),
(12, 'A great leader’s courage to fulfil his vision comes from passion, not position.', 'John Maxwell', ''),
(13, 'A leader takes people where they want to go. A great leader takes people where they don’t necessarily want to go, but ought to be.', 'Rosalynn Carter', ''),
(14, 'The challenge of leadership is to be strong, but not rude; be kind, but not weak; be bold, but not bully; be thoughtful, but not lazy; be humble, but not timid; be proud, but not arrogant; have humor, but without folly.', 'Jim Rohn', ''),
(15, 'Outstanding leaders go out of their way to boost the self-esteem of their personnel. If people believe in themselves, it’s amazing what they can accomplish.', 'Sam Walton', ''),
(16, 'A true leader has the confidence to stand alone, the courage to make tough decisions, and the compassion to listen to the needs of others. He does not set out to be a leader, but becomes one by the equality of his actions and the integrity of his intent.', 'Douglas MacArthur', ''),
(17, 'No man will make a great leader who wants to do it all himself, or to get all the credit for doing it.', 'Andrew Carnegie', ''),
(18, 'Leadership is the art of getting someone else to do something you want done because he wants to do it.', 'General Dwight Eisenhower', ''),
(19, 'Leaders think and talk about the solutions. Followers think and talk about the problems.', 'Brian Tracy', ''),
(20, 'A man who wants to lead the orchestra must turn his back on the crowd.', 'Max Lucado', ''),
(21, 'Never tell people how to do things. Tell them what to do and they will surprise you with their ingenuity.', 'General George Patton', ''),
(22, 'As we look ahead into the next century, leaders will be those who empower others.', 'Bill Gates', ''),
(23, 'Great leaders are almost always great simplifiers, who can cut through argument, debate, and doubt to offer a solution everybody can understand.', 'General Colin Powell', ''),
(24, 'He who has learned how to obey will know how to command.', 'Solon', ''),
(25, 'I cannot give you the formula for success, but I can give you the formula for failure, which is: Try to please everybody.', 'Herbert Swope', ''),
(26, 'It is better to lead from behind and to put others in front, especially when you celebrate victory when nice things occur. You take the front line when there is danger. Then people will appreciate your leadership.', 'Nelson Mandela', ''),
(27, 'Lead and inspire people. Don’t try to manage and manipulate people. Inventories can be managed but people must be lead.', 'Ross Perot', ''),
(28, 'Leaders must be close enough to relate to others, but far enough ahead to motivate them.', 'John C. Maxwell', ''),
(29, 'Leadership and learning are indispensable to each other.', 'John F. Kennedy', ''),
(30, 'Leadership is solving problems. The day soldiers stop bringing you their problems is the day you have stopped leading them. They have either lost confidence that you can help or concluded you do not care. Either case is a failure of leadership.', 'Colin Powell', ''),
(31, 'Leadership is unlocking people''s potential to become better.', 'Bill Bradley', ''),
(32, 'Management is about arranging and telling. Leadership is about nurturing and enhancing.', 'Tom Peters', ''),
(33, 'One of the tests of leadership is the ability to recognize a problem before it becomes an emergency.', 'Arnold Glasow', ''),
(34, 'The final test of a leader is that he leaves behind him in other men, the conviction and the will to carry on.', 'Walter Lippman', ''),
(35, 'The growth and development of people is the highest calling of leadership.', 'Harvey Firestone', ''),
(36, 'To do great things is difficult; but to command great things is more difficult.', 'Friedrich Nietzsche', ''),
(37, 'A good leader is a person who takes a little more than his share of the blame and a little less than his share of the credit.', 'John Maxwell', ''),
(38, 'There are three essentials to leadership: humility, clarity and courage.', 'Fuchan Yuan', ''),
(39, 'A good plan violently executed now is better than a perfect plan executed next week.', 'George Patton', ''),
(40, 'The supreme quality of leadership is integrity.', 'Dwight Eisenhower', ''),
(41, 'The real leader has no need to lead - he is content to point the way.', 'Henry Miller', ''),
(42, 'Be willing to make decisions. That''s the most important quality in a good leader.', 'George S. Patton', ''),
(43, 'The ultimate measure of a man is not where he stands in moments of comfort, but where he stands at times of challenge and controversy.', 'Martin Luther King, Jr.', ''),
(44, 'The pessimist complains about the wind. The optimist expects it to change. The leader adjusts the sails.', 'John Maxwell', ''),
(45, 'True leaders are the first to admit that they don''t know everything and that they need help.', 'Bill Byrd', ''),
(46, 'The ultimate leader is one who is willing to develop people to the point that they eventually surpass him or her in knowledge and ability.', 'Fred A. Manske, Jr.', ''),
(47, 'In preparing for battle I have always found that plans are useless, but planning is indispensable.', 'Dwight D. Eisenhower', ''),
(48, 'Adding manpower to a late software project makes it later.', 'Fred Brooks', 'Brooks''s Law'),
(49, 'Nine women can''t make a baby in one month.', 'Fred Brooks', 'Brooks''s Law (addition)'),
(50, 'Organizations which design systems ... are constrained to produce designs which are copies of the communication structures of these organizations.', 'Melvin Conway', 'Conway''s Law'),
(51, 'The best way to get the right answer on the Internet is not to ask a question, it''s to post the wrong answer.', 'Ward Cunningham', 'Cunningham''s Law'),
(52, 'It always takes longer than you expect, even when you take into account Hofstadter''s Law.', 'Douglas Hofstadter', 'Hofstadter''s Law'),
(53, 'Given enough eyeballs, all bugs are shallow', 'Eric Raymond', 'Linus''s Law'),
(54, 'Before software can be reusable it first has to be usable.', 'Ralph Johnson', ''),
(55, 'The first 90% of the code accounts for the first 90% of the development time. The remaining 10% of the code accounts for the other 90% of the development time.', 'Tom Cargill', ''),
(56, 'In order to understand recursion, one must first understand recursion.', 'Unknown', ''),
(57, 'Measuring programming progress by lines of code is like measuring aircraft building progress by weight.', 'Bill Gates', ''),
(58, 'There are 10 kinds of people in the world, those who can read binary and those who cannot.', 'Unknown', ''),
(59, 'Walking on water and developing software from a specification are easy if both are frozen.', 'Edward V. Berard', ''),
(60, 'The three chief virtues of a programmer are: Laziness, Impatience and Hubris.', 'Larry Wall', ''),
(61, 'Data is a precious thing and will last longer than the systems themselves.', 'Tim Berners-Lee', ''),
(62, 'You want it in one line? Does it have to fit in 80 columns?  :-).', 'Larry Wall', ''),
(63, 'How does a project get to be a year late? ... One day at a time.', 'Fred Brooks', 'The Mythical Man Month');
